 insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('1','','[샌드위치] 속을 [빨간] 것으로 만드는 꿈 ','음식물에관한꿈','대개는 성적인 의미가 크며 이성에게 자신을 바치고 <BR>싶어하는 마음이 있기 때문이다. 정성들여 예쁘게 만<BR>지는 꿈은 화장을 하여 자신의 몸을 가꾸려는 심리를 <BR>나타낸다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2','','[샌드위치]나 [생과자] 등 맛있는 [과자]가 잔뜩 [그릇]<BR>에 담긴 꿈<BR>&nbsp;','음식물에관한꿈','누가 보아도 고급스럽다고 할만한 일거리를 맡게 되거<BR>나 진행중인 혼담이 성사된다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3','','[샌드위치]에 관한 꿈 ','음식물에관한꿈','샌드위치 꿈은 대개 여자가 많이 꾸는 꿈으로 상대방<BR>이 즐겁게 먹기를 바라는 마음이 있다. 샌드위치는 자<BR>기자신을 나타낸다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4','','[짜장면], [국수], [라면]등의 [음식]을 먹는 꿈 ','음식물에관한꿈','좋은 인연이 맺어지며 원만한 교제 및 순탄한 거래가 <BR>이루어지며 이권이 늘어나게 된다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5','','[자기] [얼굴]은 물론 [남]의 얼굴까지도 검게 보이는 <BR>꿈 ','사람의몸에관한꿈','평소 꺼려하던 사람과 만나거나 거래 등을 하게 되는<BR>꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('6','','[얼굴]과 얼굴이 겹쳐 보이는 꿈 ','사람의몸에관한꿈','서로 다른 상표의 선물을 받거나 집안의 가구 등을 옮<BR>기게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7','','[얼굴]이 [검은] [아이]를 보는 꿈 ','행동에관한꿈','누구나 싫어하는 일을 떠맡게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('8','','[얼굴] 부위를 [수술]하는 꿈 ','사람의몸에관한꿈','자신의 주위에서 무언가 옮겨지는 일을 행하게 되는 <BR>꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9','','[얼굴] [전체]를 [붕대]로 감은 사람을 보는 꿈 ','행동에관한꿈','누구에게 사기를 당하거나 불의의 사고를 당하게 되는<BR>꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('10','','[얼굴]이 [거울]에 맑게 비치는 꿈 ','옷과악세사리에관한꿈','예기치 않았던 사람을 만나거나 소식을 전해듣게 되는<BR>꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('11','','깨끗하게 [세수]를 하는 꿈 ','행동에관한꿈','승진을 하거나 쌓였던 걱정거리가 없어지게 되는 꿈이<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('12','','[얼굴]의 한 부분을 [수술]하는 꿈 ','사람의몸에관한꿈','관직에 있는 사람에 의해서 심문을 받거나 고문을 받<BR>게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('13','','[얼굴]에 [주사]를 맞는 꿈 ','사람의몸에관한꿈','직장이나 집안 일에 변화가 있는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('14','','[얼굴]에 [종기]가 나는 꿈 ','질병에관한꿈','자신이 한 행동이나 일들이 남의 입에 오르내려 구설<BR>수에 휘말리게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('15','','[얼굴]을 가린 [사람]을 만나는 꿈 ','행동에관한꿈','전혀 신분을 모르는 사람으로부터 폭행 등의 피해를 <BR>당하게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('16','','[이빨]이 부러지는 꿈 ','사람의몸에관한꿈','어떤 병에 걸리거나 하는 사업에 지장이 있을 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('17','','앓던 [이빨]이 빠지는 꿈 ','사람의몸에관한꿈','병중에 있던 환자가 사망을 하거나 자기가 부리던 직<BR>원이 사표를 내고 퇴사하게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('18','','[거울]에서 자기 [덧니]를 보는 꿈 ','옷과악세사리에관한꿈','부인 이외의 여자와 관계를 갖거나 사업상의 동업자가<BR>나타나게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('19','','[남]의 [이빨]이 빠져서 [피]가 흐르는 꿈 ','사람의몸에관한꿈','자기에게 방해가 됐던 사람이 사망하거나 사직을 당해<BR>자신에겐 큰 이득이 되는 일이 생길 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('20','','[이빨] 하나가 빠지는 꿈 ','사람의몸에관한꿈','일가친척 중의 한 사람이 죽거나 아니면 이별을 하게 <BR>되며 자기 주위의 이로웠던 사람과도 헤어지게 되는 <BR>꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('21','','애들 [이빨]이 새로 나는 것을 보는 꿈 ','사람의몸에관한꿈','소원이 성취되거나 그간 부족했던 것이 채워지게 되는<BR>꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('22','','윗 [이빨] 중의 하나가 빠지는 꿈 ','사람의몸에관한꿈','윗사람 중의 한 명에게 변동이 생기게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('23','','[이빨]이 검고 누렇게 변하는 꿈 ','사람의몸에관한꿈','집안이나 직장 등에서 좋지 않은 일이 발생하게 되는<BR>꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('24','','[이빨]을 뽑았는데 [허전함]을 느끼는 꿈 ','사람의몸에관한꿈','세상에 자기 혼자 있는 것 같은 고독감을 맛볼 일이 생<BR>기게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('25','','[이빨]이 하나도 남김없이 빠져버리는 꿈 ','사람의몸에관한꿈','자신이 하고 있는 일 전체에 큰 변화가 생기게 되는 꿈<BR>이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('26','','[이빨]의 [일부]가 빠지는 꿈 ','사람의몸에관한꿈','자신이 하고 있는 일의 일부분에 변화가 생기게 되는<BR>꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('27','','저도 모르는 사이에 [이빨]이 빠지는 꿈 ','사람의몸에관한꿈','평소 존경하던 사람이 죽게 되거나 좋지 않은 소식을<BR>듣게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('28','','빠진 [이빨] 대신 물리적인 이빨을 해 넣는 꿈 ','사람의몸에관한꿈','관계없던 사람과 만나 친분을 맺게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('29','','해 넣은 [이빨]이 밝게 빛나는 꿈 ','사람의몸에관한꿈','능력 있는 직원을 얻거나 훌륭한 사람과 관계하게 되<BR>는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('30','','[이성]이 [성기]를 보여주는 꿈 ','성과섹스에관한꿈','사업상 유혹을 받을 일이 있거나 자신의 실력을 자랑<BR>할 일이 생기게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('31','','[남자]가 [여자]의 [성기]를 만지는 꿈 ','성과섹스에관한꿈','동업자가 생겨 사업을 같이 하거나 남의 물건을 감정<BR>할 일이 생기게 되는 꿈이다. <BR>','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('32','','[자기] [성기]를 꺼내놓고 [자랑]하는 꿈 ','성과섹스에관한꿈','자기의 작품성이 있는 물건이나 자식을 자랑할 일이 <BR>생기게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('33','','전혀 거리낌없이 사람들에게 자기 [성기]를 꺼내 보이<BR>는 꿈&nbsp;','성과섹스에관한꿈','자기가 만든 물건이나 자식들을 남 앞에서 자신 만만<BR>하게 자랑할 일이 생기게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('34','','강한 [성욕]을 느꼈으면서도 [성교]를 하지 못하는 꿈 ','성과섹스에관한꿈','하는 일이 심하게 꼬이고 기혼자는 자식이 대들 일이<BR>생기게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('35','','남의 [성기]가 굉장히 커 보였는데 알고 보니 [모조품]<BR>인 꿈<BR>&nbsp;','성과섹스에관한꿈','누구에게 감언이설로 속았던 사실을 깨닫게 되거나 어<BR>떤 물건에 대해 과대평가 했던 걸 비로소 깨닫게 되는<BR>꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('36','','[이성]의 [성기]가 유난히 훌륭하다고 생각하며 최상의 [성교]를 나누는 꿈','성과섹스에관한꿈','자신이 어떤 일을 했을 때 주위로부터 칭찬을 받게 되<BR>는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('37','','[남자]가 [여자]의 [성기]를 달고 있는 꿈 ','성과섹스에관한꿈','활동적인 사업을 벌이거나 현재 벌이고 있는 상태라면<BR>좋을 결과를 얻게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('38','','[여자]가 [소변]보는 모습을 [감상]하는 꿈 ','성과섹스에관한꿈','경쟁자에게 뒤떨어지거나 경쟁을 했던 사람이 크게 성<BR>공하자 패배의식에 빠져 몹시 괴로워하게 되는 꿈이<BR>다. <BR>','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('39','','[여자]가 [남성]의 [성기]를 만지작거리는 꿈 ','성과섹스에관한꿈','가까운 사람들로 인하여 정신적으로 괴로움을 당하게<BR>되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('40','','[남]이 [자기] [성기]를 볼까봐 [고심]하는 꿈 ','성과섹스에관한꿈','자신이 했던 일에 심한 부끄러움을 느끼며 의기소침해<BR>질 일이 생기게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('41','','[여자]가 [남성]의 [성기] 두개를 놓고 [비교] [검토]하<BR>는 꿈 <BR>','성과섹스에관한꿈','모든 일에 자신을 포함한 삼각관계가 형성돼 쉽게 단<BR>안을 내리지 못할 일이 생기게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('42','','[노력]을 하는데도 [성기]가 [발기불능]이 돼 [초조]해 <BR>하는 꿈<BR>','성과섹스에관한꿈','하고 있는 일에 대해 애착이 가지 않으며 결국은 실패<BR>하게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('43','','[상반신]을 벗고 [일]을 하는 꿈 ','성과섹스에관한꿈','무슨 일을 하든 윗사람으로부터 협조를 받지 못하게 <BR>되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('44','','[하반신]을 벗고 [일]을 하는 꿈 ','성과섹스에관한꿈','무슨 일을 하든 아랫사람에게 협조를 받지 못하게 되<BR>는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('45','','[나체쇼]를 [구경]하는 꿈 ','성과섹스에관한꿈','자신과는 전혀 무관한 싸움구경을 하게 되는 꿈이다.<BR>&nbsp;','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('46','','[거울]을 앞에 놓고 [옷]을 모두 벗는 꿈 ','성과섹스에관한꿈','몹시 반가운 사람을 만나는데 그 사람으로부터 신세한<BR>탄을 듣게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('47','','[벌거숭이]가 됐는데 그 [알몸]을 가리지 못해 몹시 [당<BR>황]하는 꿈<BR>&nbsp;','성과섹스에관한꿈','사업상의 일로 자신을 도와줄 사람이 없어 애태우게 <BR>되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('48','','[옷]을 벗은 채로 꼿꼿이 서서 [대소변]을 보면서도 전<BR>혀 부끄러워 하지 않는 꿈<BR>&nbsp;','배설물에관한꿈','자기만이 간직하고 있던 좋지 않은 비밀을 누군가에게<BR>털어놓고 후련한 마음을 갖게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('49','','[옷]을 말쑥하게 입고 있는 꿈 ','옷과악세사리에관한꿈','하는 일 모두가 순조로워서 거리낄 것이 없게 되는 꿈<BR>이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('50','','[알몸]인 상태로 [성교]를 하는 꿈 ','성과섹스에관한꿈','사업 등의 일로 인한 대인관계에서 감추어야 할 일이 <BR>전혀 생기지 않게 되는 꿈이다. ','N');
