insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('1951','','여러 사람이 모여서 [음식]을 먹는데 자기의 [그릇]이 <BR>유난히 돋보이는 꿈&nbsp;','음식물에관한꿈','진급을 하게 되고 남보다 뛰어난 사람으로 평가를 받<BR>게 되는 꿈이다. ','N');
