insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('1953','','어두운 곳에서 [식사]를 하는 꿈 ','음식물에관한꿈','혼자서만 알고 있어야 할 비밀이 생기게 되고 자신이<BR>없는 일을 책임지게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('1954','','[음식]을 만드는데 [설탕]을 사용하는 꿈 ','음식물에관한꿈','작품을 만들거나 일을 해도 좋은 기분으로 하며 그 일<BR>의 결과에 많은 사람들이 감탄을 하게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('1955','','[집]안 구석구석에서 [식초][냄새]가 [진동]하는 꿈 ','음식물에관한꿈','자기와 관련된 소문이 떠돌아다니게 되며 그 일로 인<BR>하여 많은 생각을 하게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('1956','','[우유]가 들어있는 [깡통]이 [공중]에 둥둥 떠다니는 걸<BR>보는&nbsp;꿈&nbsp;','음식물에관한꿈','자신의 실력을 세상에 널리 알릴 기회가 찾아 올 것이<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('1957','','[미원]이나 기타의 화학[조미료]를 사용해서 [음식]을 <BR>만드는 꿈&nbsp;','음식물에관한꿈','무슨 일을 하든 기분 좋게 처리가 되며 그로 말미암아<BR>자신의 능력을 인정받게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('1958','','[소금]이 넓은 [들판]에 산더미처럼 쌓여 있는 꿈 ','음식물에관한꿈','감히 상상할 수 없었던 큰 사업을 벌이게 되며 자금 사<BR>정이 원활치 않아 부채를 짊어지게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('1959','','여러 가지의 [과자]류가 [그릇]에 넘치도록 들어 있는 <BR>꿈 ','음식물에관한꿈','누가 보아도 고급스럽다고 할 만한 일거리를 맡게 되<BR>거나 진행중인 혼담이 성사되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('1960','','[반찬]거리가 [부엌]에 가득 쌓여 있는 꿈 ','음식물에관한꿈','사업을 계획해 놓고도 자금이 없어 실행에 옮기지 못<BR>했으나 사업자금이 해결되게 되는 꿈이다. ','N');
