insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('1962','','[정육점]에서 [고기]를 사오는 꿈 ','음식물에관한꿈','많은 액수의 금전거래를 계획했었으나 예상이 빗나가<BR>적은 액수의 거래밖에 이루어지지 않게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('1963','','[된장]이나 [고추장] [항아리]에 [구더기]가 득실거린 <BR>걸 보는 꿈&nbsp;','음식물에관한꿈','사업자금으로 마련했던 돈으로 예상 밖의 일에 투자하<BR>게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('1964','','어떤 형태로든 [소금]과 연관되는 꿈 ','음식물에관한꿈','예기치 않았던 걱정거리가 생길 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('1965','','[음식]을 먹는데 그 [맛]이 너무 [신] 꿈 ','음식물에관한꿈','자신 있게 처리했던 일의 일부분이 잘못되어 노출되게<BR>되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('1966','','[고추]를 [원료]로 해서 만든 [음식]을 먹는 꿈 ','음식물에관한꿈','활동적이고 추진력이 요망되는 직업을 얻게 되는 꿈이<BR>다. ','N');
