insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('1968','','확실하지는 않지만 누군가가 [죽었다]는 생각이 드는 <BR>꿈 ','죽음에관한꿈','자신과 연결돼 있는 어떤 일이 이루어지게 되는 꿈이<BR>다. ','N');
