insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('1970','','[부모상]을 당하고 [대성통곡]을 하는 꿈 ','죽음에관한꿈','정신적인 안정과 물질적인 부를 누리게 되고 계획했던<BR>일을 착수하게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('1971','','자신이 아무런 [고통]도 느끼지 않고 [안락사]하는 꿈 ','죽음에관한꿈','심사기관에 제출한 서류나 출품한 작품 등이 좋은 결<BR>과를 얻게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('1972','','[죽은] [사람]의 [소지품]이나 [유서] 등 그와 관련된 물<BR>건이 나오는 꿈&nbsp;','죽음에관한꿈','자신이 TV, 라디오 등에 출연하게 되거나 매스컴을 타<BR>게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('1973','','[사람]이나 [짐승] 등 움직이는 [생명체]가 [죽는] 꿈 ','죽음에관한꿈','자신이 없었던 일, 꺼려했던 일이 잘 해결되는 꿈이다. ','N');
