insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('1975','','[집]에 [초상]이 나는 꿈 ','죽음에관한꿈','직장이나 자기와 관련된 사업장에서 평소 생각했던 문<BR>제가 이루어 질 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('1976','','[상여] 앞에 수없이 많은 [만장]이 늘어서 있는 것을 보<BR>는 꿈&nbsp;','죽음에관한꿈','하는 일마다 실패를 거듭하게 되나 멀지 않은 때에 기<BR>관의 협조를 받아 세상 사람들이 놀랄만한 일을 성사<BR>해 명성을 얻게 되는 꿈이다. ','N');
