insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('1986','','[집]에 [초상]이 나서 [울음][소리]가 천지를 진동할 정<BR>도인 꿈&nbsp;','죽음에관한꿈','먼 곳까지 소문이 날 정도로 사업이 번창하거나 좋은<BR>일이 생기게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('1987','','심하게 썩는 [송장][냄새]를 맡은 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','사람들의 입에 오르내릴 만큼 많은 재물을 얻게 되는<BR>꿈이다. ','N');
