insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('1989','','썩은 [송장] [물]이 시냇물처럼 흘러가는 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','사업이 번창해지고 자신이 한 말에 많은 사람들이 감<BR>명을 받게 되는 꿈이다. ','N');
