insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('1991','','[시체]가 정확한 [발음]으로 [말]을 하는 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','현상공모에 응모한 작품이 입상했다는 소식을 듣게 되<BR>는 꿈이다. ','N');
