insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('1993','','[시체]를 [공동묘지]에 묻는 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','사회사업에 참여하라는 부탁을 받고 얼마간의 돈을 기<BR>부할 일이 생길 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('1994','','[직계][가족]이나 가까운 [친척]이 [사망]하자 몹시 슬<BR>프게 우는 꿈&nbsp;','죽음에관한꿈','심혈을 기울여 완성해 놓은 일을 되새기거나 작품을<BR>감상하며 흐뭇해 할 일이 생길 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('1995','','[시체]를 [운반]하는 [사람]들을 보는 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','자기에게 돌아가리라고 예상했던 일거리를 다른 사람<BR>이 가로채 가거나 일은 자기가 하고 칭찬은 다른 사람<BR>이 받는 일이 생길 것 같다. ','N');
