insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2429','','[손등]에 [털]이 곱게 나있는 꿈 ','사람의몸에관한꿈','창작,요리, 기술 등을 상징하는 길모으로, 새로운 일을<BR>맡는다거나 발전된 일을 이끌어 금전적인 이익도 가질<BR>것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2430','','[긴머리] [처녀]나 [총각]을 꿈에서 보는 꿈 ','사람의몸에관한꿈','좀 고집이 세긴 하지만, 무슨 일에나 솔선수범하는 협<BR>력자를 만나게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2431','','[자신]의 [눈썹]이 머리카락처럼 길게 자라고 있는 꿈 ','사람의몸에관한꿈','어떤 형태로든 금전적인 이익을 얻게 되고, 연애운의<BR>상승으로 원하는 이성과 좋은 일이 있을 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2432','','시커멓고 빳빳한 [털]이 수북하게 난 여자의 [음부]를 <BR>보는 꿈&nbsp;','사람의몸에관한꿈','팔자가 사납고 고된 시집살이를 상징하는 꿈으로, 순<BR>간이나마 운세가 사납고, 하는 일마다 되는 일이 없어<BR>서 고통스러울 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2433','','자신의 [눈썹]이 희게 된 것을 보는 꿈 ','사람의몸에관한꿈','자주 모이는 단체나 일,직장 등에서 지도자가 될 것을<BR>암시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2434','','헝클어진 [머리카락]을 [빗]으로 빗는 꿈 ','사람의몸에관한꿈','복잡한 일이나 근심 등이 제3자의 도움으로 원만하게 <BR>해결되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2435','','[몸]에 [털]이 난 사람을 보는 꿈 ','사람의몸에관한꿈','거래상으로 만난 사람이 솔직하지 않아서 그와 싸우거<BR>나 언쟁이 생길 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2436','','자기의 [몸]에 [짐승]처럼 [털]이 많이 나있는 꿈 ','사람의몸에관한꿈','단체의 우두머리로 추대되거나 많은 사람으로부터 도<BR>움을 받게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2437','','[뱃속]에 들어 있는 [털]을 끄집어내는 꿈 ','사람의몸에관한꿈','객지에 가 있던 친척이나 가까운 사람이 갑자기 돌아<BR>올 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2438','','[기름]을 발라 [머리]에서 [윤기]가 나는 꿈 ','사람의몸에관한꿈','자신의 모습이 남에게 돋보이게 되고 바라던 일이 순<BR>조롭게 이루어질 징조이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2439','','자신이 [머리]를 감거나 깔끔하게 빗는 꿈 ','사람의몸에관한꿈','걱정 근심하던 일이 순조롭게 해결되고, 멀리에서 반<BR>가운 손님이 찾아올 징조이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2440','','[면도]나 [이발]을 하는 꿈 ','사람의몸에관한꿈','매사가 만족스럽게 진행되고 꼬였던 일도 속 시원하게<BR>풀릴 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2441','','[머리]를 빡빡 깍은 [사내][아이]를 보는 꿈 ','사람의몸에관한꿈','불길, 시비 ,싸움 등을 암시하는 흉몽으로, 온종일 재수<BR>없는 일만 생기고, 하는 일마다 꼬영서 어려움을 겪게 <BR>될 징조이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2442','','[머리카락]이 [입] 속에 가득 차는 꿈 ','사람의몸에관한꿈','집안에 환자가 생겨 오랫동안 고생하게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2443','','[머리]에 [가발]을 쓰거나 [턱]에 [수염]을 다는 꿈 ','사람의몸에관한꿈','당분간 가까운 사람에게 협조를 구할 일이 생길 것이<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2444','','자신의 [머리카락]이 검어지거나 희어지는 꿈 ','사람의몸에관한꿈','머리카락이 검어지면 부귀를 얻게 될 징조이고, 백발<BR>이 되면 장수할 징조이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2445','','[머리]를 빗는데 [비듬]이나 [이]가 떨어지는 꿈 ','사람의몸에관한꿈','오랜 걱정이 해소되고 집안에도 작은 근심이 사라지는<BR>등 미궁에 빠졌던 일이 순조롭게 풀릴 징조이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2446','','다른 [사람]이 [머리]를 감거나 깔끔하게 [빗는] 것을 <BR>보는 꿈&nbsp;','사람의몸에관한꿈','스스로 자해하거나 누군가가 자신이 못되는 것을 좋아<BR>하는 등 어이없는 일을 당하게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2447','','[머리카락]이 하얗게 보이는 꿈 ','사람의몸에관한꿈','장수하고 운수가 대통할 징조이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2448','','[머리카락]이 뒤죽박죽 [엉켜서] [빗질]하기가 어려운 <BR>꿈 ','사람의몸에관한꿈','집안에 걱정거리가 생기고, 하는 일도 제대로 풀리지 <BR>않을 징조이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2449','','다른 사람에 의해 [강제로] [머리]를 [깎이는] 꿈 ','사람의몸에관한꿈','집안에 근심이 생기는 것으로, 배우자나 자녀 가운데 <BR>누군가가 해를 당하게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2450','','[손등]이나 [종아리]에 [털]이 나있는 사람을 보는 꿈 ','사람의몸에관한꿈','아무리 보아도 자신보다 수단이 있고, 재간이 많은 사<BR>람과 관계하여 손해볼 일이 있을 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2451','','앉은 키가 [하늘]을 닿을 듯하고 [수염]이 엄청 긴 [거<BR>인]을 보는 꿈&nbsp; ','사람의몸에관한꿈','자신의 매사에 도움이 될 만큼 실력있고 덕망있는 협<BR>력자를 만나 이익을 얻게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2452','','[가슴]에다 찬란한 [태양]을 안는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','일국의 통치자나 세계적으로 훌륭한 인물이 될 것을 <BR>암시하는 최고의 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2453','','이미 [성인]이 된 자신의 [어머니]의 [젖]을 먹는 꿈 ','가족 친척 부부에 관한꿈','집안에서 재산다툼이 있거나 사업관계로 이익을 나눠<BR>받을 징조이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2454','','[가슴]을 풀어헤친 [여자]를 보는 꿈 ','사람의몸에관한꿈','주변 인물이 위험에 처하고, 그 일에 자신의 도움이 필<BR>요할 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2455','','앞[가슴]에 [훈장]을 다는 꿈 ','행동에관한꿈','남 앞에서 자신의 실력을 과시할 수 있는 기회가 주어<BR>질 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2456','','[상대방]의 [가슴]을 세게 때리거나 [칼]로 찌르는 꿈 ','칼 창 북 종 화살 방패 총에관한꿈','경쟁자의 사업체나 자기가하는 일의 핵심부에 충격을 <BR>가해 이득을 얻게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2457','','푸른 [거목]을 [가슴]으로 안는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','확실한 실력자를 만나 지도와 도움을 받고 입신출세하<BR>게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2458','','어떤 [괴한]이 자신의 가슴팍에 올라앉아 [괴롭히는]<BR>꿈 ','행동에관한꿈','부부나 형제간에 좋지 않은 일이 일어날 징조이며, 질<BR>병으로부터 기관지에 이상이 있을 수 있으나, 흡연이<BR>나 공해에 주의하는 것이 좋다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2459','','[상대방]의 [가슴]이 점점 좁아지는 꿈 ','사람의몸에관한꿈','상대방과 자신의 뜻이 통하지않아 답답해질 일을 암시<BR>하는 꿈으로, 나이답지 않게 철없는 답답한 사람을 만<BR>나거나 남의 얘기를 전혀 귀담아 듣지 않는 사람을 만<BR>나게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2460','','처음 본 [여자]에게 [칼]로 [가슴]을 찔리는 꿈 ','칼 창 북 종 화살 방패 총에관한꿈','여기서 처음 본 여자는 간호원을 상징하여, 병에 걸려<BR>수술할 일이 생길 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2461','','자신의 [남근]이 [용]의 [머리]로 변하는 꿈 ','용과관련된꿈','추진하던 일에 확실한 발전과 성과가 있고, 넘치는 힘<BR>과 정신력으로 일약 스타가 될것을 암시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2462','','자신에게 [이성]이 [성기]를 보여주는 꿈 ','성과섹스에관한꿈','사업상 누군가로부터 유혹을 받을 일이 있거나 자신의<BR>실력을 다른 사람에게 드러낼 일이 생길 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2463','','[남근]이 기둥만큼 커보이는 꿈 ','성과섹스에관한꿈','힘차고 일사불란하게 자신의 업무를 수행하게 되는 꿈<BR>이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2464','','[남근]이 점점 [작아지는] 꿈 ','성과섹스에관한꿈','집안의 재물이 밖으로 새어 나가게 되어 어려움을 겪<BR>게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2465','','[남근] [귀두]에 예쁜 [꽃][고리]를 하는 꿈 ','성과섹스에관한꿈','합궁,즐거움 등 연애운의 암시로, 남녀가 함께 좋은 곳<BR>에서 사랑을 나누거나 기쁨을 나누게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2466','','[남자]가 [여자]의 [성기]를 만지작거리는 꿈 ','성과섹스에관한꿈','집안의 재물이 밖으로 새어나가고 매사 어려움을 겪게<BR>되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2467','','[남자]가 [여자]의 [성기]를 만지작거리는 꿈 ','성과섹스에관한꿈','남과 함께 동업을 하거나 남의 물건을 감정할 일이 있<BR>을 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2468','','[남자]가 [여자]의 [성기]를 달고 있는 꿈 ','성과섹스에관한꿈','현재 하고 있는 일에 좋은 결과를 얻어 확실한 발전이<BR>있을 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2469','','[청룡]이 [여성]의 [치마] 속으로 들어가는 것을 보는 <BR>꿈 ','용과관련된꿈','태몽으로, 부인과 새댁은 임신을 하여 훌륭한 자식을<BR>낳게 될 것이며, 애정면에 있어서도 강한 상승기류로<BR>원하고 있는 이성과의 원만한 관계도 기대할 수 있을 <BR>것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2470','','[자신]의 [성기]가 부러지는 꿈 ','사람의몸에관한꿈','지금까지 해오던 일들이 장애물에 부딪혀 중단되고 많<BR>은 어려움을 겪게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2471','','[남근]의 [귀두]에 파란 [옥][구슬]이 매달리는 꿈 ','사람의몸에관한꿈','성적인 욕구를 나타내는 것으로, 바른 정도를 지키면<BR>운수가 대통하고,정도를 잃게 디면 패가망신하게 됨을<BR>알리는 꿈이예요. 이성과 달콤한 사랑을 하게 될 것을 <BR>예시하기도 하지만, 특히 성병이나 질병에 주의해야 <BR>할 시기이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2472','','모르는 [여자]한테서 [자신]의 [남근]을 떼이는 꿈 ','사람의몸에관한꿈','바람기가 동하여 바깥 출입이 잦아지게 될 징조이며, <BR>재물과 돈을 떼일 수도 있으니 매사에 신중하는 것이 <BR>좋다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2473','','[치한]이 [여성]의 [성기]를 강제로 만지는 꿈 ','성과섹스에관한꿈','구설수에 시달리거나 불운의 암시로, 대중 앞에서 망<BR>신당할 일이 생길 좋지 못할 징조이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2474','','[여자]가 [소변] 보는 모습을 숨어서 [구경]하는 꿈 ','배설물에관한꿈','경쟁자에게 뒤떨어지거나 자기의 경쟁자가 크게 성공<BR>한 것을 보고 패배의식에 사로잡혀 괴로워하게 되는 <BR>꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2475','','[여성]의 [성기]에서 [금은보화]가 쏟아져 나오는 꿈 ','사람의몸에관한꿈','많은 재물과 돈이 생기거나 여자로 인해 도움을 받게 <BR>되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2476','','[여성]의 [성기]에 붉은 [꽃]이 피어 있는 꿈 ','성과섹스에관한꿈','여자가 이러한 꿈을 꾸었을 때는 첫월경을 의미하고 <BR>합궁, 임신 등을 암시하는 꿈으로 새로운 일이 시작을 <BR>알리는 징조이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2477','','[여성]의 [성기]가 [배꼽] 위에 있는 꿈 ','사람의몸에관한꿈','매사에 경박하지 않도록 주의해야 할 꿈으로, 천박한<BR>행동으로 인하여 남의 눈총을 사게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2478','','[남]의 [성기]와 [자신]의 성기를 [비교]하는 꿈 ','사람의몸에관한꿈','남의 일과 비교할 일이 생기며, 내 자식과 남의 자식을<BR>비교할 일이 있을 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2479','','[여자]가 [남성]의 [성기] 둘을 놓고서 [비교] 검토하는 <BR>꿈 <BR>','성과섹스에관한꿈','모든 일에 삼각 관계가 생겨 쉽게 결단을 내리지 못하<BR>게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2480','','다른 사람이 [자신]의 [성기]를 볼까봐 [걱정]하는 꿈 ','사람의몸에관한꿈','자신이 행한 일에 대해 심한 부끄러움을 느끼며 의기<BR>소침해질 일이 생길 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2481','','[땅]을 파서 [몸]을 묻는 꿈 ','행동에관한꿈','그동안 모아오던 재산이 불어나게 되고 저축이 많아질<BR>징조이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2482','','온[몸]에서 [피]고름이 흐르는 꿈 ','피에관한꿈','하는 일이 순조롭게 풀리고 행운이 따를 징조이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2483','','[옷]을 벗었는데 전혀 부끄럽게 생각되지 않는 꿈 ','옷과악세사리에관한꿈','자신과 관계된 모든 일을 만인에게 공개할 일이 있을<BR>것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2484','','자신의 온[몸]에서 진[땀]이 흐르는 꿈 ','사람의몸에관한꿈','타인으로 인해 자신에게 좋지 않은 일이 일어나게 되<BR>는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2485','','갈라진 [땅] 속으로 자신의 [몸]이 빠지는 꿈 ','사람의몸에관한꿈','자신이나 주변 사람에게 불길한 일이 일어날 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2486','','[남] 앞에서 [옷]을 벗은 채로 부끄럽지 않게 [대][소변]<BR>을 보는 꿈&nbsp;','배설물에관한꿈','자기만 알고 있던 나쁜 비밀을 누군가에게 털어놓게 <BR>되어 가슴이 후련해질 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2487','','[발가벗은] [자신]의 모습에 [매혹]되는 꿈 ','행동에관한꿈','자신의 신분이 상승하거나 배우자,형제 등에 의해서<BR>귀하게 대접받을 일이 있을 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2488','','자신의 [나체]를 [부끄럽게] 생각하는 꿈 ','행동에관한꿈','자신이 개인적인 비밀이 드러나지 않기를 바라거나 그<BR>일로 인해 창피당할 징조이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2489','','[나체]가 된 [자신]의 [몸]을 가리려고 애쓰는 꿈 ','사람의몸에관한꿈','남이 알아서는 안 될 어떤 비밀스런 일을 하거나 남들 <BR>앞에서 창피를 당하고 구설수에 오를 징조이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2490','','[상반신]을 벗고 [일]을 하는 꿈 ','행동에관한꿈','윗사람으로부터 협조를 받지 못할 징조이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2491','','[하반신]을 벗고 [일]을 하는 꿈 ','행동에관한꿈','아랫사람으로부터 협조를 받지 못하고 힘들어 할 징조<BR>이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2492','','[자신]의 알[몸]을 가리지 못해 [당황]해 하는 꿈 ','행동에관한꿈','자기의 신분이나 사업에 협조할 동조자나 대책 등이<BR>없어서 쩔쩔 매게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2493','','[나체]로 맑은 [냇가]를 맘껏 뛰어다니며 노는 꿈 ','행동에관한꿈','만사가 자신의 뜻대로 이루어져 하루종일 시원한 날을<BR>보내게 될 것을 암시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2494','','많은 [사람]들 앞에서 자신의 [하반신]을 드러내는 꿈 ','행동에관한꿈','귀중히 간직해야 할 비밀을 함부로 누설함으로써 지금<BR>까지 쌓아올렸던 명예가 한꺼번에 무너지게 될 징조이<BR>며, 뜻하지 않은 일로 인해 창피를 당하게 될 것을 암<BR>시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2495','','[거울] 앞에 서서 [옷]을 모두 벗어버리는 꿈 ','옷과악세사리에관한꿈','몹시 기다리던 사람을 만나지만, 그로부터 운세가 하<BR>강하고 오히려 그의 신세 한탄을 듣게 되는 꿈이다. <BR>','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2496','','[나체]로 [길]바닥에 누워 있는 꿈 ','행동에관한꿈','대명천지에서 망신을 당할 일이 생길 징조이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2497','','[속옷]만 입고 [일]을 하는 꿈 ','옷과악세사리에관한꿈','고독한 현실의 처한 상황을 암시하는 것으로, 협조자<BR>가 없어 고독해지거나 자신의 신분 보장이 결여되는 <BR>꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2498','','온[몸에] [화상]을 입고 [약]을 바르는 꿈 ','질병에관한꿈','사회적으로나 가정적으로 반도덕적인 행위를 범해 양<BR>심적으로 상처를 받고 마음의 상처를 치유하자 하는 <BR>마음에서 오는 심몽의 일종으로, 자신이 잘못한 일로<BR>인해 가책을 느끼며 마음 고생을 하게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2499','','[옷]을 완전히 벗고 [성교]하는 꿈 ','성과섹스에관한꿈','상대방에게 모든 사실을 솔직히 털어놓고 공개적으로 <BR>추진할 일이 생길 것이다. <BR>','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2500','','[목욕]을 하려고 [옷]을 벗는 꿈 ','옷과악세사리에관한꿈','무슨 일을 하든지 정직하게 행해서 감출 것이 없게 됨<BR>을 의미하여, 매사를 소신대로 밀고 나가야 할 시기이<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2501','','자신의 [옷]을 벗어서 발가벗은 다른 사람에게 [입혀주<BR>는] 꿈','옷과악세사리에관한꿈','자신이 남을 위해 도움을 주게 될 것으로, 꿈에서 옷을<BR>벗고 난 후 수치감이 들었다면 그 만큼의 희생도 감수<BR>해야 할 징조이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2502','','[화가] 앞에서 자기가 [나체] [모델]이 되는 꿈 ','연극 영화 미술에관련된꿈','철학가나 평소 자신과 친하지 않은 사람에게 자신의<BR>답답한 운명에 대해 상담하게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2503','','[속옷]만 입고 돌아다니는 꿈 ','옷과악세사리에관한꿈','주변의 협력자나 귀인을 일고 고독해지거나 몸담고 있<BR>는 직장이나 단체, 모임 등에서 신분의 보장이 결여되<BR>는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2504','','온[몸]에 식은 [땀]이 솟아 흐르고 있는 꿈 <BR>','사람의몸에관한꿈','실제로 수술을 받아야 할 정도로 큰 상처를 입거나 많<BR>은 돈을 탕진할 불길한&nbsp;그러나 다른 사람이 땀을 흘리<BR>고 있는 것을 자신이 지켜보았다면, 오히려 자신에게 <BR>유리한 기회와 행운이 있을 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2505','','누군가가 자꾸 [자신]의 [뒤]를 [따라오는] 꿈 ','행동에관한꿈','자신이 일에 헌신적으로 나서서 도와줄 협력자를 만날<BR>것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2506','','[악한]이 [도망]가는 꿈 ','행동에관한꿈','계획했던 일이 수포로 돌아가거나 좋은 기회를 놓아<BR>좌절감에 빠지게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2507','','[환자]가 보통사람처럼 잘 [걸어다니는] 것을 보는 꿈 ','행동에관한꿈','고전을 면치 못하던 사업이 장 진행되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2508','','[죄수]가 [감옥]을 [탈출]한 것을 보는 꿈 ','혈벌에관한꿈','집안에 행운이 있고, 환자라면 그동안 앓던 병에서 해<BR>방되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2509','','아무리 달리려해도 [발][걸음]이 떨어지지 않는 꿈 ','행동에관한꿈','여러 사람 앞에서 망신당할 일이 생길 징조이며, 또 상<BR>급 기관에 부탁했던 일이 잘 이루어지지 않아 애태우<BR>게 될 것을 암시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2510','','[친정]에 갔던 [아내]가 [물건]을 가지고 [시댁]으로 들<BR>어가는 꿈&nbsp;','가족 친척 부부에 관한꿈','태몽으로, 아기를 낳기 위해 산부인과에 가게 되는 꿈<BR>이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2511','','[상대방]이 무서워 [뒷][걸음질]을 치거나 [도망]치는 <BR>꿈 <BR>','행동에관한꿈','어떤 일에 대한 불안감에서 오는 일종의 심몽으로, 결<BR>국 그 일이 잘 풀리지 않아 커다란 패배감을 맛보게 되<BR>는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2512','','넓게 [트이고] [깨끗한] [길]을 걷는 꿈 ','행동에관한꿈','매사에 있어서 막힘이 없고 심신이 편안해질 징조이<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2513','','[동행]해야 할 [사람]과 따로따로 떨어져서 [걸어가는] <BR>꿈 ','행동에관한꿈','함께 일하고 있는 동업자나 직원 등과 결별하게 되는<BR>꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2514','','똑바로 [길]을 걸어가는데 갑자기 [장애물]이 나타나 <BR>멈추게 되는 꿈&nbsp;','행동에관한꿈','순조롭게 진행되던 일에 불행이 닥쳐 도중에서 중단되<BR>는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2515','','[전진]도 [후진]도 하지 않고 [제자리]에서 껑충껑충 뛰<BR>는 꿈','행동에관한꿈','직장에서 승진 등의 일로 자리 변동이 생기게 되는 꿈<BR>이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2516','','[언덕]이나 [산]을 올라가는 꿈 ','행동에관한꿈','병이 빨리낫고, 집안의 재앙이 사라질 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2517','','[출발점]으로 다시 [돌아오는] 꿈 ','행동에관한꿈','꿈속에서 거꾸로 되돌아온 만큼 한동안 사업이나 운세<BR>의 하향세를 타게 될 징조이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2518','','잘 포장된 [도로]를 편안한 마음으로 [걷는] 꿈 ','행동에관한꿈','하고 있는 일이 잘 진행되고 작은 행복이 있는 등 운세<BR>가 향상되는 좋은 징조이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2519','','정처없이 [걷는] 꿈 ','행동에관한꿈','앓고 있는 환자가 건강의 진전이 없고, 하는 일은 발전<BR>이 없어 지루한 나날을 맞게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2520','','[산]이나 [들]을 [산책]하는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','현재 진행하는 일에 변화가 생기고 운세에 기복이 있<BR>을 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2521','','좁고 울퉁불퉁한 [길]을 [걷는] 꿈 ','행동에관한꿈','매사에 고통이 뒤따르며, 생각지도 않았던 재수없는<BR>액운이 따르게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2522','','평소 [걸음]을 걷지 못하는 사람이 잘 [걸어다니는] 꿈 ','행동에관한꿈','하는 일이나 사업의 성공을 거두어 명성을 날리게 되<BR>는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2523','','[집]이나 [고향]을 향해 [걷는] 꿈 ','행동에관한꿈','벌려 놓았던 일이 종결되거나 더 이상 할 일이 없어지<BR>게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2524','','[장소]를 가리지 않고 여기저기 [돌아다니는] 꿈 ','행동에관한꿈','일의 성취는 없지만, 연구 등 어렵고 복잡한 일에 관심<BR>을 갖고 몰두하게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2525','','여러 사람이 나란히 [의자]에 [앉아있는] 꿈 ','가재도구에관한꿈','여러 사람이 함께 힘을 합쳐야 할 일이 생기고, 많은<BR>사람이 모여서 회의 또는 상의할 일이 생길 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2526','','[낭떠러지]에 서 있는 꿈 ','행동에관한꿈','자신의 긴박한 심리가 반영된 심몽의 일종으로, 중대<BR>한 일을 앞두고 결단을 내려야 한다면 대담하게 나서<BR>야 할 것이지만 결코 신중함을 잃지 말아야 하며, 무모<BR>하게 나섰다가는 장차 위험한 일을 겪을 수 있으니 주<BR>의하는 것이 좋다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2527','','반듯하게 [누워] 있는데, 발치에 누군가가 [앉아있는]<BR>꿈 ','행동에관한꿈','자신의 일에 방해하는 사람이 많아서 어려움을 겪게 <BR>되는 꿈이다. ','N');
