insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2529','','[의자]에 다소곳이 [앉아있는] 꿈 ','행동에관한꿈','금전적으로 도움이 될 만한 일거리가 생기거나 원했던<BR>회사에 취직을 하게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2530','','[여행]중에 [길]가에 앉아서 [휴식]을 취하는 꿈 <BR>','행동에관한꿈','순조롭게 진행되던 일에 문제가 생겨 중도에서 포기하<BR>게 되거나 진행하던 일을 오랫동안 보류하게 되는 꿈<BR>이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2531','','[잠]을 자고 있는 꿈 ','행동에관한꿈','자신이 꽤 지친 상태에 놓여 있음을 알리는 꿈이예요.<BR>운세가 멈추고 있는 상태으므로 무엇보다도 지금은 휴<BR>식이 필요한 시기이다. ','N');
