insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2540','','[운동] [경기]에서 [선두]로 나서는 꿈 ','행동에관한꿈','사업이나 자신의 계획이 수포로 돌아가는 등 실패하기<BR>쉽고, 마음이 불안해질 징조이다. ','N');
