insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2544','','[마라톤] [경기]에서 [일등]을 하는 꿈 ','행동에관한꿈','사업이나 지급에 행운이 따르며, 자신의 동기나 친구<BR>들 가운데 가장 먼저 성공하게 될 좋은 징조이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2545','','[경기장]에서 [체조] [경기]를 하는 꿈 ','행동에관한꿈','자신의 사업이나 학문적 발표 등에 크게 호응해 줄 사<BR>람이 생기게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2546','','자신이 [골]을 넣어 [승리]하는 꿈 ','행동에관한꿈','하던 일에 성과를 갖게 되거나, 논쟁 등에서는 자신의<BR>의견에 따라서 결론을 맺게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2547','','[높이뛰기]를 하는 꿈 ','행동에관한꿈','소원했던 일이 이루어지거나 승진을 하게 되며, 만사<BR>가 형통하게 잘 진전되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2548','','[공]을 서로 [주고받는] 꿈 ','행동에관한꿈','어떤 시빗거리로 인해 상대방과 마음이 엇갈리게 되는<BR>꿈이다. ','N');
