insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2550','','[야구] [경기장]에서 자기 편 [선수]가 [홈런]을 치는 꿈 ','행동에관한꿈','매사가 편안하고 순조롭게 풀릴 징조이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2551','','[메달], [우승컵], [상금]을 타거나 [우승가]를 부르는 꿈<BR>&nbsp;','행동에관한꿈','어려운 난관을 극복하고, 소원이나 오랫동안 계획했던<BR>목적을 달성하게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2552','','날아오는 빈 [병]을 [방망이] 등으로 [깨뜨리는] 꿈 ','행동에관한꿈','야구선구가 통쾌한 홈런을 날린 듯, 부귀와 번성을 가<BR>져올 일을 자신이 해낼 징조이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2553','','[달리기] 등과 같이 빠른 [운동]이나 [오락]을 하는 꿈 ','행동에관한꿈','급히 서둘러서 처리해야 할 일이 생기거나, 초조하고 <BR>고통스러운 일이 뒤따르게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2554','','[사람]들이 자신의 [구령][소리]에 맞추어 [체조]를 하<BR>는 꿈 ','행동에관한꿈','여러 사람들의 협조를 받아 군중이나 모임 등에서 자<BR>신의 지도력을 발휘하게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2555','','다른 [사람]과 함께 [검도]나 [펜싱]을 하는 꿈 ','행동에관한꿈','다른 사람과 말다툼을 하거나 몸싸움이 있을 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2556','','[경기]장의 [관중석]이 텅 비어있는 꿈 ','행동에관한꿈','언뜻 보기에는 외롭고 고독해질 꿈인 것 같지만, 실제<BR>로는 당면한 문제를 타인의 도움없이 스스로 순탄하게<BR>해결할 징조이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2557','','[우승]하여 많은 사람 앞에서 자기가 [상]을 받는 꿈 <BR>','행동에관한꿈','명성이 있는 회사에 취직 또는 전근수가 있고, 사업이<BR>나 일거리에 발전이 있을 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2558','','우리나라 [선수]가 국제 [경기]에서 [우승]을 하는 꿈 ','행동에관한꿈','하던 일에 성취를 얻거나, 사업의 주도권을 잡아 원하<BR>는 대로 일이 잘 풀려나가게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2559','','[농구] [골대]에 [공]을 넣었는데 공이 밑으로 빠지지 <BR>않는 꿈&nbsp;','행동에관한꿈','실제로 일이 풀리지 않아 답답해 하는 심몽의 일종으<BR>로, 추진하고 있던 일이나 현재 하고 있던 일이 난관에<BR>부딪쳤는데, 자신이 할수있는 것은 없고 답답하게 지<BR>켜보거나 협력자, 또는 귀인을 막연히 기다리게 될 좋<BR>지 않을 징조이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2560','','[상처]가 날 정도로 두들겨 [맞는] 꿈 ','행동에관한꿈','자신이 하고 있는 일에 대해 세상 사람들로부터 심한<BR>비난을 당하게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2561','','[남]에게 [욕]설을 퍼붓는 꿈 ','행동에관한꿈','대길한 길몽으로, 집안이 번성하고 하고 있는 일이 순<BR>조롭게 잘 풀릴 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2562','','누군가를 [공격]하려고 하는데 [몸]이 전혀 말을 듣지<BR>않는 꿈','행동에관한꿈','철저하게 계획을 세웠던 일이 실패하게 되고, 도저히<BR>헤어날 방도를 못 찾아 곤경에 빠질 징조이다. ','N');
