insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2646','','[명승] [고적]을 [유람]하는 꿈 ','행동에관한꿈','집안에 반가운 손님이 들거나 한동안 못 보던 친구와<BR>의 재회, 혹은 반가운 고향 소식을 듣게 되는 꿈입니<BR>다.<BR>','N');
