insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2711','','[나무], [풀] 등을 휘어잡고 [산]에 오르는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','협조자의 도움을 얻어서&nbsp;일이 성취되는 꿈입니다.','N');
