insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2715','','[사다리]가 [공중]으로 뻗어 있는 꿈 ','행동에관한꿈','치명적인 병에 걸리게 되거나 허망한 계획을 세우게 <BR>되는 꿈입니다.','N');
