insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2717','','[낭떠러지]에서 떨어지는 꿈 ','행동에관한꿈','낭떠러지는 운수의 경계선으로 , 최악의 상황에서 변<BR>화가 일어나게 되는 꿈입니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2718','','[사다리]를 올라갔다가 내려오지 못하는 꿈 ','행동에관한꿈','사업상 계획이 수포로 돌아가거나 진행 중인 일이 중<BR>단되는 꿈입니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2719','','[계단]에서 넘어져 [아래]로 굴러로 떨어지는 꿈 ','행동에관한꿈','여러 사람과의 경쟁에서 뒤떨어지게 되고, 현재 하고 <BR>있는 사업의 진전이 없을 징조입니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2720','','높은 곳에서 [아래]로 떨어지는 꿈 ','행동에관한꿈','어렵게 얻었던 명예가 졸지에 땅에 떨어지거나 일신상<BR>에 커다란 변화가 생길 것입니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2721','','높은 [건물]에서 뛰어내렸는데 [누군가]에 의해 [구조]<BR>되는 꿈','행동에관한꿈','취직이 되거나 여러 사람으로부터 존경을 받게 되는 <BR>꿈입니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2722','','[계단]을 내려오는 꿈 ','행동에관한꿈','진행 중이던 일을 역행하거나 위법적인 일을 저지르게<BR>되는 꿈입니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2723','','높은 곳에서 떨어져 [머리]가 깨져 죽는 꿈 ','죽음에관한꿈','어려운 사업이 차츰 풀리기 시작하고 새로운 사업 계<BR>획을 세우게 되는 꿈입니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2724','','[거인] 두 명이 서로 [악수]하는 것을 보는 꿈 ','행동에관한꿈','사회 단체나 국가 혹은 자신과 관련되어 소속된 곳이 <BR>다른 곳과 하나로 통합되는 꿈입니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2725','','[대통령]과 [악수]하는 꿈 ','행동에관한꿈','존경하는 인물과의 계약이나 약속이 이루어지고, 명예<BR>도 따르게 되는 꿈입니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2726','','[안]에 있는 [사람]의 [손]을 잡아 끌어내리는 꿈 ','행동에관한꿈','상대방에게 일을 강제로 떠맡길 일이 생길 것입니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2727','','다른 [사람]이 당신의 [손]을 잡아 끌어주는 꿈 ','행동에관한꿈','상대방의 협력으로 어려움을 극복하게 되는 꿈입니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2728','','[친구]나 [애인]과 [악수]를 하는 꿈 ','행동에관한꿈','실제로 아는 친구나 애인인데, 손이 차갑게 느껴졌다<BR>면 자신에게 좋지 않은 감정이 있다는 꿈의 암시로 삼<BR>각관계에도 주의하는 것이 좋습니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2729','','[악수]하면서 [손]을 마구 흔드는 꿈 ','행동에관한꿈','상대방과의 협력, 결합, 결연에 문제가 발생하거나 흔<BR>드는 횟수만큼 일이 생기게 되는 꿈입니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2730','','[위급]함에 처해 있는 사람의 [손]을 잡아 구해주는 꿈 ','행동에관한꿈','다른 사람의 실수에 대해 [당신]이 대신 책임을 져야 <BR>할 일이 생길 것입니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2731','','[연인]과 [사랑]에 빠지는 꿈 ','성과섹스에관한꿈','남을 사랑하는 꿈은 당신이 고독해질 것을 암시하며, <BR>반대로 남으로부터 사랑을 받았다면, 이는 자신의 만<BR>족스러운 현실 생활을 반영하는 것입니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2732','','[이상형]의 사람과 [이야기]를 주고받는 꿈 ','행동에관한꿈','당신 앞에 꿈 속의 인물과 비슷한 인물이 나타나게 되<BR>며, 그에 의해 보호받게 될것을 암시하는 꿈입니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2733','','당신의 [몸]을 더렵히는 꿈 ','사람의몸에관한꿈','이는 자신의 오점이나 실패를 의미하는 꿈입니다. 많<BR>이 더럽혀진 꿈이라면 커다란 실패를, 작게 더렵혀졌<BR>다며나 작게 실패할것을 암시하는 꿈입니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2734','','[창문] [앞]에 서서 [집] [안]을 들여다 보이는 꿈 ','집과건물에관한꿈','태몽이라면, 어려운 환경에서 아이를 출산하게 되어 <BR>산모오 태아의 건강이 안 좋아질 것입니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2735','','[이별]을 하는 꿈 ','만남과이별의꿈','당신 자신과 결별하게 되고 점점 더 성숙해져가고 있<BR>음을 암시하는 꿈입니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2736','','[사람]과 다른 [물체]가 부딪치는 꿈 ','행동에관한꿈','정신적 또는 물질적인 사업의 방도를 깨닫고 일에 있<BR>어서 쌍방이 서로 합의를 보게 되는 꿈입니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2737','','[누군가]를 [안내]하는 꿈 ','행동에관한꿈','당신이 다른 사람의 도움을 받아 여러 가지 현실적인 <BR>문제를 해결하게 될 것을 암시하는 꿈입니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2738','','[허공]에서 [불안]한 [기분]으로 [그네]를 타는 꿈 ','행동에관한꿈','당신의 마음이 불안한 상태를 반영하는 꿈으로, 조심<BR>할 일이나 불길한 일이 일어날 것입니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2739','','[군중] [앞]에서 당신의 [의사]를 [발표]하는 꿈 ','행동에관한꿈','당신의 강압적인 성격이나 거만한 태도로 인해 주위 <BR>사람들로부터 반감을 사고 있음을 당신에게 알려주는 <BR>것입니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2740','','[빙판]에서 미끄러져 넘어지는 꿈 ','행동에관한꿈','추진하는 일이나 소원이 이루어지지 않거나, 시험 , 지<BR>위, 신분, 연애 등에서 실패하게 되고, 신경통 등의 질<BR>병을 앓게 되는 꿈입니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2741','','[누군가]에게 마구 [장난]을 치는 꿈 ','행동에관한꿈','누군가에게 장난을 치는 꿈은, 대수롭지 邦 마음의 <BR>미혹으로 부터 실수나 불화를 일으키게 될것을 암시하<BR>는 꿈입니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2742','','유난히 [허둥]대는 꿈 ','행동에관한꿈','현실에서 무엇인가를 잊고 있다는 것을 경고하는 것이<BR>며, 잠재의식 중에 그것이 내포되어 있기 때문에 꾸는 <BR>꿈으로, 당신의 의식이 그것을 기억시켜 주고 있다는 <BR>것입니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2743','','[바둑]이나 [장기]를 두는 것을 보는 꿈 ','행동에관한꿈','세력 다툼이나 나아가서는 국제 정세의 변화를 보게 <BR>되는 꿈입니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2744','','[안방]에서 [장기]를 두는 꿈 ','행동에관한꿈','국내 전쟁이나 파병 전쟁을 상징하는 것으로, 진행되<BR>고 있는 일에 큰 사건이 일어날 징조입니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2745','','[딱지치기]나 [공기]놀이 등과 같은 [장난감] [놀이]를 <BR>하는 꿈','행동에관한꿈','어린아이의 경우 학업 성적과 관계가 있고, 어른의 경<BR>우 사업 성공 여부와 관계가 있는 꿈입니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2746','','당신은 [흰돌]이고 상대방은 [검은돌]인데, 당신이 검<BR>은 돌을 전부 잡는 꿈 ','행동에관한꿈','당신이 주도하여 상대방과의 갈등 관계를 점차적으로 <BR>풀어나가게 되는 꿈입니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2747','','[국수]급에 있는 사람과 [바둑]을 두어서&nbsp;이기는 꿈','행동에관한꿈','최고의 명예나 권리를 얻게 될 것을 암시하는 꿈입니<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2748','','[신선]과 함께 [바둑]이나 [장기]를 두는 꿈 ','행동에관한꿈','학문이나 사업에 있어서 시비를 가릴 일이 생길 것입<BR>니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2749','','당신과 [비슷]한 [또래]와 [장기]를 두는 꿈 ','행동에관한꿈','자기와 비슷한 처지에 있는 사람과 서업상의 승부를 <BR>겨루게 되는 꿈입니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2750','','[윷]이나 [주사위]를 던져 점수를 따는 꿈','행동에관한꿈','윷이나 주사위를 던져서 나온 숫자나 점수와 비슷한 <BR>성적이나 석차 혹은 일의 평가 등을 받게 되는 꿈입니<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2751','','[바둑]을 두는데 [흰돌]을 잡는 꿈 ','행동에관한꿈','경쟁자를 쉽게 공략할 수 있음을 암시하는 꿈입니다.','N');
