insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2804','','[풍경화]를 보고 있는 꿈 ','연극 영화 미술에관련된꿈','그 그림의 내용이 자기의 소원이나 계획한 일을 암시<BR>하는 꿈입니다.','N');
