insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2808','','전형적인 [한옥]이나 [초가]집을 보는 꿈 ','집과건물에관한꿈','시골길을 거닐거나 고고학과 관련된 일을 직접 맡거나<BR>그런 일에 관계된 사람을 보게 되는 꿈입니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2809','','[집]을 [개조]하는 꿈 ','집과건물에관한꿈','집안이 발전하고 사업체가 완벽해질 암시로, 자본을 <BR>더 투자할 일이 생기게 되는 꿈입니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2810','','[집]을 새로 넓게 [확장]해서 짓는 꿈 ','집과건물에관한꿈','많은 사람들을 사귀거나 사업을 확장시키게 되는 꿈입<BR>니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2811','','새 [집]에 제 [문패]를 다는 꿈 ','집과건물에관한꿈','똑똑한 아이를 낳게 되거나 어떤 새로운 일이 시작되<BR>는 꿈입니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2812','','[손수] 제 [집]을 짓는 꿈 ','집과건물에관한꿈','매사에 좋은 일이 생기고, 어렵던 일이 누군가의 도움<BR>을 받아 성공하게 되는 꿈입니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2813','','연립[주택] [창문]으로 [햇빛]이 [반사]되서 비추는 꿈 ','집과건물에관한꿈','어려운 역경을 극복하고 희망찬 행운을 맞이하게 되는<BR>꿈입니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2814','','남의 [집]을 [방문]하는 꿈 ','집과건물에관한꿈','이성의 집을 방문했다면 새로운 로맨스가 나를 찾아들<BR>고, 동성의 집을 방문했다면 소망의 실현이나 새로운 <BR>일의 전개되는 꿈입니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2815','','새 [집]으로 [이사]를 하는 꿈 ','집과건물에관한꿈','새로운 일거리가 생기거나 직장을 옮기게 되고, 실제<BR>로 이사할 일이 생길 수도 있는 꿈입니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2816','','[창고]를 짓고 [수리]를 하는 꿈 ','집과건물에관한꿈','장사꾼은 더욱 장사가 잘 되고, 부자는 더욱 부자가 되<BR>며, 예술가나 연예인은 유명세를 타게 되는 꿈입니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2817','','연립[주택] [단지]를 지나가는 꿈 ','집과건물에관한꿈','여러 과정을 통해야만 비로소 어떤 일을 성취하게 될 <BR>것을 암시하는 꿈입니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2818','','많은 사람이 [지붕] 위에 서 있는 꿈 ','집과건물에관한꿈','집안이나 직장에 우환이 생길 것 같습니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2819','','[삼촌]의 [집]을 [방문]하는 꿈 ','집과건물에관한꿈','당신에게 커다란 도움을 줄 사람이나 사업체를 찾게 <BR>되는 꿈입니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2820','','[기와]를 올리거나 [지붕]을 [수리]하는 꿈 ','집과건물에관한꿈','사업이 번창하고, 하던 일이 완성되며, 거래처를 옮기<BR>게 되는 꿈입니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2821','','[지붕]이 무너지는 꿈 ','집과건물에관한꿈','신분이 낮아지거나 사업, 단체 등이 몰락할 징조입니<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2822','','제 [집]을&nbsp;스스로 무너뜨리는 꿈 ','집과건물에관한꿈','계획하는 사업이나 소망을 바꾸거나 목표를 바꾸어야 <BR>할 것 같습니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2823','','[집]의 [대들보]가 무너지는 꿈 ','집과건물에관한꿈','생각지도 않았던 어려움을 겪게 되고, 타인의 모함에 <BR>의해 직위를 잃게 되거나 애인과 헤어지게 되는 꿈입<BR>니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2824','','[방]이 유난히 길고 넓게 보이는 꿈 ','집과건물에관한꿈','자기 사업장이나 위탁기관 세력의 강대한, 신문, 잡지 <BR>등에 실린 기사의 할당 지면이 확대되는 등 자기 주변<BR>이 번성할 것 같습니다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2825','','저절로 [집]이 와르르 무너지는 꿈 ','집과건물에관한꿈','별다른 노력 없이도 사회적인 추세나 다른 주변 등에 <BR>의해 더욱 좋고 새로워진 일에 참여하게 되는 꿈입니<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2826','','[이사]할 [집]이 와르르 무너지는 것을 보는 꿈 ','집과건물에관한꿈','큰 행운이 찾아오게 될 징조이나 집의 일부만 무너지<BR>는 꿈은 잘되던 일도 막힐 안좋은 의미를 가지고 있는 <BR>꿈입니다.','N');
