insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2829','','제 [집]안에 [풀]이 수북하게 나있는 꿈 ','집과건물에관한꿈','집안에 걱정거리나 집안의 재산을 축내는 사람이 생기<BR>게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2830','','자기가 [남]의 [집]에 들어가는 꿈 ','집과건물에관한꿈','친분이 있는 사람이 찾아오거나 자신에게 부탁하게 되<BR>는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2831','','[집][터]를 닦는 꿈 ','집과건물에관한꿈','사업 판도나 세력권을 형성하게 될 징조로 만일 그 자<BR>리에 집을 짓는 꿈을 꾸었다면 정신적, 물질적 사업을<BR>시작하게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2832','','[집]의 [처마] 밑에서 [비]를 피하는 꿈 ','집과건물에관한꿈','권력있는 사람의 협조를 받아 사업을 경영하게 되는 <BR>꿈이다. ','N');
