insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2837','','소형 [주택]에서 대형 [아파트]로 [이사]할 [날짜]를 잡<BR>아놓는 꿈','집과건물에관한꿈','하급에서 상급으로 자리를 옮기게 될 것을 암시하는<BR>것으로 승진이나 진급의 변화를 암시하는 꿈이다. ','N');
