insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2839','','새 [집]의 여러 [방]을 살피는 꿈 ','집과건물에관한꿈','새색시나 신입사원 들의 인물 됨됨이를 살피게 되는 <BR>꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2840','','[아파트]를 [신축]하는 꿈 ','집과건물에관한꿈','새로운 소망과 새로운 질서가 점진적으로 이루어지며 <BR>새로운 아이디어로 좋은 일을 만들게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2841','','[아파트] 층층마다 [불]이 환하게 켜져 있는 꿈 ','집과건물에관한꿈','문어발식 경영 방법으로 각 계열회사마다 사업성과가 <BR>날로 번창하게 될 징조로 어떤 단체나 중역회의에서<BR>각고의 회의 끝에 좋은 결실을 보게 될 것을 암시하는<BR>꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2842','','[부모]님한테서 [아파트] [열쇠]를 건네 받는 꿈 ','집과건물에관한꿈','갈구하고 있던 소망이 이루어지고, 머지않아 행운이<BR>찾아올 것 같다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2843','','고층 [아파트]가 [굉음]소리를 내며 와르르 무너지는<BR>꿈 ','집과건물에관한꿈','인재나 천재지변으로 인해 대형사고가 일어날 것 같<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2844','','[아파트] 공간이 넓어서 시원하게 보이는 꿈 ','집과건물에관한꿈','마음먹은 일들이 순조롭게 풀리고 미래가 밝아오며 어<BR>둡고 암울했던 과거가 지나고 새로운 행운의 장이 열<BR>릴 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2845','','[지붕] 위에서 밝은 [태양]이 활활 타오르는 꿈 ','집과건물에관한꿈','집안에 경사가 생기고, 하는 일마다 순조롭게 풀릴 것<BR>같다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2846','','[애인]이 자기 [방]의 [문턱]에 앉아서 [안]을 들여다 보<BR>는 꿈&nbsp;','집과건물에관한꿈','사귀는 사람이 자기와의 결혼 여부를 놓고 망설이고 <BR>있는 상태이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2847','','[집]안으로 많은 [사람]이 몰려오는 꿈 ','집과건물에관한꿈','자신의 일에 대해 타인에게서 평가를 받거나 비판받게<BR>되는 꿈이다. ','N');
