insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2898','','[은행]에서 [대출]을 받는 꿈 ','돈과재물에관한꿈','생각지도 않은 횡재를 하거나 재물과 목돈이 들어올 <BR>것이다. 계돈, 뭉칫돈, 재물, 횡재 등을 암시하는 꿈이<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2899','','[생선] [가게]에서 [이불]을 사는 꿈 ','행동에관한꿈','먹을 복을 상징하는 것으로, 물건이나 음식을 장만하<BR>게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2900','','[가게]에 많은 [양복]이 걸려 있는 것을 보는 꿈 ','옷과악세사리에관한꿈','취직이나 승진 등과 같이 축하할 만한 일이 생길 것이<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2901','','[그릇] [가게]에서 그릇을 사 오는 꿈 ','행동에관한꿈','집안 살림살이를 장만하거나 집안에 잔치를 벌일 일이<BR>있을 것이다. 관용이나 수용을 암시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2902','','[다리] 위에서 누군가가 [손]을 잡아 끌어올려 주는 꿈 ','행동에관한꿈','다른 사람의 도움으로 인해 무난히 취직이 이루어질 <BR>것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2903','','[돌][다리]를 건너는 꿈 ','행동에관한꿈','하고 있는일의 기반이 튼튼함을 의미한다. 그 튼튼한 <BR>기반을 딛고 열심히 노력하면 틀림없이 성공할 수 있<BR>을 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2904','','[다리]를 [보수]하는 꿈 ','행동에관한꿈','사업을 정비하거나 다른 사람에게 청탁했던 일이 이루<BR>어질 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2905','','[다리] [위]에서 [아래]를 내려다보는 꿈 ','행동에관한꿈','승진을 하거나 후배, 혹은 아랫사람을 다스리게 될 것<BR>이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2906','','[폭탄]이나 어떤 [원인]에 의해 [다리]가 [절단]되는 꿈 ','문무기구에관한꿈','장애물이 없어지고 소원하는 바를 이루게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2907','','[다리] 위를 우[마차]가 지나가는 꿈 ','배 자동차에관한꿈','여러 협조 기관의 소원하는 바를 이루게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2908','','[다리] 위에서 [사람]을 기다리는 꿈 ','문무기구에관한꿈','청탁한 일이 잘 추진되지 않아서 고민하게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2909','','[교각]이 부러지는 것을 보는 꿈 ','문무기구에관한꿈','자신이 믿고 있던 부하나 협조자 등을 잃게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2910','','[강]을 건너고 있는데 사람들이 [뗏목]을 놓아주는 꿈 <BR>','배 자동차에관한꿈','하고 있는 일이 난관에 처해 있을 때 여러 곳으로부터<BR>도움을 받아 어려움을 극복하게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2911','','[다리] 위에 많은 사람들이 지나가는 것을 보는 꿈 ','문무기구에관한꿈','오래 전부터 어떤 기관이나 다른 사람에게 부탁한 일<BR>이 결국 이루어지지 않을 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2912','','[다리] 위에서 누군가가 [손짓]하며 부르는 꿈 ','문무기구에관한꿈','직장 상사나 집안 어른에게 청탁했던 일이 이루어질 <BR>것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2913','','[다리]가 끊어지거나 타인의 [방해]로 건너지 못하는 <BR>꿈 <BR>','문무기구에관한꿈','소망하던 일이나 직책에 좋지 않은 일이 생길 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2914','','[비][바람]이 몰아쳐서 [다리]를 건너지 못하는 꿈 ','문무기구에관한꿈','어떤 방해로 인하여 일이 마음먹은 대로 진행되지 않<BR>을 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2915','','아득하게 멀어보이는 [다리]를 건너는 꿈 ','문무기구에관한꿈','추진하고 있던 일이나 구상하는 계획이, 오랜 시간이<BR>걸려 후에 이루어질것이다. 이때 다리가 튼튼했다면 <BR>결실을 보게 되지만, 반대로 부실했다면 불안한 결실<BR>을 암시한다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2916','','[외나무] [다리]를 건너는 꿈 ','문무기구에관한꿈','일이나 사업 등을 진행시키는 데 그 기반이 튼튼하지 <BR>못함을 암시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2917','','[기둥]이 넘어지는 꿈 ','문무기구에관한꿈','집안 식구 가운데 누군가가 병에 걸리게 되거나 자신<BR>이 병에 걸려 고생하게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2918','','[기둥]에 [오르는] 꿈 ','문무기구에관한꿈','윗사람이나 지위가 높은 사람에게 도움을 청하게 될 <BR>것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2919','','[교실]에서 [봉황새]와 [용]을 보는 꿈 ','동물에관한꿈','학교에서 훌륭한 인재가 배출될 것을 암시하는 꿈이<BR>다. 합격, 입학, 승진, 당선,자격 취득 등 입신 출세를 암<BR>시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2920','','[학교] [건물]이 와르르 무너지는 것을 보는 꿈 ','집과건물에관한꿈','실패, 실수 등을 암시하는것으로, 지금까지 애지중지<BR>공들여서 쌓아올려 왔던 탑이 한꺼번에 와르르 무너지<BR>게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2921','','[학교]에서 [스승]님이나 [친구]를 만나는 꿈 ','만남과이별의꿈','희소식이나 만남을 상징하는 것으로, 뜻밖의 귀인을 <BR>만나 지도와 도움을 받고 큰 성과를 얻게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2922','','[캠퍼스] 안에 수많은 [고층] [건물]이 보이는 꿈 ','집과건물에관한꿈','학교나 단체에서 훌륭한 인물이 탄생하게 되고, 사업<BR>가는 생산, 유통, 제조업에다 투자하여 사업성과를 올<BR>리게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2923','','자기가 [교실]의 맨 [뒷자리]에 앉아 있는 꿈 ','집과건물에관한꿈','윗사람의 영향권 밖에서 벗어나 자유롭게 일을 하게 <BR>될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2924','','[교실]에서 자신의 [책걸상]을 찾지 못하는 꿈 ','집과건물에관한꿈','하고 있는 일의 난관을 뚫지 못하여 헤매거나, 고시, 취<BR>직, 입시 등에서 떨어지게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2925','','자신이 [대학] [캠퍼스] 안으로 들어가는 꿈 ','집과건물에관한꿈','합격, 취직, 승진 등을 암시하며, 소원성취할 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2926','','[교실] 안에 많은 [사람]이 모여 있는 꿈 ','집과건물에관한꿈','회의, 연회, 관람, 대회 등이 있을 것을 암시하고, 단체<BR>나 회사 등에서 중대한 안건을 심도있게 토론하게 될<BR>것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2927','','[학교] [건물]이 커다란 [산]으로 변하는 꿈 ','집과건물에관한꿈','오랜 기다림의 소망이 이루어지고, 큰 행운을 얻을 것<BR>이다. 부귀, 출세, 재물 등을 암시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2928','','[머리]를 [수술]하는 꿈 ','질병에관한꿈','자기가 한 일에 대해 심사를 받거나 상담해야 할 일이 <BR>있을 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2929','','[의사]가 [병]을 [치료]하는 중에 [잠]이 깨는 꿈 <BR>','질병에관한꿈','계획한 일을 진행하지만 어려움에 부딪치게 될 것이<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2930','','[의사]에게 제 [병]에 대해 자세히 [설명]하는 꿈 <BR>','질병에관한꿈','자신의 이력, 행적, 사업 실적 등을 보고해야 할 일이 <BR>생길 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2931','','[병]을 [치료]하다가 죽는 꿈 ','질병에관한꿈','소원이나 사업 등과 같이 관여하거나 상대방에게 감명<BR>을 줄 일이 있을 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2932','','꿈에 [수술]받으면서 [뻐근한] 감각을 느끼는 꿈 ','질병에관한꿈','상대방이 자기 일에 깊이 관여하거나 상대방에게 감명<BR>을 줄 일이 있을 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2933','','꿈 속에 [감옥]에 갇히는 꿈 ','혈벌에관한꿈','신변에 변화가 생겨 외로워지거나 슬픈 일이 생길 것<BR>이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2934','','[감옥]에 갇혔지만 즐거워하는 꿈 ','혈벌에관한꿈','머지않아 재물을 얻거나 가까운 곳에서 좋은 소식을<BR>들을 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2935','','[구금]되어 [매]를 맞거나 [고문]을 당하는 꿈 ','혈벌에관한꿈','하는 일이 잘 풀리고 소원을 성취하여 입신양명하게<BR>될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2936','','여러 사람들 앞에서 [형벌]을 당하는 꿈 ','혈벌에관한꿈','창피를 당하거나 구설수가 있고, 생각지도 못한 근심<BR>이 들 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2937','','[고향]이나 [집]을 향해 걸어가는 꿈 ','행동에관한꿈','지금 진행하고 있는 일의 성공이나 완성 등을 상징하<BR>는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2938','','[고향]집에서 [부모]님께 정중히 큰[절]을 올리는 꿈 ','행동에관한꿈','자기보다 위사람에게 어떤 청원할 일이 생기거나 추진<BR>하고 있던 일들이 잘 해결되어 성과를 볼 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2939','','[고향]에 있는 제 [집]과 [논][밭]이 [폐허]가 되는 꿈 ','집과건물에관한꿈','생각지도 않았던 행운이 찾아올 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2940','','[동굴] 안에서 돌아가신 [부모]님을 만나는 꿈 <BR>','가족 친척 부부에 관한꿈','지나온 과거를 돌이켜 자성하게 될 일이 생기고, 제사<BR>나 고사를 지낼 일이 생길 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2941','','[동굴] 속에 있던 [용]이 [승천]하는 꿈 ','용과관련된꿈','무명을 벗어던지고 일약 스타가 될것이다. 윗사람의 <BR>도움으로 새로운 발전을 하게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2942','','[담]장 밑에 [굴]이 뚫려 있는 꿈 ','집과건물에관한꿈','재물과 돈이 새어나가고, 가운이 기울거나 집안에 불<BR>청객이 들어와 불쾌해지거나 실물수가 있을 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2943','','[동굴] 속에서 맑은 [물]이 졸졸 흐르는 꿈 <BR>','물과불에관한꿈','마음먹은 일들이 순조롭게 풀리거나 훌륭한 사람을 만<BR>나 지도와 도움을 받을 일이 생길 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2944','','[터널] 속으로 [자동차]가 왔다갔다하는 꿈 <BR>','배 자동차에관한꿈','갑자기 일거리가 늘게 되러 분주하게 될 것을 말하는<BR>꿈이다. 기분이 상쾌해지고 일이 잘 풀릴 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2945','','[굴]속에서 [불]길이 솟구치는 꿈 ','물과불에관한꿈','생산업이나 유통업에다 투자하여 많은 돈을 벌게 될<BR>것이다. 재물, 횡재, 경사 등의 행운을 말하는 꿈이다. ','N');
