insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('2947','','[동굴]에 갇혀 [벽]을 뚫으려고 하지만 좀처럼 뚫리지 <BR>않는 꿈&nbsp;','꽃과 나무,돌 등 자연물에 관련한꿈','실제로 주위의 완고함 때문에 자유를 잃고 괴로움에<BR>빠진 자신을 암시하는 꿈이다. ','N');
