insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3167','','[나뭇가지]인줄 알았는데 알고보니 [뱀]인 꿈 ','동물에관한꿈','다른 사람의 잔꾀와 농간으로 재물을 잃거나 큰 손해<BR>를 보게 될 것이다. ','N');
