insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3286','','[돼지]를 껴안고 [키스]를 하는 꿈 ','동물에관한꿈','각종 시험에 우수한 성적으로 합격하게 될것이고, 합<BR>격, 입학, 승진, 당선, 승리 , 낙찰, 결혼,합방, 성공 등을 <BR>암시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3287','','여러 마리의 [돼지]가 [교미]하는 것을 보는 꿈 ','동물에관한꿈','집안에 경사가 있고 하는 일이 번창하거나 축하금을<BR>받을 일이 생길 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3288','','산 [돼지]를 [차]에 싣고 왔고, 가끔은 [등]에 지고 또 <BR>몰고 오는 꿈&nbsp;','동물에관한꿈','돈이 들어오고 명예를 얻게 될 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3289','','[돼지]를 타고 [달]나라에 가는 꿈 ','동물에관한꿈','소원성취를 할것이다. 하고 있는 일의 성과로 경쟁업<BR>체나 일에 관련된 사람들로부터 부러움을 받게 될 것<BR>같다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3290','','[땅] 속에서 신묘한 [돼지]떼들이 나와 [산]꼭대기로 올<BR>라가는 꿈','동물에관한꿈','직장에서 승진하여 서울리나 중앙으로 자리를 옮기게<BR>되거나, 돈 , 재물 , 횡재 등을 암시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3291','','[사람]을 물려고 멧[돼지]가 달려드는 꿈 ','동물에관한꿈','주위에 까다롭고 힘든 일이 발생할 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3292','','[소변]을 보는데 [돼지]새끼들이 몰려와서 그것을 받아<BR>먹는 꿈&nbsp;','동물에관한꿈','자신이 해놓은 일에 대해 주위사람, 특히 권위있는 유<BR>명인에 의해서 평가받을 일이 생길 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3293','','멧[돼지]가 [사람]을 물려고 덤벼드는 것을 죽이는 꿈 ','동물에관한꿈','윗사람의 도움을 받아 힘들고 어려운 일이나 적을 침<BR>입을 막게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3294','','죽이거나 싸워야 할 [돼지]가 갑자기 [사람]으로 변하<BR>는 꿈','동물에관한꿈','자기의 경쟁 상대가 우세해지거나, 동정, 실의 등으로<BR>인해 매사에 좌절하게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3295','','형형색색의 [돼지]들이 태어나는 것을 보고 [출산]하는<BR>꿈 ','동물에관한꿈','직계 자손중에서 이별을 하거나 자손들이 제각기 다른<BR>사업에 손을 대게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3296','','[돼지][갈비]를 맛있게 먹는 꿈 ','음식물에관한꿈','낙상이나 교통사고로 인해 병원 신세를 지게 될 것이<BR>며 질병, 사고, 복통 , 우환 등을 암시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3297','','[나무] 아래에 커다란 [동물]이 앉아 있는 것을 보는 꿈 ','동물에관한꿈','사업가로 대성할 자식을 출산하게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3298','','[동물]을 [타는] 꿈 ','동물에관한꿈','말 등을 익숙하게 타고 있는 꿈은 이성과 감정의 조절<BR>이 대단히 잘 되는 사람이라는 얘기이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3299','','[자기]가 [동물]로 [변하는] 꿈 ','동물에관한꿈','현실 도피적 소망이 나타난 꿈이다. 다시 말해 , 자기 <BR>자신을 부정하고 싶은 욕구로, 현실의 자기를 바라보<BR>고 싶지 않은 심리라고 할 수 있는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3300','','[동물]과 [대화]를 하는 꿈 ','동물에관한꿈','동물에 따라서 해몽이 달라진다. 고양이나 개와 같은<BR>애완동물과 이야기한 꿈이라면 당신은 자기 자신을 가<BR>장 사랑하고 있다는 증거이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3301','','[동물]한테 [습격]을 당하는 꿈 ','동물에관한꿈','동물한테 습격을 당하고있는 꿈은, 자신이 현재 착실<BR>히 성장해 가고 있는 상태이기는 하지만 자기의 이상<BR>에 도달하려면 아직 시간이 좀 걸린다는 것을 말하며 <BR>아직 반성하여 고칠 일이 있다는 신호이다. 그리고 이<BR>미 습격을 당해 버린 상태라면, 어려운 문제가 해결되<BR>고 당신의 본 모습이 겉으로 드러나게 될것을 암시하<BR>는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3302','','[논]두렁에서 [개구리]가 울고 있는 꿈 ','동물에관한꿈','일을 추진함에 있어서 여러 사람의 시비를 받게 될 것<BR>이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3303','','들판에서 [개구리]를 잡는 꿈 ','동물에관한꿈','부인과 새댁은 임신하여 입신출세할 자식을 낳게 될 <BR>것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3304','','[우물] 속에 수많은 [황소개구리]가 우글거리는 꿈 ','동물에관한꿈','집안에 많은 돈과 재물이 들어오고 운수가 대통하며, <BR>어떤 단체나 조직의 우두머리가 되어 많은 부하를 거<BR>느리게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3305','','청[개구리]를 잡다가 놓쳐버리는 꿈 ','동물에관한꿈','실패와 망상 등을 암시하며, 욕심은 크지만 마음 속에<BR>망상과 허상이 가득하여 이루어지는 일이 아무 것도<BR>없을 징조이다. 이럴때는 자신의 마음을 추스리고 현<BR>실을 직시해야 하는 꿈이다. ','N');
