insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3308','','[암수] [맹꽁이]가 붙어서 울고 있는 꿈 ','동물에관한꿈','직장 동료나 함께 일하는 사람 등과 시비가 생기거나 <BR>재수없는 일을 당하게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3309','','[너구리] [털]을 얻거나 만지는 꿈 ','동물에관한꿈','어떤 단체로부터 일거리나 재물을 얻게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3310','','[너구리]를 잡아서 [물]에 넣고 끓였더니 [양]이 무척 <BR>불어나는 꿈 ','동물에관한꿈','다른 사람으로부터 크게 부풀린 말을 듣게 되거나, 하<BR>고있는 일이 고비를 겪을 것이다. ','N');
