insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3319','','[고양이]와 [개]가 싸우고 있는 것을 보는 꿈 ','동물에관한꿈','세력 다툼이나 공박할 일이 생길 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3320','','[고양이]가 [돼지] [새끼]를 물고 [집] 안으로 들어오는 <BR>꿈 ','동물에관한꿈','재물과 먹을 것이 생기고 집안에 친인척이 찾아올 것<BR>이다. 돈, 재물, 횡재수,선물 등을 암시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3321','','[고양이]가 [쥐]를 잡는 것을 보는 꿈 ','동물에관한꿈','수사관이 이러한 꿈을 꾸었을 경우에는 범인을 잡고, <BR>처리가 안되어 보류되었던 일은 순조롭게 풀립니다.<BR>또한 재물을 얻을 징조이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3322','','[고양이]가 [닭장]을 들여다보는 꿈 ','동물에관한꿈','자기 집의 재산을 탐하는 사람이 나타나거나 자신의 <BR>재산을 보호해 줄 사람을 채용할 일이 있을 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3323','','[산] [고양이]가 달아나는 것을 보는 꿈 ','동물에관한꿈','어떤 일이 미궁에 빠지게 될 것이다. ','N');
