insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3325','','검은 [고양이]가 사람의 [해골]이나 [뼈]를 물고 안방으<BR>로 들어오는 꿈','동물에관한꿈','혹독한 우환으로 집안이 어지럽게 되거나, 가족 중에 <BR>누군가가 사고 또는 죽음 같은 변을 당하게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3326','','[고양이]가 [고기]를 먹는 꿈 ','동물에관한꿈','도둑맞았던 물건을 되찾게 될 것이다. ','N');
