insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3328','','[검은] [고양이]를 보는 꿈 ','동물에관한꿈','좋지 않은 일이나 평소에 두려워했던 일을 겪게 될 것<BR>이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3329','','[고양이]가 [담]장 위에서 나를 내려다보는 꿈 ','동물에관한꿈','자기일에 간섭을 받거나 누군가에 의해 감시를 받게<BR>될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3330','','[고양이]가 [생선]을 물고 [도망]치는 꿈 ','동물에관한꿈','집안에 도둑이나 강도가 들어서 귀금속을 잃게 될 것<BR>이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3331','','[호랑이]라고 생각햇는데, 나중에 보니 [고양이]로 밝<BR>혀지는 꿈&nbsp;','동물에관한꿈','값어치 있다고 생각했던 물건이나 나중에 알고 보니 <BR>아무런 가치가 없는 것으로 판명나게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3332','','[고양이]가 자신의 [바지]를 물어뜯는 꿈 ','동물에관한꿈','잘되던 일이 매우 불길하고 위험을 겪게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3333','','[닭장]을 들여다 보는 [고양이]를 보는 꿈 ','동물에관한꿈','물질적, 정신적으로 자신에게 손해를 끼칠 일들이 나<BR>타날 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3334','','[쌀][가마니] 위에 [곰] 여러마리가 올라 앉아있는 꿈 ','동물에관한꿈','한 해 동안 농사가 잘 되어 많은 수확을 하게 될 것이<BR>다. 집안에 많은 돈과 재물이 들어올 것을 암시하는 꿈<BR>이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3335','','[곰]이 [새끼] 낳는 것을 보는 꿈 ','동물에관한꿈','태몽으로, 부인과 새댁은 훌륭한 자식을 낳게 될 것이<BR>며, 사업발전,새로운 상품 개발 등을 암시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3336','','죽은 [곰]의 [쓸개]를 구하는 꿈 ','동물에관한꿈','그동안 해오던 일에 큰 성과를 거두어 세인의 이목을<BR>한몸에 받게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3337','','[곰]의 [변]에서 [금]이나 [은]이 나오는 꿈 ','동물에관한꿈','돈과재물이 들어올 것음 암시하며, 생산이나 유통업 <BR>등에 투자하여 사업서오가를 올리고, 소비자 취향에 <BR>잘 맞는 상품을 개발하여 많은 돈을 벌게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3338','','[곰]이 [떼]를 지어서 [집]안으로 들어오는 꿈 ','동물에관한꿈','생산, 무역, 유통업 등에 투자하여 많은 돈을 벌게 될 <BR>것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3339','','앞[산]에서 [곰] [울음소리]가 들리는 꿈 ','동물에관한꿈','우편,소식 등을 암시하며, 평소 바라고 있던 희망사항<BR>이나 소망이 이루어지고, 뜻하지 않던 곳에서 행운을<BR>맞아 작은 재물과 이익이 있을 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3340','','[기린]이 [교미]하는 것을 보는 꿈 ','동물에관한꿈','상호간에 사업적인 계약이 성사되는 꿈이다. 결혼, 합<BR>방 등을 암시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3341','','[장군]이 [기린]을 타고 [집]안으로 들어오는 꿈 ','동물에관한꿈','객지에 나갔던 자식이 금의환향하여 고향으로 돌아오<BR>게 될 것을 암시하는 꿈이다. 집안에 경사가 있을 것이<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3342','','[기린]이 [목]을 길게 빼고 멀리 바라보는 꿈 ','동물에관한꿈','점점 미래의 희망이 밝아오고, 학수고대하던 사람이 <BR>자기를 찾아오게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3343','','[기린]이 [도망]치는 꿈 ','동물에관한꿈','계획하던 일이 뜻대로 이루어지지 않고, 재산이나 자<BR>신의 일이 소멸될 것을 암시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3344','','[기린]의 [목]을 잘라 죽이는 꿈 ','동물에관한꿈','반가운 소식을 전해 듣거나 어렵던 일이 성사될 것이<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3345','','[기린]이 이리 뛰고 저리 뛰면서도 [도망]다니는 것을 <BR>보는 꿈&nbsp;','동물에관한꿈','많은 사람들에게 시달림을 받거나 함정에 빠져서 헤어<BR>나지 못하게 될 것이다. ','N');
