insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3349','','가까이에 있던 [기린] 떼가 멀리 사라지는 꿈 ','동물에관한꿈','좋은 일이 생길 듯 하다가 결국 허사가 될 것이다. ','N');
