insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3351','','[낙타]의 뒷[발]에 보기좋게 채이는 꿈 ','동물에관한꿈','친한 친구나 사랑하는 애인으로부터 배신을 당하게 될<BR>거며 실패, 사고 등이 생길것을 암시하는 꿈이다. ','N');
