insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3353','','[낙타]를 타고 가다가 [샘물]을 [발견]하는 꿈 ','동물에관한꿈','기분좋은 횡재수가 있는 길몽으로, 뜻밖의 귀인을 만<BR>나게 되어 도움을 받고 일이 잘 풀릴 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3354','','[늑대]들이 이곳저곳에서 힐끔거리며 저를 쳐다보는 <BR>꿈','동물에관한꿈','치한이나 불량배로부터 공갈 협박을 당하거나 주위사<BR>람들로부터 놀림과 시달림을 받고, 원한 관계 등으로 <BR>인해 누군가로부터 미행을 당하게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3355','','[늑대]들에게 쫓기다가 자기가 [하늘]로 날아올라가는 <BR>꿈 ','동물에관한꿈','처음에는 어려움을 겪다가 나중에는 행운이 트여 일이<BR>순조롭게 풀리게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3356','','[늑대]가 [피]를 흘리며 죽어 있는 꿈 ','동물에관한꿈','돈과 재물이 생기거나 곡식과 먹을 것이 들어오고, 집<BR>안에 경사가 생길 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3357','','[늑대]가 [토끼]를 물어가는 꿈 ','동물에관한꿈','집안에 도둑이 들거나 실물수가 있고, 사고로 인해 재<BR>물이 바져 나가게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3358','','[산][골짜기]에서 사나운 [늑대]가 저를 노려보는 꿈 ','동물에관한꿈','제3자에 의해 자신이 심판 받게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3359','','[늑대]가 [사람]으로 변하는 꿈 ','동물에관한꿈','자기가 의지했던 사람이 갑자기 변심하여 늑대와 같이<BR>될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3360','','[다람쥐]가 [나무]에 오르는 것을 보는 꿈 ','동물에관한꿈','승진을 하거나 다른 사람 앞에서 권위를 세울 일이 있<BR>을 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3361','','[다람쥐]가 [밤]을 따먹으로 밤[나무]에 올라가는 것을 <BR>보는 꿈','동물에관한꿈','확실한 실력자를 만나 도움을 받고, 아주 좋은 사업성<BR>과가 있을 것이다. 재물과 승진 등을 암시하는 꿈이다.<BR>','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3362','','예쁜 [다람쥐] 한 마리를 잡아서 [방] 안으로 들어오는 <BR>꿈 ','동물에관한꿈','태몽으로 , 부인과 새댁은 임신을 하여 예쁜 딸을 낳게<BR>될 것이다. 재물과 횡재수를 암시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3363','','[다람쥐]가 [책상] 위에서 [도토리]를 가지고 [재주]를 <BR>부리는 꿈','동물에관한꿈','색다른 아이디어로 새로운 일이나 계획을 세우게 될 <BR>것이다. ','N');
