insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3365','','[다람쥐]가 [새장]에 갇혀 있는 것을 보는 꿈 ','동물에관한꿈','하는 일마다 막히고 답답하여 일이 제대로 풀리지 않<BR>을 것이며, 소식불통이나 눈뜬 장님등을 암시하는 꿈<BR>이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3366','','[다람쥐]가 [여우][굴]로 들어가는 것을 보는 꿈 ','동물에관한꿈','몸에 화약을 지니고 불 속에 뛰어드는 것처럼 어처구<BR>니 없는 일을 상징하는 것으로 자살행위, 실패, 사고 등<BR>을 암시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3367','','[다람쥐]가 [입]에 [도토리]를 물고 [굴] 속으로 들어가<BR>는 것을 보는 꿈','동물에관한꿈','내 집 마련을 위한 적금을 들거나 살림을 장만하게 될<BR>것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3368','','[바위][틈] [굴] 속에서 [다람쥐] 새끼가 있는 꿈 ','동물에관한꿈','아주 중요한 보물을 얻을 징조며, 새로운 일의 개발이<BR>나 재물, 횡재수가 있을 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3369','','[두꺼비]가 점점 커져서 황[소]만하게 보이는 꿈 ','동물에관한꿈','돈 없이 시작했던 사업이 뜻밖의 기회를 만나 크게 성<BR>공할 것이며, 향상, 번창, 자금축적, 기술축적 등을 암시<BR>하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3370','','황[소]만한 [두꺼비]를 타고 [하늘]을 날으는 꿈 ','동물에관한꿈','소원성취하고 날아갈 듯이 기분이 상쾌하게 될것이다.<BR>시험합격, 입학, 취직, 승진, 당선, 승리, 성공 등을 암시<BR>하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3371','','[두꺼비]를 잡는 꿈 ','동물에관한꿈','여자는 임신을 하여 훌륭한 자식을 낳고, 사업가는 상<BR>당한 돈을 벌어서 부자가 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3372','','[금][두꺼비]나 [금][송아지]를 얻는 꿈 ','동물에관한꿈','부귀공명할 자손을 얻게 되거나 복권에 당첨되는 꿈이<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3373','','[두꺼비]가 [집] 안으로 들어오는 꿈 ','동물에관한꿈','자손이 번창하고 희소식이 있으며, 재물이 들어오고 <BR>경사가 있을 것이며, 집안이 번성하고 행운이 들어올<BR>것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3374','','[두꺼비]가 울면서 뛰어다니는 꿈 ','동물에관한꿈','구설수가 있을 것이며, 매사 언행에 주의하라. ','N');
