insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3376','','커다란 [두꺼비]가 [나무] 위에 올라가는 것을 보는 꿈 ','동물에관한꿈','때를 만나 입신출세하게 되고, 만인이 우러러보며 칭<BR>송하는 스타가 될 것이다. 합격, 취직, 승진, 당선, 성공 <BR>등을 암시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3377','','[두꺼비]나 [맹꽁이]가 [거리]를 돌아다니는 꿈 ','동물에관한꿈','줏대없는 사람을 만나거나 신통치 않은 일이 생길 것<BR>이다. ','N');
