insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3380','','오색 찬란한 [빛]을 발하는 [사슴]을 보는 꿈 ','동물에관한꿈','뛰어난 예술적 재능을 가진 옥동자를 생산하게 될 것<BR>이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3381','','[사슴]이나 [토끼]가 [도망]치는 꿈 ','동물에관한꿈','자신의 지혜로 재물을 얻게 될것이다. 그리고 만일 꿈 <BR>속에서 사슴뿔을 얻었다면 생각지도 않았던 횡재운이 <BR>있을 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3382','','[들판]에서 [사슴]들이 평화롭게 놀고 있는 꿈 ','동물에관한꿈','집안에 경사가 생기고 돈과 재물이 들어오게 될 것이<BR>다. 돈, 재물, 횡재 등을 암시하는 꿈이다. ','N');
