insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3387','','[사자]와 함께 다정히 [이야기]를 나누는 꿈 ','동물에관한꿈','실력있는 사람이나 직장 상사의 도움을 받아, 계획했<BR>던 일이 순조롭게 풀릴 것이며 회의, 토론, 면담, 상봉 <BR>등에서 자신에게 있을 이익을 암시하는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3388','','[사자]가 [산][봉우리]에서 우렁차게 울어대는 것을 보<BR>는 꿈 ','동물에관한꿈','정치 집단이나 사회 단체의 우두머리가 되어 막강한 <BR>지위와 명예를 얻게 될 것이다. ','N');
