insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3390','','[사자]가 나의 [몸]을 [혀]로 깨끗이 핥아주는 꿈 ','동물에관한꿈','힘있는 실력자나 직장 상사의 지도와 협조를 받아 성<BR>공하게 될 것이며 행운을 상징하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3391','','[사자]와 싸워서 자기가 이기는 꿈 ','동물에관한꿈','소송 중인 사람은 사건에 승소하게 되고, 큰 일을 성공<BR>시킬 것이며 반대로 사자에게 졌다면 어떤 일이 난관<BR>에 부딪혀 좌절하게 되고 소송에 관련되어서는 지게 <BR>될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3392','','[사자], [호랑이] 등 [맹수]들이 서로 싸우는 것을 보는 <BR>꿈 ','동물에관한꿈','자신들의 이익을 위하여 싸우는 단체를 보거나 소송이<BR>있을 꿈이다. ','N');
