insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3399','','[여우]가 [입]에 [먹이]를 물고 [굴] 속으로 들어가는 꿈 ','동물에관한꿈','수중에 들어온 복을 다른 사람에게 빼앗겨, 닭 쫓던 개<BR>재붕 쳐다보는격이 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3400','','[여우]가 [먹이]를 [땅]에다 파묻고 나서 힐끔 뒤돌아보<BR>는 꿈&nbsp;','동물에관한꿈','거래처의 주도면밀한 계획에 주도권을 빼앗기게 될 것<BR>이며 속임수, 실수, 놀림 등을 암시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3401','','[여우]를 쫓아가서 잡는 꿈 ','동물에관한꿈','공공단체나 자신이 몸담고 있는 곳에서 인정을 받게 <BR>될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3402','','[여우]를 [사육]하는 꿈 ','동물에관한꿈','남자가 이 꿈을 꾸면 특히 여자에 주의해야 할 징조로,<BR>여우와 싸우는 꿈은 교활한 사람을 만나게 될 것을 예<BR>시하므로 사람을 만날때는 항상 신중을 기해야함을 알<BR>립니다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3403','','[여우]를 죽이는 꿈 ','동물에관한꿈','뜻하지 않은 곳에서 재물을 얻거나 자신과 관련되지 <BR>않은 새로운 일거리 혹은 인연이 자신에게 생기게 될<BR>것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3404','','[여우]와 자기가 [싸우는] 중에 여우가 크게 우는 꿈 ','동물에관한꿈','현실에서도 교활하거나 마땅찮은 사람과 시비 또는 다<BR>툼이 있게 되고, 그 일로 인해 좋지 않은 일이 벌어질 <BR>것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3405','','[쌀][독]을 열어보니 그 속에 [자라]가 있는 꿈 ','동물에관한꿈','집안에 돈과 재물이 들어오고 먹거리가 가득하게 될 <BR>것이고 선물, 재물, 횡재 등을 암시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3406','','[자라]가 [거북이]로 변하는 꿈 ','동물에관한꿈','성공, 금의환향을 암시하며, 온갖 어려움을 딛고 일어<BR>나 입신출세하게 될 것이며 집안에 돈과 재물이 들어<BR>올 것이다. ','N');
