insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3408','','[자라]가 [집] 밖으로 나가는 꿈 ','동물에관한꿈','재산이 줄게 될 것이고 샐패, 우환, 지출등 불운을 암시<BR>하는 꿈이다. ','N');
