insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3410','','맑은 [냇가]에서 수많은 [자라]를 잡는 꿈 ','동물에관한꿈','생산, 유통,식품업 등에 자본을 투자하여 많은 돈을 벌<BR>게 되며 부인이나 새댁은 임신하여 똘똘한 자식을 낳<BR>을 것이다. 돈, 재물, 횡재, 먹거리, 취직 등을 암시하는 <BR>꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3411','','[자라]가 [알]을 품고 있는 꿈 ','동물에관한꿈','생산을 암시하며 새로운 일을 하여 이익이 있을 것이<BR>다. ','N');
