insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3414','','[코]가 막혀서 [코끼리]가 어쩔 줄 몰라하는 꿈 ','동물에관한꿈','친구나 애인이 약속을 안 지켜 안절부절 못하게 될 것<BR>이다. ','N');
