insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3426','','[코끼리]의 [코]를 잡고 [하늘]로 올라가는 꿈 ','동물에관한꿈','승진, 합격, 당선, 승리, 성공 등을 상징하는 것으로, 실<BR>력자의 도움으로 입신양명하게 될 것이다.&nbsp; ','N');
