insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3428','','많은 [새]가 날아가거나 앉아있는 것을 보는 꿈 ','동물에관한꿈','많은 집단을 뜻하며, 태몽이라면 장차 커서 많은 사람<BR>을 거느릴 지도자적 인물을 출산하게 될 것이다. ','N');
