insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3431','','작은 [새]들이 [집단]으로 날아드는 꿈 ','동물에관한꿈','매사가 편안하고 순조로움을 암시하며, 대인 관계에도<BR>신뢰를 얻고 평화로운 가정이 지속될 것이다.&nbsp; ','N');
