insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3754','','부엌에서 [송충이]가 나를 따라다니는 꿈 ','곤충 벌레에관한꿈','자손이 착하고 정직한 사람으로, 부모에게 효도할 것<BR>이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3755','','[송충이]가 [몸]에 달라붙어 있는 꿈 ','곤충 벌레에관한꿈','우환이나 큰 화를 암사하는 것으로, 잘 되던 일도 다시<BR>한번 점검하고 집안 식구들의 건강도 체크해야 할 시<BR>기이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3756','','[지렁이] [몸]이 끊어지는 꿈 ','곤충 벌레에관한꿈','불편한 관계에 있던 사람이나 감기와 같은 질병이 떨<BR>어질 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3757','','여러 마리의 [지렁이]를 보는 꿈 ','곤충 벌레에관한꿈','가까운 사람에게 사기를 당하거나 믿고 있던 사람한테<BR>서 배신을 당하게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3758','','[이]가 [몸]을 물어대는 꿈 ','곤충 벌레에관한꿈','근심거리가 생길 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3759','','벗어놓은 [옷]에 [이]가 득실거리는 꿈 ','곤충 벌레에관한꿈','집안 식구에게 우환이 따르게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3760','','침대에 [개미]나 [빈대]가 기어오르는 꿈 ','곤충 벌레에관한꿈','경제적으로 어려움이 생기거나 가까운 사람들로부터<BR>시달림을 받게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3761','','[방]바닥에 튄 [벼룩]을 놓치는 꿈 ','곤충 벌레에관한꿈','집안에 든 도둑을 잡지 못하고 놓칠 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3762','','[빈대] 때문에 [잠]을 못 자는 꿈 ','곤충 벌레에관한꿈','타인의 방해로 세웠던 계획을 바꾸거나 수정해야 할<BR>징조이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3763','','잡았던 [벼룩]이 갑자기 사라지는 꿈 ','곤충 벌레에관한꿈','잡았던 것을 놓칠 우려가 있는 꿈이다. 성공했다고 생<BR>각했던 일이 갑자기 물거품이 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3764','','[고추잠자리]를 [손]으로 잡는 꿈 ','곤충 벌레에관한꿈','태몽으로, 임신을 하여 옥동자를 얻을 것이며, 돈, 재물<BR>등이 들어올 것을 암시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3765','','날아다니던 [잠자리]가 [땅]바닥으로 뚝 떨어지는 꿈 ','곤충 벌레에관한꿈','하던 일이 중도에서 멈추게 되고 사업에 어려움이 있<BR>을 것이며, 사고, 실패, 우환등을 암시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3766','','[고추잠자리]가 [태양]을 향해 힘차게 날아 올라가는 <BR>꿈 ','곤충 벌레에관한꿈','입신출세하여 크게 명성릉 떨치게 될것이며, 시험합<BR>격, 입학, 취직, 당선, 승진 등을 암시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3767','','[고추잠자리]가 [방] 안으로 날아 들어오는 꿈 ','곤충 벌레에관한꿈','귀한 손님이 찾아오거나 희소식이 들려올 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3768','','꽃밭에 앉은 [잠자리]가 [꽃술]을 물고 있는 꿈 ','곤충 벌레에관한꿈','사업가는 물건을 주문 받아 생산에 들어가고, 선남선<BR>녀는 분위기 좋은 공간에서 사랑의 꽃을 피우게 되며, <BR>공부하는 수험생은 시험에 합격하게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3769','','[바위] 위에 앉아 있는 말[잠자리]를 잡는 꿈 ','곤충 벌레에관한꿈','처녀는 훌륭한 남자를 배우자로 맞고, 정치초년생은 <BR>국회에 입문하여 권력을 잡으며, 사업가는 운수, 제조<BR>업 응에 투자하여 성공을 거두게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3770','','꿈에 [지네]를 보는 꿈 ','곤충 벌레에관한꿈','관리가 이꿈을 꾸었다면 불길하는 꿈이다. 관직에서 <BR>물러나게 될 수도 있으므로 매사에 신중을 기해야 할<BR>것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3771','','남의 [누에고치]를 훔치는 꿈 ','곤충 벌레에관한꿈','잃었던 돈과 재물을 되찾게 되고, 임산부은 아들을 낳<BR>게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3772','','[지네]에게 물리는 꿈 ','곤충 벌레에관한꿈','투자나 융자받을 일이 생길 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3773','','여기저기 [땅]에 떨어진 [누에고치]들을 [그릇]에 주워 <BR>담는 꿈&nbsp;','곤충 벌레에관한꿈','꾸준한 노력으로 사업에 성공하며 희망찬 내일을 맞이<BR>하게 되는 꿈이다. 농업이나 제조업에다 투자하면 사<BR>업성과를 얻게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3774','','[번데기]가 [돼지]로 변하는 꿈 ','곤충 벌레에관한꿈','사업가는 보다 큰 기업으로 성장하여 사업에 성공하게<BR>될 것이며, 시험합격, 입학, 취업 , 승진, 당선, 성공 등을<BR>암시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3775','','[논][밭] 여기저기에 많은 [누에]가 널려 있는 꿈 ','곤충 벌레에관한꿈','부동산에 투자하여 재미를 보게 될것이며 돈, 재물, 먹<BR>거리, 횡재 등을 암시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3776','','[누에고치]에서 [실]을 뽑는 꿈 ','곤충 벌레에관한꿈','사업가가 이러한 꿈을 꾸었을 경우에는 다른 회사로부<BR>터 일을 주문받아 생산에 들어가게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3777','','[누에고치] 속에서 [나방]이 기어나오는 것을 보는 꿈 ','곤충 벌레에관한꿈','태몽으로, 새댁이나 부인은 옥동자를 낳고, 사업가는 <BR>보다 큰 기업으로 성장하게 될것이며, 공부에 소질이<BR>없었던 학생은 학문에 눈을 뜨게 되어 명문 학교에 들<BR>어가게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3778','','[호주머니]에 [누에] [번데기]가 가득 담겨 있는 꿈 ','곤충 벌레에관한꿈','돈이 생길 것이며, 돈, 재물, 선물, 먹거리 등을 암시하<BR>는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3779','','[딱정벌레]가 양쪽 [다리]에 많이 붙어 있는 꿈 ','곤충 벌레에관한꿈','세일즈맨이 보험 가입 신청서나 증권 등에 관한 일로<BR>자신을 찾아오게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3780','','밥상 위에 [파리][떼]가 새까맣게 앉아 있는 꿈 ','곤충 벌레에관한꿈','여기서의 파리떼는 질병, 불결한 장소, 싸움, 소란, 소<BR>송, 시달림, 우환, 시장터, 치환 등을 암시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3781','','[파리]가 [몸]에 달라붙어서 떨어지지 않는 꿈 ','곤충 벌레에관한꿈','일을 진행하는 중에 장애물에 부딪혀 시달림을 당하게<BR>될 것이다. ','N');
