insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3783','','천장에 붙어 있던 [파리][떼]를 죽이거나 날려보내는 <BR>꿈 ','곤충 벌레에관한꿈','그 동안의 근심 걱정이 말끔히 해소되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3784','','[잔칫집]에 똥[파리]들이 들끓는 꿈 ','곤충 벌레에관한꿈','좋은 일에 난데없이 불청객이나 괴한 등이 침입하여 <BR>난리법석을 떨게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3785','','[개미]가 [파리]를 나르고 있는 것을 보는 꿈 ','곤충 벌레에관한꿈','가까운 사람이 자기 일을 도와주어 유리하게 일이 잘 <BR>풀릴 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3786','','[벌레]나 [곤충]이 뱃속으로 들어와 [임신]을 하는 꿈 ','곤충 벌레에관한꿈','임산부는 불구의 기형아를 낳거나 사산을 하게 될 것<BR>이다. 질병, 수술, 액운 등을 암시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3787','','제 양쪽 [다리]에 [거머리]가 붙어 있는 꿈 ','곤충 벌레에관한꿈','많은 재물이 생겨 인력을 고용할 일이 생길 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3788','','[곤충]이 [교미]하는 광경을 보는 꿈 ','곤충 벌레에관한꿈','일의 성과가 나타나거나 연합, 결연에 관련된 일이 생<BR>길 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3789','','독[나방]의 [날개]가 [눈]에 부딪치는 꿈 ','곤충 벌레에관한꿈','하루 종일 암울한 생활을 하게 될 것이며, 전염병이나 <BR>사고 등을 암시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3790','','[곤충] [표본]집을 만드는 꿈 ','곤충 벌레에관한꿈','소설의 소재나 학설등을 수집해서 책을 편찬하거나 연<BR>구 성과를 얻게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3791','','[모기]떼가 덤비는 꿈 ','곤충 벌레에관한꿈','싸움, 소송 등이 있을 경우 암시하는 흉몽으로, 괴한이<BR>나 깡패한테 집단 폭행을 당하거나 수모를 당할 것이<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3792','','독[나방]이 사람의 [살]갗에 와닿는 꿈 ','곤충 벌레에관한꿈','유행성 전염병과 피부질환으로 병원출입을 하게 될 것<BR>이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3793','','[진딧물]이 싱싱한 [채소]를 갉아먹는 것을 보는 꿈 ','곤충 벌레에관한꿈','가까운 사람에게 사기를 당하거나 배신, 외면 등으로<BR>시달림을 당하게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3794','','[진딧물]이 [옷]에 붙어서 옷감을 갉아먹는 꿈 ','곤충 벌레에관한꿈','누명을 쓰고 억울하게 망신을 당하게 될 징조이며 병<BR>이나 우환을 암시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3795','','[진딧물]이 [꽃]을 갉아먹는 꿈 ','곤충 벌레에관한꿈','괴한에게 자식을 유괴 당하게 될 것이며 그밖에도 강<BR>간이나 명예와 삼각 관계로 발전될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3796','','[친구]가 [선물]한 [분재]에 [진딧물]이 있는 꿈 ','곤충 벌레에관한꿈','현실에서의 친구와 작은 다툼이 있거나 연인과 함께 <BR>만났던 친구와 삼각 관계로 발전되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3797','','[컴퓨터]나 [휴대폰]에 [진딧물]이 붙어있는 꿈 ','곤충 벌레에관한꿈','일에 있어서 중요한 아이디어나 자료를 도난당할 것이<BR>다. ','N');
