insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3843','','[가지]가 부러지는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','집안에 우환이 생기고 자손에게 불길한 액운이 있을 <BR>것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3844','','[벌레]가 갉아먹어 [구멍]이 뻥뻥 뚫린 [뽕잎]을 보는 <BR>꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','도둑을 맞거나 가까운 사람으로부터 사기 당할 일이 <BR>생길 것이며 질변, 우환, 실패 등이 따를 것을 암시하는<BR>꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3845','','[누에고치]에서 뽑아낸 [실]이 금빛 찬란한 꿈 ','곤충 벌레에관한꿈','새롭고 기발한 일을 해내거나 획기적인 기회가 있을 <BR>것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3846','','말라서 죽은 [사철나무]에서 [새순]이 돋아나는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','다쓰러져 가는 사업체를 인수받아 다시 일으켜 세우게<BR>될 것이며, 기사회생, 대기만성 등을 암시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3847','','주위에 늘어서 있는 [사철나무]들이 짙푸르게 보이는 <BR>꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','친구 등과같은 주변 사람들에게 기쁜 소식이 있을 것<BR>이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3848','','[담]장 밑에다가 여러 그루의 [사철나무]를 심는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','슬하에 있는 여러 자식을 훌륭하게 키워내 입신출세시<BR>킬 징조로, 지금 하고 있는 어려운 일들로 인해 장차 <BR>큰 빛을 보게&nbsp; 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3849','','[사철나무]의 굵은 [가지]가 뚝 부러지는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','불합격, 실패, 사고 등을 암시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3850','','싱싱한 [솔잎]을 따가지고 [집]으로 들어오는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','학문 연구 또는 예술적 분야에 몸담고 있는 사람의 경<BR>우, 학문과 예술적 자료를 수집하거나 이에 상응한 자<BR>료를 얻게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3851','','[백송나무]를 오르는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','승진하여 입신출세하게 될것이며, 시험합격, 입학, 취<BR>업, 승진, 당선, 승리, 성공, 발전 등을 암시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3852','','[소나무]에 오르는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','각종 자격증 시험이나 승진 시험을 치른 사람은 취직, <BR>입학이 이루어지고, 소송중인 사람은 승소하게 될 것<BR>이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3853','','[소나무]에 푸른 [솔방울]이 많이 열려 있는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','집안의 경사와 임신, 혹은 명예를 암시하는 것으로, 재<BR>물이 생기고 먹거리가 들어오게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3854','','[소나무][꽃]이 피어 있는것을 보는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','금전운이나 사업운이 상승으로 매사가 순조롭게 잘 풀<BR>리고, 새로운 일을 해도 모두 성공을 하게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3855','','윗사람한테서 [잣]송이를 받는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','자격증이나 상, 훈장을 받을 것이며, 재물과 횡재를 암<BR>시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3856','','[잣나무]에 하얀 [꽃]이 아름답게 피어있는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','집안 식구들에게 경사가 있고 자신에게도 명예와 행운<BR>이 있는 등 운수가 대통하게될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3857','','[땅]에다가 [잣나무]를 심는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','부동산과 관련되어 매입하거나 새로 짓는 일을 하게 <BR>될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3858','','[그릇] 안에 [잣][알]이 수북히 담겨있는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','집안에 돈과 재물이 풍족하게 되고 먹을 것이 생길 것<BR>이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3859','','[잣나무]에 올라가서 [잣]송이를 따는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','사업에 투자하여 많은 돈을 벌게 될것이며, 합격, 승리,<BR>취직, 당선, 자격취득, 성공 등을 암시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3860','','커다란 [잣나무] [가지]를 붙잡고 있는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','실력자를 만나 도움을 받고 새로운 발전을 이루어 가<BR>게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3861','','[정원]에다 [나무]를 옮겨 심는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','승진이나 전근 등으로 자리를 옮기게 되거나 좋은 사<BR>람을 만나게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3862','','[정원]에 [꽃]이 활짝 피어 있는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','꿈 속에서 본 광경으로도 매우 기분 좋은 꿈일 것이다.<BR>마찬가지로 사업상 또는 기타의 일로 경사로워질 것이<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3863','','[참나무][꽃]이 [만개]해 있는 것을 보는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','신상품을 개발하여 수출을 하는 등 오랜 어려움을 딛<BR>고 일어나 대업을 성취하게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3864','','[참나무]에 [상수리]가 다닥다닥 열려 있는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','제조 및 식품업 등에 투자한 것이 사업성과를 가져와 <BR>날로 번창하게&nbsp;될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3865','','[참나무][숯]에 [불]을 지피는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','지금까지 막히기만 하던 운수가 일시에 풀리고, 마음<BR>먹은 대로 소원성취하게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3866','','[그릇]에 담아 놓았던 [도토리][알]을 [쥐]가 몰래 물어<BR>가는 꿈','꽃과 나무,돌 등 자연물에 관련한꿈','집안에서 돈과 재물이 새어나가거나 좀도둑을 맞게 될<BR>것이다. 지출, 실물수, 우환등을 암시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3867','','[참나무] [가지] 위에 [까치]가 [집]을 짓고 있는 것을 <BR>보는 꿈&nbsp;','꽃과 나무,돌 등 자연물에 관련한꿈','집이나 건물 등의 신축공사로 인해 분주다사하게 될 <BR>것이다. 새로운 사업과 일을 착수하게 될것을 암시하<BR>는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3868','','[참나무] [장작]을 차곡차곡 많이 쌓아두는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','피땀 흘려 노력한 결과, 거금을 손에 거머쥐게 될 것이<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3869','','노란 [과일]과 푸른 과일을 몰래 [훔쳐]먹는 꿈 ','음식물에관한꿈','제3자를 통해서 혼담이나 계약등이 이루어질 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3870','','[호두]를 [한입]에 깨물어 먹는 꿈 ','음식물에관한꿈','하는 일마다 순조롭게 이루어져서 좋은 성과를 얻게<BR>될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3871','','[집] 안에 심은 [과일][나무]에 과일이 주렁주렁 열리는<BR>꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','결혼, 사업등에 있어서 결실을 맺을 때를 알리는 꿈이<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3872','','[금]이 간 [과일]을 얻는 꿈 ','음식물에관한꿈','신체의 어딘가에 상처를 입거나 질병을 얻게 될 것이<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3873','','쪼개진 [과일]을 얻는 꿈 ','음식물에관한꿈','잘 하고 있던 일에 비정상적인 과정을 겪게 되며, 확실<BR>하지 않은 사업에 손을 대게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3874','','[혼담]이나 [사업]상의 일로 썩은 [과일]을 얻는 꿈 ','음식물에관한꿈','결혼, 사업에 관련되어 불행이 찾아오게 될 것이며, 모<BR>든 일에 있어서 결과가 좋지 않을 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3875','','[혼담]이 오가는 가운데 깨진 [과일]을 얻는 꿈 ','음식물에관한꿈','혼사가 파기되거나 불행이 다가오게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3876','','[과일]을 통째로 삼키는 꿈 ','음식물에관한꿈','명성을 얻어 신분이 높아지고 입신출세하게 되며, 권<BR>력, 명예, 부귀 등을 얻게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3877','','[남]이 따 준 [과일]을 받는 꿈 ','음식물에관한꿈','게약, 혼약, 청탁, 일거리 등의 일과 관계하여 자신이 <BR>해야 할 일이 많아 분주할 징조이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3878','','[방] 안에 심은 [과일][나무]에서 잘 익은 과일을 따먹<BR>는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','약혼이나 결혼이 성립되거나 사랑의 고백을 받을 징조<BR>이다. 또한 결혼한 사람은 성교할 일이 생길 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3879','','[꽃]은 졌는데 [열매]가 맺히지 않는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','진행 중인 일에 발전이 없고, 궁지에 몰릴 일이 생길 <BR>것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3880','','[과일]을 [수확]하여 [창고]에 쌓아 놓거나 담는 꿈 ','음식물에관한꿈','태어날 아이가 장차 사업체를 운영하여 사람들로부터<BR>존경을 받게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3881','','[임산부]가 [과일]을 낳는 꿈 ','음식물에관한꿈','임산부는 귀한 딸을 낳게 되고, 만약 아들일 경우 똘똘<BR>하고 건강하게 자라날 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3882','','[나무] 밑에서 [열매]를 따는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','태몽으로, 평범한 서민으로 살아가거나 물질적으로 풍<BR>요롭지 못한 자녀를 출산하게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3883','','[푸른] 빛을 띤 [열매]를 보는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','태몽으로, 명예를 얻고 스타가 될 아들을 출산하게 될<BR>것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3884','','[꽃]이 달린 채 떨어진 풋[감]을 주워 담는 꿈 ','음식물에관한꿈','부하직원이나 아랫사람으로 훌륭한 인재를 고르게 되<BR>고, 일에 꼭 필요한 자료를 수집하거나 자본을 구하게 <BR>될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3885','','[곶감][꽃이]에서 곶감을 한 개씩 빼먹는 꿈 ','음식물에관한꿈','마무리 단계에 있는 일을 맡게 되지만 진전이 없고 집<BR>안이나 자신의 재산이 조금씩 줄어들 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3886','','[감][꽃]이 곱게 피어 있는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','새로운 아이디어로 신상품을 개발하거나 훌륭한 일을<BR>해내어 세상의 이목을 끌게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3887','','[감나무] 밑에 누워서 [홍시] 떨어지기를 기다리는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','힘 안 들이고 일을 손쉽게 처리하려 하지만 되는 일이<BR>없습니다. 관망, 구경, 감상할 일이 생길 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3888','','떨어진 [연시]를 주워서 먹는 꿈 ','음식물에관한꿈','창피를 당할 일이 있거나, 소녀는 곧 초경을 치르게 될<BR>것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3889','','[대추]를 [수확]하는 꿈 ','음식물에관한꿈','농업,생산, 식품, 유통업 등에 투자하여 좋은 성과를 올<BR>리게 될 징조로, 먹는 것과 관련되어 좋은 일을 암시하<BR>는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3890','','[대추][나무]에 풋대추알이 열려 있는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','돈과 재물이 생길 길조로, 복권에 당첨이 되거나 공모<BR>나 응모에 뽑힐 좋은 징조이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3891','','[대추][나무] 밑에서 대추[알]을 받는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','처녀의 경우, 훌륭한 신랑감이 혜성같이 나타날 것이<BR>다. 돈과 재물이 생기고 푸짐한 먹거리가 들어올 것이<BR>고, 부인과 새댁은 임신을 하여 옥동자를 낳게 될 것이<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3892','','붉은 [대추]를 많이 따오는 꿈 ','음식물에관한꿈','재물이 생기고 사업성과가 있으며, 태몽이라면, 똑똑하<BR>고 재물복이 있는 아들을 낳을 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3893','','[대추]를 따서 먹는 꿈 ','음식물에관한꿈','대추를 먹는 꿈은 대표적인 태몽의 일종으로, 우수하<BR>고 명석한 자식을 출산하게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3894','','[칼]로 [모과]를 여러 [조각]내는 꿈 ','음식물에관한꿈','생산 및 주식에다 투자한 것이 뜻밖의 호황을 맞게 될<BR>것이다. 부모의 유산을 형제끼리 나눠갖게 될 것을 암<BR>시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3895','','친구들과 [모과][나무]를 타고 올라가 가장 먼저 [열매]<BR>를 따는 꿈&nbsp;','꽃과 나무,돌 등 자연물에 관련한꿈','돈,재물 등을 암시하며, 치열한 경쟁에서 상대방을 물<BR>리치고 자신이 선택되어 이익을 얻고 또 그로 인해 큰 <BR>성과를 보게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3896','','[모과][나무]에 푸른 모과가 탐스럽게 많이 열려 있는 <BR>꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','새로운 사업에다 투자하여 사업성과를 올리게 될 것이<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3897','','[모과]를 따서 [그릇]에 담는 꿈 ','음식물에관한꿈','주식을 하는 사람이라면 생산, 유통업 등에 투자하여 <BR>돈을 벌게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3898','','[모과주]를 담는 꿈 ','음식물에관한꿈','겨울을 맞아 월동 준비를 하게 되거나, 집을 장만하기<BR>위한 기금, 주택 적금을 들 일이 생길 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3899','','[밤]이 [창고]에 가득 차 있는 것을 보는 꿈 ','음식물에관한꿈','아름다운 딸이 태어날 수 있으며, 많은 재물이 생길 것<BR>이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3900','','[밤][나무] 아래에서 떨어지는 밤알을 [손]으로 받는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','이런때 수주, 경매물 등을 입찰하면 낙찰권을 따낼 수<BR>있는 행운의 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3901','','[밤]송이가 누렇게 벌어진 것을 보는 꿈 ','음식물에관한꿈','머지않아 사업이 번성하고 혼담 따위가 이루어지며 큰<BR>행운이 다가올 좋은 징조이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3902','','수많은 [밤]송이를 까는 꿈 ','음식물에관한꿈','많은 사람들에게 필요하고 좋은 일을 자신이 해내어<BR>명예를 얻거나 그로 인한 재물을 얻을 징조이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3903','','토실토실한 알[밤]을 주워서 집으로 돌아오는 꿈 ','음식물에관한꿈','태몽으로, 부인은 임신을 하여 똘똘하고 잘생긴 옥동<BR>자를 낳을 것이며, 자신에게 돈과 재물이 생기고 선물<BR>이나 뜻밖의 행운이 들어오게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3904','','[꼭지]가 있는 [사과]나 [배]를 따는 꿈 ','음식물에관한꿈','태몽으로, 아들을 낳게 되고, 바라고 있던 소망이 이루<BR>어질 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3905','','여러 개의 [배][나무]를 단계적으로 심는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','집안에 경사가 생기고 사업이 순조롭게 이루어질 것이<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3906','','[배]와 [잎]사귀를 따서 [그릇]에다 가득 담아놓는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','우량기업에 주식을 투자하여 짭짤한 재미를 보거나 사<BR>업에 투자했던 것이크게 불어나서 번창하게 될 것이<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3907','','[배]를 따오는 꿈 ','음식물에관한꿈','비범한 자손을 얻거나 돈, 선물, 명예, 횡재할 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3908','','[배][나무]에 [배]가 주렁주렁 달린 것을 보는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','온종일 일이 잘되고 마음이 후련하며, 일이 순조롭게<BR>풀릴 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3909','','[밭]에서 따온 [배]가 [벌레]가 먹어 뚫려있는 꿈 ','음식물에관한꿈','임산부가 꾼 꿈이라면 태아에 이상이 생길 것을 암시<BR>하고, 일반인이 꾼 꿈이라면 사업이나 하는 일, 혹은 맞<BR>선 등에 의외의 좋지 않은 결과를 보게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3910','','윗사람으로부터 탐스런 [배] 두개를 받는 꿈 ','음식물에관한꿈','부인은 임신하여 아들 형제를 두거나 또는 쌍둥이를<BR>낳을 징조로 재물과 선물, 횡재 등을 암시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3911','','잘 익은 [복숭아]를 따먹는 꿈 ','음식물에관한꿈','연애운의 급상승으로, 평소 자신이 잘 가는 곳에서 사<BR>랑하는 연인을 만나거나 부부는 좋은 성교가 이루어질<BR>것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3912','','예쁜 [복숭아] 하나를 얻어 가지고 [품] 속에 넣는 꿈 ','음식물에관한꿈','태몽으로, 임신한 부인이 예쁜 딸을 낳을 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3913','','[복숭아][꽃] 다발을 한아름 가슴에 안고 있는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','애인과의 사이가 좋아지고 결혼에 대해서도 생각해 볼<BR>시기가 되었음을 알리는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3914','','[복숭아]를 [반]으로 잘라 보니 그 속에서 영롱한 [옥]<BR>이 나오는 꿈&nbsp;','음식물에관한꿈','재물과 발명,발견, 횡재 등을 암시하며, 그동안 꾸준히<BR>해왔던 일에 결실을 보고 그로 인해 재물과 명예를 거<BR>머쥐게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3915','','[복숭아]나 [살구][꽃]이 [만발]한 곳을 걷는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','이성관계를 맺을 기회가 오거나 많은 사람들에게 자신<BR>을 자랑할 일이 생길 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3916','','[사과]를 많이 따가지고 [집]으로 돌아오는 꿈 ','음식물에관한꿈','객지에 나가 장사를 하거나 일을 해서, 많은 돈을 벌어<BR>가지고 집으로 돌아오게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3917','','누군가로부터 [사과] 한[상자]를 받는 꿈 ','음식물에관한꿈','주위 사람으로 부터 정성어린 선물을 받게 되거나&nbsp; 재<BR>물과 먹을 것이 들어올 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3918','','형형색색의 [사과]들이 풍선처럼 공중에 떠 있는 꿈 ','음식물에관한꿈','남들이 해낼 수 없는 특이하고 창조적인 일을 해내어 <BR>많은 사람등 앞에 나서게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3919','','[사과]를 [반]으로 쪼개놓고 서로 큰걸 먹으려고 싸우<BR>는 꿈','음식물에관한꿈','부모의 유산상속을 놓고 식구들 간에 다툴 일이 생길<BR>것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3920','','[사과]에서 [새순]이 나와 쑥쑥 자라나는 꿈 ','음식물에관한꿈','머지않아서 현재 진행 중인 일에 결실을 얻게 될 것이<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3921','','[자동차]에 [사과]를 가득 싣고 달리는 꿈 ','음식물에관한꿈','생산이나 무역 등에 관련되어 재물이나 이익이 있을<BR>것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3922','','[앵두][밭]에 들어가서 앵두알을 보는 꿈 ','음식물에관한꿈','좋은 일로 분주하게 될 것이며, 잔치 등을 벌이기 위해<BR>많은 음식을 장만하거나 저장이나 저축 등을 하게 될<BR>것이다. ','N');
