insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('3926','','[앵두][나무] [가지]를 꺾는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','횡재를 암시하여, 재물이 생기고 먹을 것이 들어오게<BR>될 것이다. ','N');
