insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4013','','모르는 사람에게 [안개꽃] 한 [다발]을 [선물]로 안겨주<BR>는&nbsp;꿈&nbsp;','꽃과 나무,돌 등 자연물에 관련한꿈','자신이 남에게 도움을 주기 위해 돈과 재물을 들고 나<BR>가게 되는 꿈이다. 그러나 남을 위한 일이므로 길몽으<BR>로 해석하는 것이 바람직한 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4014','','네온사인의 찬란한 [불빛] 아래에 [안개꽃]이 활짝 피<BR>는 꿈&nbsp; ','꽃과 나무,돌 등 자연물에 관련한꿈','집안이 번성하고 개인적으로 명예와 부귀가 따를 것이<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4015','','[음식물]이 담겨 있는 [그릇] 속에 [안개꽃]이 피어 있<BR>는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','기쁜 일로 잔치 준비를 하게 되거나 먹을 것이 들어올<BR>것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4016','','양쪽 길로 [안개꽃]이 우아하게 피어있는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','경사스런 일로 인해 친구나 주위로부터 환영을 받게 <BR>될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4017','','[유채꽃]이 [산]과 [들]을 아름답게 [수]놓는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','경사와 관련된 기쁨, 감상, 행운, 만남, 결혼 등을 암시<BR>하는 것으로, 처녀총각에게는 혼담이 오가고 결혼한 <BR>사람에게는 임신을 비롯하여 집안에 새식구가 늘어날 <BR>것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4018','','[유채꽃][밭] 한가운데에 앉아있는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','만남, 모임, 경사 등을 암시하며, 아름다운 자연의 공간<BR>에서 꿈같은 쾌락을 보게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4019','','[유채꽃]에 [나비] 한 마리가 앉아있는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','사랑하는 친구나 애인을 만나 분위기 있는 공간에서 <BR>화기애애한 이야기꽃을 피우게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4020','','[유채꽃] 속에 영롱한 [옥]이 보이는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','경사, 임신, 결혼, 만남, 행운등을 암시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4021','','눈 앞으로 화려한 [유채꽃]이 다가오는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','밝은 희망과 행운이 다가올 것이며 운수대통할 것이<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4022','','윗사람한테서 [유채꽃] 한 [다발]을 받는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','태몽으로 예쁜 딸을 낳을 것이며, 합격이나 입학, 취직,<BR>승진, 당선, 선물, 경사 , 임명장 , 성공 등을 암시하는<BR>꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4023','','[연꽃] 속에 [부처]가 나타나는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','사찰이나 암자 등을 찾아 법회에 참석하거나, 확실한<BR>실력자를 만나서 도움을 받고 대업을 성취하게 될 것<BR>이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4024','','새하얀 [연꽃]이 달빛처럼 탐스럽고 환하게 보이는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','오해를 풀고 진실을 밝혀내거나 진리를 깨닫게 될 것<BR>이다. ','N');
