insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4032','','깊은 [계곡]에 하얀 [산삼][꽃]이 피어 있는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','명예와 성공등을 암시하며, 계획하고 있거나 소망하던<BR>일이 잘 풀릴 것이다. ','N');
