insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4037','','[장미][꽃]이 [만발]한 [꽃밭]에 들어가는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','연회장이나 모임에 참석하여 많은 사람으로부터 축하<BR>받을 일이 생길 것이다. ','N');
