insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4041','','[거실]에 [진달래][꽃]이 아름답게 피어있는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','집안에 경사가 생겨 화기애애한 분위기가 감돌게 될 <BR>것이다. ','N');
