insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4044','','흐르는 [물] 속에서 아름다운 [진달래][꽃] 한 [다발]을 <BR>건져내는 꿈&nbsp;','꽃과 나무,돌 등 자연물에 관련한꿈','사업에 투자한 것이 호경기를 맞아 많은 돈을 벌게 될<BR>것이다. ','N');
