insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4046','','동[산]이 온통 [진달래][꽃]으로 울긋불긋 물들어 있는 <BR>꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','자신이 해놓은 일의 결실로 명예로운 상을 받게 될 징<BR>조로, 시험합격과 당선 등의 행운이 올 것이다. ','N');
