insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4049','','뒤[뜰]에 [카네이션]이 곱게 피어있는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','귀인의 도움을 받아 ,진행하고 있는 일이 순조롭게 성<BR>사될 것이다. ','N');
