insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4142','','[먼] 곳으로 [날아가는] [사람]을 보는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','계속해서 일이 잘 진행될 것이며, 또는 가까운 사람과<BR>의 이별이나 누군가의 사망을 암시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4143','','[인공위성]을 [발사]하는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','무에서 유를 창조하듯이 새로운 일을 개발하여 큰 성<BR>공을 거두게 될 것이며, 수출이나 기술, 출장, 여행 등<BR>을 암시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4144','','[인공위성]이 [불][기둥]과 함께 [하늘] 높이 솟아오르<BR>는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','생산, 가공, 과학, 무역업 등에다 투자하여 많은 돈을 <BR>벌어 부자가 되어 상장회사로 높이 뛰어나게 될 것이<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4145','','[비행기]에 자기가 [탑승]하고 있는데 갑자기 [폭파]하<BR>는 꿈 ','문무기구에관한꿈','운세가 불운하여 생사의 갈림길에서 헤매게 될 것이<BR>며, 불쾌, 불길, 사고 등의 불운이 닥칠 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4146','','[우주선]을 타고 [우주] [정거장]에 [착륙]하는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','자연 경관 속에서 아름다움과 즐거움을 직접 체험하게<BR>될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4147','','[횡단보도]를 건너는 꿈 ','행동에관한꿈','이꿈은 자신의 사고방식이나 태도를 고치려는 당신의<BR>심리상태를 암시하는 꿈이다. 따라서 횡단보도를 완전<BR>히 건넜다면, 당신의 사고방식이 전환되어 운세가 호<BR>전됨을 암시하지만, 완전히 건너지 못하고 중간에 어<BR>중간히 서 있는 꿈이라면 아직 당신의 사고방식이나 <BR>분석이 모자라다는 증거이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4148','','[차]를 탄 채 [하늘]을 나르는 꿈 ','배 자동차에관한꿈','자신이 하는 일이 세인의 관심이 집중되고, 날로 번창<BR>할 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4149','','[자동차]를 타고 [자갈][밭]을 통과하여 [고속도로]로 <BR>[진입]하는 꿈&nbsp;','배 자동차에관한꿈','온갖 어려움을 딛고 일어나서 평탄하고 안정된 생활을<BR>누리게 되며, 인내심, 강력한 추진력, 산전수전 등을 암<BR>시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4150','','기분 좋게 [차]를 [운전]하는 꿈 ','배 자동차에관한꿈','어떤 사업체를 경영하거나 권력, 또는 세력을 갖게 될<BR>것이다. ','N');
