insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4152','','많은 사람이 [차] 주위에 몰려와 있는 꿈 ','배 자동차에관한꿈','어떤 기업체에 많은 사람이 청원하여 서로 시비를 가<BR>릴 일이 생길 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4153','','[차] [바퀴]에 [펑크]가 나서 고치는 꿈 ','배 자동차에관한꿈','진행하고 있는 일을 다시 한번 검토하고 방향을 수정<BR>해야 할 것을 암시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4154','','[자동차]로 꽉 막힌 [터널]을 뚫고 쏜살같이 내달리는 <BR>꿈 ','배 자동차에관한꿈','오랫동안 쌓였던 일들이 시원하게 술술 잘 풀려나가게<BR>될 것이며, 소원성취, 계약, 합의, 기사회생, 문제 해결 <BR>등을 암시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4155','','자기가 탄 [차]가 [수렁]에 빠져서 애를 먹는 꿈 ','배 자동차에관한꿈','매사가 풀리지 않고 사업이 어려움에 빠져서 허덕이게<BR>될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4156','','[도로]에 [차]가 꽉 막혀서 전혀 움직이지 못하는 꿈 ','배 자동차에관한꿈','하는 일마다 진로가 꽉 막혀서 되는 일이 없고, 생각지<BR>도 않은 죄인 신세가 되거나 실제로 교통체증에 걸리<BR>게 되고, 화물이 태산같이 많아서 수출길에 차질이 생<BR>길 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4157','','[자동차]를 몰다가 소복한 [여자]가 [무단횡단]하는 것<BR>을 보는 꿈 ','배 자동차에관한꿈','머지않아 교통사고가 일어나거나 죽을 고비를 맞게 될<BR>것이며, 재난이나 사고, 실패, 우환 등을 암시하는 꿈이<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4158','','[차]가 지나가 버려서 미처 [승차]하지 못하는 꿈 ','배 자동차에관한꿈','취직이나 입학, 현상모집 등에서 탈락하게 될 것이다. ','N');
