insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4160','','[차]가 [강물]에 휩쓸려 사라지는 꿈 ','배 자동차에관한꿈','어떤 강한 세력의 힘에 밀려 사업의 기반을 잃게 될 것<BR>이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4161','','[차] [머리]가 [집] [밖]으로 향해 있는 꿈 ','배 자동차에관한꿈','자신의 일이나 사업이 계획성있게 잘 추진되는 꿈이<BR>다. ','N');
