insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4167','','[차]를 타고 [헤드라이트]를 밝히며 [터널]을 지나가는 <BR>꿈 ','배 자동차에관한꿈','사업운 또는 관운이 열리고 학문 연구에 진척이 있을<BR>것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4168','','[차]가 [강][물]에 빠지는 꿈 ','배 자동차에관한꿈','어떤 일의 결과가 다른 곳에 흡수되거나 억압을 받게<BR>될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4169','','[차]를 도중에서 타는 꿈 ','배 자동차에관한꿈','직장에 취직하게 되거나 어떤 단체에 가입하게 될 것<BR>이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4170','','마주오던 [자동차]와 [충돌]하여 [교통사고]를 당하는 <BR>꿈 ','배 자동차에관한꿈','사업이나 어떠한 일을 하다가 상대방과 분쟁이 일어나<BR>큰 싸움을 하게 될 것이며, 사고, 시비, 소송등을 암시<BR>하는 꿈이다. ','N');
