insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4172','','자기가 [기차]에 깔려 죽는 꿈 ','배 자동차에관한꿈','심혈을 기울여 왔던 일이 협력자의 도움으로 성취되는<BR>꿈이다. ','N');
