insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4177','','[기차]를 타고 [고향]에 가는 꿈 ','배 자동차에관한꿈','실제 업무차 출장이나 여행을 떠나게 될 것이며, 만<BR>남, 향수, 취미생활 등을 암시하는 꿈이다. ','N');
