insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4179','','[기차]가 씽씽 달리는 것을 보는 꿈 ','배 자동차에관한꿈','사업이 순조롭게 진행되거나 행정적으로 관련된 업무<BR>등의 일이 잘 이루어질 것이다. ','N');
