insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4181','','[기차]의 [기적소리]가 온 [산천]을 크게 울리는 꿈 ','배 자동차에관한꿈','온 천지에 영예로운 명성을 떨치게 될 좋은 길몽으로<BR>뜻밖에 먼 곳에서 기쁜 소식을 날아들 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4182','','[전철]이나 [버스]를 타고 있는 꿈 ','배 자동차에관한꿈','인생의 목표를 향해 나아가고 있는 것은 틀림없지만<BR>최종 목적지 까지는 아직 시간이 걸린다는 것을 암시<BR>하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4183','','[기차]가 [레일]을 [탈선]하여 [전복]되는 꿈 ','배 자동차에관한꿈','실제 목적이나 이념, 사상, 종교, 직업 등에 긍정과 부<BR>정이 엇갈려 변화가 생길것이며, 가벼운 일이면 경험<BR>으로 그치지만 지나치게 되면 실패가 될 우려가 있는 <BR>꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4184','','[나무]가 듬성듬성 나있는 사이에서 검은 [기차]가 멈<BR>춰서는 꿈 ','배 자동차에관한꿈','방비가 소홀한 틈을 타서 액운이나 좋지 못한 일이 있<BR>을 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4185','','[기차] [철교]를 걸어서 건너는 꿈 ','배 자동차에관한꿈','분수에 맞지 않는 일을 시작하여, 항상 불안 초조해 하<BR>게 될 것이며, 이때 철교를 완전히 건넜다면 다행이 불<BR>안에서 벗어날 수 있지만 , 철교 위에서 깨어났다면 한<BR>동안 근신해야 할 시기이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4186','','[기차]를 놓쳐서 타지 못하는 꿈 ','배 자동차에관한꿈','현상 공모, 입사나 입학 시험 등에서 실패하게 되는 꿈<BR>이다. ','N');
