insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4276','','[차] [바퀴]가 빠지는 꿈 ','배 자동차에관한꿈','자신의 일에 가장 중요한 활용 능력이나 자신에게 도<BR>움이 될만한 기타의 세력 등을 잃게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4277','','잘 달리던 [자동차]가 [고장]이 나서 멈추는 꿈 ','배 자동차에관한꿈','평소 잘 해오던 일에 답답한 문제가 생길 것이다. ','N');
