insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4279','','[예식장]에 [상복]을 입은 사람이 나타나는 꿈 ','옷과악세사리에관한꿈','계약, 결사 등 어떠한 단체의 우두머리가 되거나 돈을<BR>지불할 일이 생길 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4280','','흰 [상복]을 입고 있는 꿈 ','옷과악세사리에관한꿈','무직자는 취직을 하게 되고, 집안에서 유산을 상속 받<BR>거나 시구들과 관련되어 재물이 생기게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4281','','[배우자], 특히 [남편]이 [사망]하여 [상복]을 입는 꿈 ','옷과악세사리에관한꿈','결혼, 유산의 상속, 남편의 출세, 사업쇄신 등과 관련있<BR>는 것으로, 오래 소망하던 일이 이룽어지고 번창하여 <BR>부귀를 누리게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4282','','[스커트]가 [바람]에 휘날리는 꿈 ','옷과악세사리에관한꿈','성적인 욕구에서 오는 심몽의 일종으로 자신이 성적<BR>매력을 과시하고자 하는 욕망이 꿈으로 나타납니다. ','N');
