insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4286','','[금은보화]로 된 [단추]가 달린 [옷]을 입는 꿈 ','옷과악세사리에관한꿈','좋은 동업자나 협력자나 만나 일이 순조롭게 풀리게<BR>될 것이다. ','N');
