insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4288','','[진흙]탕에서 미끄러져 [옷]을 더럽히는 꿈 ','옷과악세사리에관한꿈','임신을 한 임산부라면 출산에 지장이 생길 것을 암시<BR>하며, 일반인은 하고 있던 일에 곤란을 겪게 되는 꿈이<BR>다. ','N');
