insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4291','','[옷감]을 [필]로 들여오거나 수북히 쌓아 놓은 것을 보<BR>는 꿈','옷과악세사리에관한꿈','권리, 토지, 재물을 얻어서 풍족하고 번성할 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4292','','벗어 놓았던 [옷]을 찾지 못하는 꿈 ','옷과악세사리에관한꿈','기대고 있던 언덕이 무너져 버리고, 집안에 우환이 들<BR>어 근심걱정이 떠나지 않을 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4293','','[여성]이 [옷]을 입었는데도 속[살]이 만져지는 꿈 ','옷과악세사리에관한꿈','지조 있고 사람의 비밀이나 사생활 등을 알게 되어 그 <BR>사람에게 어떤 영향력을 행사하게 되는 꿈이다. ','N');
