insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4299','','맞춰 입은 [옷]이 [몸]에 잘 맞지 않는 꿈 ','옷과악세사리에관한꿈','주택, 배우자, 직업 등에 불만이 있는 마음에서 오는 꿈<BR>이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4300','','[옷][소매]가 찢겨나가는 꿈 ','옷과악세사리에관한꿈','친구나 형제 등의 주변 사람들과 이별을 하게 되거나, <BR>사업의 일부가 쓸모없게 되어 버릴 것이다. ','N');
