insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4323','','[바지]에 [허리띠]를 매는 꿈 ','옷과악세사리에관한꿈','결혼, 결연, 규제, 입학, 계약, 과시 등의 암시로 일의 결<BR>과가 좋고, 그 일로 남들 앞에서 과시하게 될것이다. 그<BR>러나 반대로 매고 있던 허리띠가 끊어진다면 진행하던<BR>일이 허사가 되는 꿈이다. ','N');
