insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4367','','다른 사람이 자기에게 [손수건]을 주는 꿈 ','옷과악세사리에관한꿈','고용인으로 취직을 하거나 다른 사람에게 도움을 받게<BR>되고, 그의 뜻에 동조하게 될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4368','','[여성]이 [수건]을 쓰고 앉아있는 꿈 ','옷과악세사리에관한꿈','자기 주장을 펼치지만 다른 사람들이 동조해 주지 않<BR>게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4369','','[수건]으로 [때]를 미는 꿈 ','옷과악세사리에관한꿈','어떤 사람의 추천서나 천거에 의해 자신의 일에 결실<BR>을 볼 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4370','','[어깨]에 두른 [수건]이 [손]까지 흘러내려져 있는 꿈 ','옷과악세사리에관한꿈','자신의 직업이 많은 사람으로부터 인정을 받게 되는 <BR>꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4371','','[손수건]을 사는 꿈 ','옷과악세사리에관한꿈','집안에 가정부를 두거나 계약서를 작성할 일이 있을 <BR>것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4372','','[손수건]을 만드는 꿈 ','옷과악세사리에관한꿈','집안에 가정부를 두거나 계약서를 작성할 일이 있을<BR>것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4373','','[옷]의 [단추]가 저절로 풀리는 꿈 ','옷과악세사리에관한꿈','만사형통의 길몽으로, 매사가 원하는 대로 술술 풀릴<BR>것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4374','','[승리]라고 적혀진 [수건]을 [머리]에 동여매는 꿈 ','옷과악세사리에관한꿈','정신적으로 어려운 문제에 부딪히지만 잘 극복해 나갈<BR>것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4375','','[양말], [버선], [스타킹] 등을 [벗는] 꿈 ','옷과악세사리에관한꿈','주변의 대인 관계가 나빠지거나 한동안 작별할 일이 <BR>생길 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4376','','[침대]를 때려부수는 꿈 ','가재도구에관한꿈','직장에서 실직하는 등 하던 일을 그만두어야 할 징조<BR>이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4377','','[침대]에서 떨어지는 꿈 ','가재도구에관한꿈','직장이나 사업, 명예, 권리 등을 잃게 될 것을 암시하<BR>며, 하던 일을 그만두거나 걸림돌이 있을 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4378','','[침대]의 [다리]가 부러지는 꿈 ','가재도구에관한꿈','사업상 어려움이 생기거나 믿었던 부하 직원을 잃게<BR>될 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4379','','야전 [침대]에 누워있는 꿈 ','가재도구에관한꿈','병원에 입원하거나 직장일에 근심이 생길 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4380','','새 [침대]를 [방] 안으로 들여오는 꿈 ','가재도구에관한꿈','사업 기반이 마련되고, 결혼하지 못한 사람은 결혼하<BR>게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4381','','[침대]를 [방]에서 내가는 꿈 ','가재도구에관한꿈','그동안 오랫동안 해오던 일을 바꾸거나 문제가 생기<BR>고, 부부사이에는 이혼하는 일이 있을 정도로 위험에 <BR>처할 징조이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4382','','[이불]을 개는 꿈 ','가재도구에관한꿈','꿈에 이불을 개면 하고 있는 일을 그만두거나 새로운<BR>일을 시작하고, 반대로 이불이나 담요를 펴면 매사가 <BR>순조롭게 풀릴 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4383','','[이불]을 펴는 꿈 ','가재도구에관한꿈','꿈에 이불을 개면 하고 있는 일을 그만두거나 새로운 <BR>일을 시작하고, 반대로 이불이나 담요를 펴면 매사가 <BR>순조롭게 풀릴 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4384','','꿈에 [비단][이불]을 보는 꿈 ','가재도구에관한꿈','사업이나 결혼생활 등이 성공적으로 이루어질 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4385','','[이불] 위에 [개미]나 [바퀴벌레] 등 [벌레]가 많이 모이<BR>는 꿈 ','곤충 벌레에관한꿈','경제적 손실이 있거나 좋지 않은 일이 생길 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4386','','[이불] 위에 [피]가 묻어 있는 것을 보는 꿈 ','피에관한꿈','집안에 좋지 않은 일이 있거나 아내에게 간통할 일이 <BR>있는 등 좋지 않은 일이 있을 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4387','','[방]에 펴놓은 [이불]을 찢는 꿈 ','가재도구에관한꿈','일하는 곳에서 실직하거나 매사가 막혀 힘겨워질 것이<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4388','','[이불]이나 [커튼] 등이 떨어지는 꿈 ','가재도구에관한꿈','가족 중에 누군가가 질병에 걸리거나 사고를 당할 것<BR>이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4389','','[집]에 새 [돗자리]를 들여오는 꿈 ','가재도구에관한꿈','처녀 총각이 이런 꿈을 꾸면 장차 좋은 배우자를 만나 <BR>행복한 삶을 누리게 될 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4390','','[발]을 새로 사들이는 꿈 ','가재도구에관한꿈','좋은 친구나 귀인을 만나게 되고, 얌전하고 올바른 여<BR>성을 아내로 맞아들이게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4391','','[병풍]이 둥글게 둘러쳐 있는 꿈 ','가재도구에관한꿈','친척이나 주위의 가까운 사람이 큰 병을 얻게 될 것을 <BR>암시하는 꿈이다. <BR><BR>그리고 꿈 속에서 두 겹으로 포개어진 병풍을 보면, 당<BR>신이 장사를 하게 될 경우 많은 돈을 벌게 될 것을 암<BR>시하는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4392','','[돗자리]를 짜거나 엮는 꿈 ','가재도구에관한꿈','연애운의 상승으로, 연인과의 사랑이 깊어지거나 결혼<BR>생활에 있어서 만족감을 느끼고 있다는 증거이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4393','','바깥에서 여러 개의 [자리]를 펴고 [음식]을 먹는 꿈 ','음식물에관한꿈','여러 차례의 회담이나 사업 문의 등이 있을 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4394','','[모기장] 안에 누워있는 꿈 ','가재도구에관한꿈','자신을 완벽하게 보호한 상태에서 어떤 일을 기다리게<BR>되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4395','','[방][바닥]에 있는 [자리]를 새로 까는 꿈 ','집과건물에관한꿈','새로운 일을 벌이거나 많은 손님을 맞이해야 할 일이 <BR>있을 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4396','','사랑하는 사람이 제 [방][창문]에 [커튼]을 치는 꿈 ','집과건물에관한꿈','장애물로 인해 자신의 마음을 상대에게 전할 수 없게 <BR>될 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4397','','[방문]에 걸린 [발]을 떼어내는 꿈 ','집과건물에관한꿈','며느리, 양부, 양자, 의형제 등과 인연을 끊게 될 것이<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4398','','[병풍] 뒤에서 [죽은] 사람이 살아나오는 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','가족에서 사고나 질병 등 집안에 불길한 액운이 있을 <BR>것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4399','','[라디오]에서 흘러나오는 [음악]을 듣는 꿈 ','연극 영화 미술에관련된꿈','음악을 듣는 도중 자신의 느낌에 따라서 달라지는데, <BR>좋은 음악이었다면 다른 사람의 슬픈 인생이야기를 듣<BR>게 되는 꿈이다. <BR><BR>반대로 음악이 슬프고 나빴다면 행복한 다른 사람의 <BR>인생을 보게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4400','','[가족]이 한자리에 모여 [텔레비전]을 보는 꿈 ','가족 친척 부부에 관한꿈','교육을 받거나 공공연하게 남의 이야기를 들어야 할 <BR>것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4401','','[텔레비전]에서 [아나운서]가 [뉴스]를 하는 꿈 ','행동에관한꿈','실제로 꿈속의 뉴스와 비슷한 정보를 접하게 되거나 <BR>지구촌에서 일어나는 모든 시간과 소식을 듣게되는 <BR>꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4402','','새로 산 [텔레비전]을 [설치]하는 꿈 ','가재도구에관한꿈','어떤 기관을 통해 자신을 선전하거나 실제로 전화, 라<BR>디오 등을 집 안에 새로 들여 놓게되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4403','','[텔레비전]에서 [드라마]를 보는 꿈 ','행동에관한꿈','실제로 영화를 보거나 남의 인생이야기를 듣게 되는 <BR>꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4404','','[공중전화] [부스]에서 [전화]를 거는 꿈 ','행동에관한꿈','중개인이나 기관 등을 통해서 상대방에게 부탁할 일이<BR>생길 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4405','','[전화]를 걸어서 상대방을 불러내는 꿈 ','행동에관한꿈','사업적인 일이나 개인적인 자신의 일로 부탁할 일이 <BR>생길 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4406','','새 [전화기]를 [설치]하는 꿈 ','가재도구에관한꿈','정신적으로 도움을 받거나 협력자가 생기며 좋은 일이<BR>생길 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4407','','[전화벨] [소리]를 듣는 꿈 ','가재도구에관한꿈','좋건 나쁘건 외부로부터 새로운 소식을 접하게 될 것<BR>이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4408','','[전화기]가 높은 곳에 매달려 있어서 [전화]를 못하는 <BR>꿈 ','가재도구에관한꿈','다른 사람에게 부탁했던 일이나 사업 청탁이 이루어지<BR>지 않아 난감하게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4409','','[가구]나 [집] 안에 [페인트]를 칠하는 꿈 ','집과건물에관한꿈','지금까지 계속 해오던 사업을 바꾸게 되거나 문패와 <BR>간판을 바꾸는 등 사업적인 변경이 있을 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4410','','[집] 안에서 [가구]를 밖으로 내가는 꿈 ','가재도구에관한꿈','머지않아 집안의 가까운 사람이 죽거나 중병에 걸려 <BR>병원에 입원하게 될 좋지 않을 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4411','','[이불장] 안에 [이부자리]와 [혼수감]이 가득 차있는 꿈 ','가재도구에관한꿈','상품을 비축해 놓았다가 값이 좋을 때 물품을 내댜 팔<BR>게 될 것이며, 보관이나 풍요 등을 암시하는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4412','','[방]을 새롭게 [정리]하는 꿈 ','집과건물에관한꿈','혼담이 성사되고, 가정부나 일하는 사람을 들이게 되<BR>는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4413','','[보석함] 안에 [귀금속]이 가득 차있는 꿈 ','돈과재물에관한꿈','많은 돈을 벌게 될 것이며, 재물, 임신 등을 암시하는 <BR>꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4414','','[호화]로운 [책상]이나 [장롱]이 [방]안에 가득하는 꿈 ','가재도구에관한꿈','뜻하지 않게 자신을 돕는 관계기관이나 귀인을 만나게<BR>되며, 지위와 신분이 높아지고 주위로부터 선망의 대<BR>상이 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4415','','[가구]의 [위치]를 바꾸거나 돌려놓는 꿈 ','가재도구에관한꿈','임신한 산모는 유산을 하게 될 우려가 있으므로 매사<BR>에 몸조심을 하고, 일반적으로는 하고 있는 일에 걸림<BR>돌이 있을 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4416','','[의자]에 앉지 못하게 되는 꿈 ','문무기구에관한꿈','일하던 곳에서 실직되거나 입사나 취직 등에서 실패를<BR>하게 되는 꿈이다.','N');
