insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4419','','[책상]과 [걸상]이 함께 보이는 꿈 ','문무기구에관한꿈','살림살이를 장만하거나 새로운 물건을 구입하게 되는 <BR>꿈이다.','N');
