insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4429','','[사진]을 [현상]하는 꿈 ','연극 영화 미술에관련된꿈','사진이 자기 자신이라면 다른 사진이라면, 그 사람에 <BR>대해서 자신이 들어야 할 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4430','','[집]안 사람들과 함께 [사진]을 찍는 꿈 ','연극 영화 미술에관련된꿈','사업이나 계약 등의 일을 문서화하거나 남에게 도움을<BR>줄 일이 생길 것이다.','N');
