insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4458','','타인에게 [지도]를 받는 꿈 ','지리에관한꿈','결혼, 계약과 관련된 방법이나 권리가 생길 것이다.','N');
