insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4515','','[금][시계]나 기타 [고급시계]를 [손목]에 차는 꿈 ','옷과악세사리에관한꿈','좋은 배우자, 자손, 직장, 권리, 입학, 당선 등에 행운이 <BR>따를 것이다.','N');
