insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4552','','[책]을 얻어서 읽는 꿈 ','문무기구에관한꿈','학문 연구에 관련된 직업을 얻거나 일에 관계되어 필<BR>요한 소재나 아이디어, 자료를 구입하게 되는 꿈이다.','N');
