insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4614','','누군가가 [돈]이 가득 담긴 [가방]을 주면서 가져가라<BR>고 하는 꿈','돈과재물에관한꿈','주택을 구입하게 되거나 사업을 계획하게 되는 꿈이<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4615','','[동전]을 [땅]에서 몇개 줍는 꿈 ','돈과재물에관한꿈','가까운 사람과 사소한 일로 다툴 일이 생길 것이다.','N');
