insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4630','','[진수성찬]으로 차려진 [음식]을 받는 꿈 ','음식물에관한꿈','자신이 제시한 의견이나 아이디어 등이 다른 사람으로<BR>부터 좋은 평판을 얻게 되는 꿈이다. ','N');
