insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4642','','[음식]물을 꼭꼭 씹어먹는 꿈 ','음식물에관한꿈','그것이 태몽이라면, 임신 중에 유산이 되거나 아이가<BR>정신적으로 태어나기가 어려울 것이다.','N');
