insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4645','','남에게 빼앗길까봐 혼자 [숨어서] [음식]을 먹는 꿈 ','음식물에관한꿈','어떤 일을 혼자서 해결해야 할 일이 생길 것이다.','N');
