insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4650','','[라면]을 먹는데, 라면은 없고 [만두]만 먹는 꿈 ','음식물에관한꿈','오랫동안 시달려왔던 구설수에서 벗어나고 오해를 풀<BR>게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4651','','[국물]이 전혀 없는 [우동]을 먹는 꿈 ','음식물에관한꿈','일의 진전은 없고 계속해서 장해가 생기고 답답하게 <BR>풀리지 않을 것이며, 이럴 때는 휴식을 취해 심신의 재<BR>충전이 필요한 시기이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4652','','[빵]에 [잼]이나 [크림]을 발라먹는 꿈 ','음식물에관한꿈','어떤 일을 훌륭하게 다듬어 마무리하게 되는 꿈이다.','N');
