insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4654','','[떡]을 먹는 꿈 ','음식물에관한꿈','재물을 얻게 되거나 그와 관계된 일거리를 받게 되는 <BR>꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4655','','[빵]이나 [떡]을 먹고 체하는 꿈 ','음식물에관한꿈','실제 현실에서도 급체나 복통으로 고생하게 될 것이<BR>며, 또한 하던 일에 걸림돌이 생겨 곤란에 빠질 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4656','','[상대방]에게 [떡]을 나누어 주는 꿈 ','음식물에관한꿈','어떤 소식이나 도서, 지식 등을 남에게 전해 줄 일이 <BR>생길 것이다. ','N');
