insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4662','','[사탕]이나 [카라멜]을 먹는 꿈 ','음식물에관한꿈','회충이 생기거나 피로로 기진맥진하게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4663','','갖가지의 [과자]가 [그릇]에 가득 담겨있는 꿈 ','음식물에관한꿈','좋은 일거리를 맡게 되거나 진행되던 혼담이 성사되는<BR>꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4664','','[소금][물]이나 [간장]에 [세수]를 하는 꿈 ','음식물에관한꿈','새로운 일이나 계획에 작은 근심이 따를 것이다. 그러<BR>나 세수를 하고 난 후 개운하게 느꼈다면 일이 순조롭<BR>고 , 짠맛으로 얼굴이 화끈거리거나 아프다면 일이 평<BR>탄치 않고 어렵게 풀릴 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4665','','[소금]을 얻거나 소금을 가지고 [집]으로 들어오는 꿈 ','음식물에관한꿈','집안에 우환이 생기고 식구들한테 근심거리가 있을 것<BR>이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4666','','[소금]이 [들판]에 산더미처럼 쌓인 것을 보는 꿈 ','음식물에관한꿈','감히 상상할 수 없었던 큰 사업을 벌이게 되며, 자금 <BR>사정이 원활하지 않아 부채를 짊어지게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4667','','[김장][거리]를 수북히 쌓아 놓는 꿈 ','음식물에관한꿈','막대한 재물이나 자료 등을 얻게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4668','','다양한 크기의 [간장독]에 [간장]이 가득 차는 꿈 ','음식물에관한꿈','여러 사업을 벌이거나 형제간의 재산 차이를 암시하는<BR>꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4669','','[술]에 취해서 [길]위에 눕는 꿈 ','음식물에관한꿈','신임했던 사람이 배신을 하거나 다른 사람의 계약에 <BR>말려들게 될 것이며, 남과 다투면 고통이 따를 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4670','','많은 사람과 [연회석]에서 [대화]를 하는 꿈 ','행동에관한꿈','뜻하지 않은 사람과 인연이 닿게 되며, 생활이 점점 윤<BR>택해져서 부귀를 누리게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4671','','[술잔]이나 [찻잔] 등이 깨지는 것을 보는 꿈 ','가재도구에관한꿈','남의 눈을 의식하지 않고 자신의 생각을 밀고 나가고 <BR>싶은 심리 상태를 반영한 심몽이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4672','','[잔칫집]에서 [술]에 취해 쓰러지는 꿈 ','음식물에관한꿈','계획한 일이 뜻대로 되지 않고 연인과 다툴 일이 생기<BR>거나 걱정거리가 생길 것이다. 건강이 나빠질 것을 암<BR>시하는 꿈이기도 하므로 건강에 각별히 주의하라.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4673','','남에게 [술]을 따라 주는 꿈 ','음식물에관한꿈','좋지 않은 일로 많은 사람의 입에 오르내리게 되거나 <BR>여자에게 모욕을 당할 것이다. <BR><BR>그러나 남에게 초청을 받아서 술을 먹는 꿈은 장수를 <BR>누릴 것을 의미하는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4674','','[술]을 마시며 신나게 노는 꿈 ','음식물에관한꿈','병을 얻을 징조며, 남과 논쟁할 일이 생기고 크게 후회<BR>할 일이 있을 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4675','','[대통령]이 주는 [술]을 먹는 꿈 ','음식물에관한꿈','어떤 중책을 맡게 되거나 명예와 권리가 주어질 것이<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4676','','[임금]님이 하사하는 [술]을 먹는 꿈 ','음식물에관한꿈','어떤 중책을 맡게 되거나 명예와 권리가 주어질 것이<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4677','','[술]에 취해 [우물]에 빠지는 꿈 ','음식물에관한꿈','머지않아 재판을 받을 일이 있거나 , 자신을 미워할 사<BR>람이 나타나거나 모함하는 사람이 나타날 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4678','','[술]에 취해 [웅덩이]에 빠지는 꿈 ','음식물에관한꿈','머지않아 재판을 받을 일이 있거나 , 자신을 미워할 사<BR>람이 나타나거나 모함하는 사람이 나타날 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4679','','[시장]에서 아는 사람을 만나 [술]을 마시는 꿈 ','음식물에관한꿈','바른 행동으로 인해 많은 사람들로부터 칭송을 받는 <BR>징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4680','','남이 따라주는 [술]을 자기가 받아 마시는 꿈 ','음식물에관한꿈','교활한 계교에 빠지게 되거나 , 누구의 부탁을 들어주<BR>고 나서 정신적으로 시달리게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4681','','[시장]에서 [술]을 마시며 노는 꿈 ','음식물에관한꿈','모든 일이 잘 풀리며, 특히 사업이 번창할 꿈이다. 그러<BR>나 경솔한 행동은 금물, 실패하기 쉬우므로 항상 올바<BR>르게 처신해야 하는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4682','','[술]에 취해 [몸]을 제대로 가눌 수 없는 꿈 ','음식물에관한꿈','유행성 병에 걸리게 되거나 경쟁자의 꼬임에 빠져 그 <BR>잡념에서 벗어나기가 어려울 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4683','','자기가 권하는 [술][잔]을 상대방이 받아 마시는 꿈 ','음식물에관한꿈','상대방이 자신에게 복종하거나 자신의 청을 들어주게 <BR>될 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4684','','여러 종류의 [담배]를 피우는 꿈 ','음식물에관한꿈','많은 재물을 얻거나 원하는 것을 이루게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4685','','[재떨이]를 [선물]로 받는 꿈 ','가재도구에관한꿈','이것이 태몽이라면, 카운셀러나 경리 등에 관계된 직<BR>업을 가질 자손을 얻을 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4686','','[담배]를 [남]에게 건네주는 꿈 ','음식물에관한꿈','상대방의 소원을 충족시켜 줄 일이 생길 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4687','','버린 [담배][꽁초]에서 [불]이 나는 꿈 ','물과불에관한꿈','고민하고 있던 일이 순조롭게 성사되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4688','','[상대방]이 주는 [담배]를 피우지 않고 가지고만 있는 <BR>꿈 ','음식물에관한꿈','새로운 직책을 맡게 되거나 다른 일거리가 생기게 되<BR>는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4689','','[상대방]이 주는 [담배]를 피우는 꿈 ','음식물에관한꿈','질병이 생기거나 상대방으로 인해 자신의 재물을 잃게<BR>되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4690','','[커피]를 마시는 꿈 ','음식물에관한꿈','커피를 마시는 꿈은 자극을 바라고 있다는 마음의 발<BR>로이다. 더욱이 약간 강한 자극, 신선함을 바라고 있다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4691','','[다방]에서 [차]를 마시는 꿈 ','음식물에관한꿈','누군가에게 부탁을 받거나 부탁할 일이 생길 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4692','','[우유]를 마시는 꿈 ','음식물에관한꿈','정신적, 물질적인 일에 대해 책임을 지게 될 일이 생기<BR>지만, 하는 일은 순조롭게 잘 풀릴 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4693','','[과일] [쥬스]를 마시는 꿈 ','음식물에관한꿈','꿈 속에서의 과일주스는 건강 증진과 생명력 향상을 <BR>암시하며, 앞으로 생동감 넘치는 나날이 계속되는 꿈<BR>이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4694','','[물]을 많이 마시는 꿈 ','음식물에관한꿈','실제로 자는 도중에 목이 말라서 꾸는 꿈일 수도 있고,<BR>그것이 아나라면 일이 길하고 부귀하게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4695','','[꿀]이나 [엿], 혹은 [감주]를 마시는 꿈 ','음식물에관한꿈','모든 일이 뜻대로 풀리지 않고, 답답한 징조이다. 감주<BR>를 마셨다면, 친구나 친척간에 다툼이 생기고 구설수<BR>가 오래 계속되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4696','','[우유]가 들어있는 [그릇]이 [공중]에 둥둥 떠다니는 꿈 ','음식물에관한꿈','자기 능력을 발휘해야 하는 시기를 알리는 것으로 추<BR>진하는 일이 뜻대로 잘 풀려 본격적으로 뛰어들어야<BR>할 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4697','','수북이 쌓인 [대변]을 [손]으로 주무르는 꿈 ','배설물에관한꿈','막대한 재물을 마음대로 움직일 일이 생길 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4698','','[마당], [화장실], [방] 안 등에 쌓인 [대변]을 뒤적이는 <BR>꿈 ','배설물에관한꿈','사업에 필요한 자본을 많이 확보하게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4699','','수북이 쌓인 [대변]을 [삽]으로 옮기는 꿈 ','배설물에관한꿈','여러 방면으로 상당한 자본을 취급하게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4700','','자기가 [배설]한 [대변]이 수북이 쌓여 있는 꿈 ','배설물에관한꿈','사업이 점차적으로 번창하고 번성하게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4701','','[어린][아이]가 [누런] [대변]을 만지는 꿈 ','배설물에관한꿈','여러 가지 일로 돈이 생길 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4702','','[음식]상 옆에 [파란] [똥]이 있는 꿈 ','배설물에관한꿈','빚 보증을 섰던 일에 사고가 생겨 빚을 걸머지게 되거<BR>나 창피당할 일이 생길 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4703','','[대변]을 [밭]이나 [고랑]에 뿌리는 꿈 ','배설물에관한꿈','자기 주자을 내세우거나 사업상 투자할 일이 생길 것<BR>이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4704','','[색깔]이 탁하고 붉은 [소량]의 지저분한 [대변]을 만지<BR>는 꿈','배설물에관한꿈','기분이 불쾌해지고 근심걱정이 생기며, 모든 일에 불<BR>만을 느끼게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4705','','[똥][물]이 흐르는 것을 보는 꿈 ','배설물에관한꿈','남에게 사기를 당하거나 재물을 잃게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4706','','제 [집]의 [화장실]에서 누군가가 [대변]을 쳐가는 꿈 ','배설물에관한꿈','집안에 근심걱정은 해소가 되지만, 사람에 따라 재물<BR>을 잃고 금전적으로 불이익이 있을 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4707','','[대변]을 밟거나 대변 [색깔]이 검게 보이는 꿈 ','배설물에관한꿈','생각지도 않았던 재수없는 일이 일어나는 등, 어쨋든 <BR>하루종일 좋지 않은 일이 생길 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4708','','[대변]을 시원하게 보지 못하여 [꺼름직]하게 느끼는<BR>꿈 ','배설물에관한꿈','하고 있는 일이나 소원한 일이 잘 이루어지지 않게 되<BR>는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4709','','[대변]을 짊어지고 제 [집]으로 들어오는 꿈 ','배설물에관한꿈','재물이나 돈이 생기고, 큰 부자가 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4710','','[대변]을 [그릇]에 담는 꿈 ','배설물에관한꿈','남에게 창피를 당하여 체면이 깍이게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4711','','[대변]의 [냄새]를 맡았는데 역겹다고 생각하는 꿈 ','배설물에관한꿈','역겨운 다른 사람의 행동을 보게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4712','','검푸르거나 여러 가지 [잡색] [대변]을 보는 꿈 ','배설물에관한꿈','이때 대변을 일을 의미하는 것으로, 색다른 여러 일을 <BR>접할 것이다.','N');
