insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4714','','[타인]이 [배설]한 [대변]이 본인 [몸]에 지저분하게 묻<BR>는 꿈 ','배설물에관한꿈','부채로 인해 고통을 받게 되거나 남에게 창피를 당하<BR>게 되는 꿈이다.','N');
