insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4716','','[화장실]에서 빠져 나오지 못하고 [허우적]거리는 꿈 ','배설물에관한꿈','신분이나 명예의 몰락이 찾아올 것을 예시하는 꿈이<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4717','','[대][소변] 볼 장소를 찾았지만 마땅한 곳이 없어 들어<BR>가지 못한 꿈 ','배설물에관한꿈','자기가 원하던 일이 뜻대로 이루어지지 않게 되는 꿈<BR>이다.','N');
