insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4719','','제 집 [화장실]에서 [소변]을 보는 꿈 ','배설물에관한꿈','집안 일이나 직장 일과 관계되며, 야외에서 보았다면 <BR>사업상 타기관에서 소원성취를 이룰 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4720','','제 [소변]이 큰 [하천]을 이루거나 한 [도시]를 덮는 꿈 ','배설물에관한꿈','큰 권세가 주어지거나 자신의 생각을 주장할 일이 생<BR>길 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4721','','[음식점]의 [화장실]에 들어가는 꿈 ','배설물에관한꿈','이꿈은 외박을 상징하는 꿈이다. 유흥업소에서 일하는<BR>사람이나 창녀를 찾게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4722','','[성교]를 하고 나서 [소변]을 보는 꿈 ','배설물에관한꿈','어떤 일이 성사되고 나서, 또다시 두 번째 소망도 성취<BR>되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4723','','[화장실]에 빠졌다가 올라오는 꿈 ','배설물에관한꿈','만사가 형통하며 재수가 좋아, 하는 일마다 즐거울 것<BR>이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4724','','[소변]이 가득한 [구덩이]나 [비료]통에 소변을 보는 꿈 ','배설물에관한꿈','하는 일이 잘 되고 일에 필요한 중요한 것을 얻게 되<BR>며, 사업가는 사업 성과가 좋게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4725','','[소변]이 잘 나오지 않아 힘들어하는 꿈 ','배설물에관한꿈','매사가 원만하게 이루어지지 못하고 소원의 충족도 어<BR>려울 징조로, 실제로 소변이 마려워서 이러한 꿈을 꾸<BR>는 경우도 많다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4726','','[소변]을 보기 위해 [화장실]에 들어가다가 [잠]이 깨는<BR>꿈 ','배설물에관한꿈','어떤 일에 관여는 하지만, 자신의 소원이 뜻대로 될지 <BR>어떨지에 대해서는 암시하지 않는다.','N');
