insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4728','','남이 [소변] 보는 것을 보는 꿈 ','배설물에관한꿈','남의 소원이 성취도거나 다른 사람의 일이 잘 풀리게 <BR>되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4729','','[소변]을 보다가 [집]이 그 소변에 떠내려가는 꿈 ','배설물에관한꿈','길몽 중에 길몽으로, 오랜 소망이 이루어지고 원하는 <BR>큰 일을 이루게 되는 운수대통의 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4730','','제 [성기]가 돋보이며, [소변]이 시원스럽게 나오는 꿈 ','배설물에관한꿈','자신의 소원이 크게 이루어지고, 널리 소문이 나게 되<BR>는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4731','','[거름]으로 쓰이는 [오줌]통을 메고 집으로 들어오는 <BR>꿈 ','배설물에관한꿈','재물에 관련되어 횡재가 있을 것으로, 적금을 타거나 <BR>뜻하지 않은 재물인 들어올 징조이다. <BR><BR>그러나 오줌통에 있는 변을 버렸다면 있는 물건이 밖<BR>으로 나가는 실물수이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4732','','[옷]에 [소변]이 묻는 꿈 ','','어떤 계약을 체결할 일이 생기거나 사소한 감정상의 <BR>문제가 발생하여 불쾌하게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4733','','[황소] 세마리가 메어져 있는 것을 보는 꿈 ','동물에관한꿈','아들 셋을 낳고 자수성가하는 인물이 될 태몽이다.','N');
