insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4735','','[말]을 타고 달리는 사람들을 보는 꿈 ','동물에관한꿈','정치와 사업 등에 재능이 있어 장차 고급 관리가 될 아<BR>이를 낳게 되는 꿈이다.','N');
