insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4740','','산 [돼지]를 데려오는 꿈 ','동물에관한꿈','씩씩하고 용맹스런 자손을 낳을 태몽이다.','N');
