insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4744','','[호랑이] 새끼 두 마리를 한꺼번에 안는 꿈 ','동물에관한꿈','연년생의 형제를 두고 그들이 장차 높은 관직에 오를 <BR>것이다.','N');
