insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4746','','[호랑이]가 [품]안으로 달려드는 꿈 ','동물에관한꿈','사내아이를 낳으면 공명하고 훌륭한 인물이 되고, 여<BR>자라도 크게 성공하며 훌륭한 배우자를 만나게 되는 <BR>꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4747','','[뱀]이 제 [발]을 물기에 밟아죽이는 꿈 ','동물에관한꿈','유산이 되거나 태아에게 좋지 않은 질병이 있을 것이<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4748','','큰 [구렁이]와 관계된 꿈 ','동물에관한꿈','여자는 재주가 뛰어나거나 명성을 떨칠 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4749','','누런 [뱀]이 [치마] 속으로 들어오는 꿈 ','동물에관한꿈','중도에 요절하거나 실종될 아이를 낳을 좋지 못할 태<BR>몽이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4750','','공동 [우물]에서 큰 [구렁이]와 그 밑에 [지네]가 득실<BR>거리는 꿈','동물에관한꿈','장차 장사를 하거나 큰 사업가가 되어 많은 사람들을 <BR>거느리게 될 아이를 낳을 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4751','','[노인]에게서 [인삼] 한 뿌리를 받는 꿈 ','음식물에관한꿈','인정이 많고 사회사업을 하며, 효심이 지극하고 조상<BR>의 보살핌을 받는 아들을 낳을 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4752','','붉고 누런색을 띤 [고양이]가&nbsp;자신의 [등]을 무는 꿈 ','동물에관한꿈','내성적여면서 고집이 센 아이를 낳을 태몽으로, 예능 <BR>쪽으로 재주가 있는 아이를 낳을 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4753','','푸른색 [구렁이]가 [몸]을 아래로 늘어뜨리고 있는 꿈 ','동물에관한꿈','기관이나 사회에서 우두머리가 될 아이를 가질 태몽이<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4754','','[비단뱀], [꽃뱀] 등 무늬가 아름다운 [뱀]들이 자신을<BR>i아오는 꿈 ','동물에관한꿈','욕심 많은 딸을 낳을 징조로, 항상 주위사람들에게 인<BR>기를 끌고 패션디자이너 쪽으로 진출하면 크게 성공할<BR>아이를 암시하는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4755','','큰 [구렁이]가 [쥐]구멍으로 들어가는 꿈 ','동물에관한꿈','유산 또는 사망을 예시하는 좋지 않은 꿈이다.','N');
