insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4757','','큰 [구렁이]가 [용마루]를 들어가는 꿈 ','동물에관한꿈','나라에서 국가적으로 우두머리가 될 아이를 예시하는 <BR>꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4758','','많은 [황색] [구렁이]가 늘어서 있는 꿈 ','동물에관한꿈','위대한 정치가나 사업가가 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4759','','수많은 [뱀]을 보는 꿈 ','동물에관한꿈','이 꿈은 아들과 딸의 상관없이 자라서 학자나 교사 등 <BR>학문과 관련될 아이를 예시하는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4760','','캄캄한 [한밤중]에 [용]이 [승천]하는 꿈 ','용과관련된꿈','아들인 줄 알았는데 딸이 되는 태몽이지만, 그 딸이 결<BR>혼을 하면 아들보다 더 귀한 딸자식이 되는 꿈이다. 중<BR>년보다 말년이 다복한 아이를 암시하는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4761','','[용]이 [구름] 속에서 [눈]을 부라리다 [빗방울]을 떨어<BR>뜨리는 꿈','용과관련된꿈','태아가 유산하거나 산모에게 질병이 있을 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4762','','[사냥꾼]의 [화살]에 맞은 흰 [돼지]가 제 품으로 달려<BR>드는 꿈','동물에관한꿈','의사가 되거나 기계, 전기, 화학, 컴퓨터 계통으로 진출<BR>하면 발전하는 꿈이다. 다만 자라면서 수술수가 있으<BR>니 건강에 주의하라.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4763','','[갯벌]에서 [용]이 [머리]를 캐어내는 꿈 ','용과관련된꿈','우두머리가 될 아이를 예시하는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4764','','[마당]에 있는 [용]을 보는 꿈 ','용과관련된꿈','인물은 크게 되지만 끝내 득세하지 못할 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4765','','[용]이 [방] 안에서 헤매이고 있는 꿈 ','용과관련된꿈','어릴 때 크게 자라나 나중에 큰 뜻을 이루지 못할 것이<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4766','','[학]이 [품] 안에 들어가거나 [어깨]에 앉는 꿈 ','동물에관한꿈','여자아이의 태몽으로, 학자나 성직자를 낳을 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4767','','[동자]가 [학]을 타고 내려오는 꿈 ','동물에관한꿈','높은 관직의 우두머리가 될 것을 암시하는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4768','','[비둘기]에 관한 꿈','동물에관한꿈','성품이 어질고 착하며 봉사를 잘하는 아이를 낳을 것<BR>이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4769','','[방] 안에 [뿔]이 난 [금두꺼비]가 있어 문을 닫는 꿈 ','동물에관한꿈','특출하고 부귀로워질 아이가 태어났으나, 어려서 죽을<BR>수 있는 불길한 태몽이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4770','','[저수지]에 붉은 [금붕어]가 있고 [산][새]들이 지저귀<BR>고 있는 꿈&nbsp;','꽃과 나무,돌 등 자연물에 관련한꿈','시댁 집안에서 귀한 장남을 가지게 되었을 때 꾸는 꿈<BR>이다. 공부는 썩 잘하지 못하나 듬직한 아들로 자랄 태<BR>몽이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4771','','[길]잃은 [사슴] 새끼를 구해주었는데 [황금] 사슴으로<BR>변하는 꿈 ','동물에관한꿈','집념이 강하고 신념이 강한 남자아이로 , 다만 어릴때 <BR>몸이 허약하여 부모가 애를 먹을 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4772','','[공작새]를 사서 큰 [닭장] 안에 넣는 꿈 ','동물에관한꿈','조상들의 보살핌이 많고, 아들이 귀한 집안에서 흔히 <BR>꾸는 태몽이다. 컴퓨터, 공무원, 정치 쪽에 인물이 많이<BR>날 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4773','','[봉황] 한 쌍이 나란히 앉아 있는 꿈 ','동물에관한꿈','장차 천재적인 인물이 되거나 그 아이가 문무를 겸비<BR>할 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4774','','[참새] 한 마리가 [방] 안에 들어오는 꿈 ','동물에관한꿈','특별히 사고를 치지도 않고 훌륭하지도 않은 , 극히 평<BR>범한 아이를 낳을 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4775','','[방]안이나 [지하철] 안에서 노는 [물고기]를 보는 꿈 ','배 자동차에관한꿈','의식주가 풍부하거나 창작할 사람,지도자가 될 사람을<BR>예시하는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4776','','[참새]떼 중에 한마리가 [방]안으로 들어온 것을 보는 <BR>꿈 ','동물에관한꿈','태아가 움악인이나 기타 인기인이 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4777','','[수탉] 두 마리가 [싸우는] 꿈 ','동물에관한꿈','남과 크게 다툴 일이 있고 그 중 한마리가 피를 흘리면<BR>요절할 운명을 가질 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4778','','[남편]이 큰 [메기] 한 마리를 낚아올리는 꿈 ','동물에관한꿈','아들이 흔한 집에서 둘째아들을 임신할때 많이 꾸는 <BR>꿈으로, 인정이 많고 친구를 좋아하는 인물로, 이공계<BR>열을 전공하는 것이 바람직한 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4779','','큰 [잉어] 세 마리 중 두 마리만 싱싱하게 살아 있는 꿈 ','동물에관한꿈','쌍둥이 딸이 태어나는 태몽으로 , 딸들이 공부도 잘하<BR>고 남편도 훌륭한 가문의 능력있는 사람을 만나게 되<BR>는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4780','','[솔][가지] 안에 [조개]가 다닥다닥 붙어 있는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','딸이 흔한 집안에서 또 딸을 낳게 되는 태몽으로, 영특<BR>하고 특히 손재주가 뛰어나 유명해질 아이를 낳을 것<BR>이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4781','','[거북이]를 타는 꿈 ','동물에관한꿈','아이가 장차 정당 당수나 통치자, 기관장이 되는 꿈이<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4782','','[거북이]를 만지는 꿈 ','동물에관한꿈','아이가 장차 정당 당수나 통치자, 기관장이 되는 꿈이<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4783','','[새]떼가 날아와 그 중 제일 큰 것을 잡는 꿈 ','동물에관한꿈','학교에서나 사회에서 지도자가 될 아이를 낳게 되는 <BR>꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4784','','[잉어]가&nbsp;자기 앞으로 오다가 사라지는 꿈 ','음식물에관한꿈','태아가 유산되거나 문제가 생길 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4785','','[온실]같은 [방]안에 푸른 [오이]가 빛이 나고 윤이 나<BR>는 꿈 ','음식물에관한꿈','공부를 많이 시키면 만인에게 사랑받는 귀인이 되는 <BR>꿈이다. 단 성격이 내성적으로 표현력이 부족하기 쉬<BR>울 아이를 암시하는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4786','','[발]귀퉁이에 덜 익은 푸른 [복숭아]를 따는 꿈 ','음식물에관한꿈','아들보다는 딸이 잘 되는 집안으로, 예쁜 딸을 낳을 징<BR>조이다. 멋을 아는 아이로 방송이나 언론계로 나가면 <BR>성공할 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4787','','정신없는 사람들 틈바구니 속을 걸어다니며 알[밤]을 <BR>줍는 꿈','음식물에관한꿈','뒤늦게 실속있는 활동을 펼치는 딸의 태몽으로 , 현모<BR>양처로 가정살림도 알뜰하게 꾸리고 사회생활도 병행<BR>할 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4788','','수북이 쌓인 [수박] [무더기]를 보고 수박을 고르는 꿈','음식물에관한꿈','끈기와 오기가 있고 외국어를 전공하여, 출판이나 작<BR>가 쪽으로도 재능이 있는 아이를 암시하는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4789','','[임신] 중에 여자가 [구렁이]를 낳는 꿈 ','동물에관한꿈','꿈 속의 여자는 사업체이고, 태아는 생산물이나 대길<BR>할 운세이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4790','','[게]를 잡는 꿈 ','음식물에관한꿈','장차 사업체를 가지는 사람, 불구자가 될 사람을 낳을 <BR>것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4791','','[길]에서 푸른 [고추]를 손에 받는 꿈 ','전원오곡에관한꿈','공부도 잘하고 집안도 좋으며, 기계나 건축, 전기, 화학<BR>등 이공계열에 진출하면 성공하고 발전할 아이를 낳을<BR>것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4792','','[아내]가 [잠옷]으로 갈아입는 것을 보는 꿈 ','옷과악세사리에관한꿈','실제로 임신한 아내라면, 아이를 낳을 징조이고, 임신<BR>을 하지 않은 상태라면 곧 잉태가 될 것을 알리는 징조<BR>이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4793','','붉은 [석류]가 터지고 [하늘]에서 [금비]가 내리며 빛이<BR>나는 꿈','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','욕심 많고 출세욕이 강한 딸이 태어난다. 재물운이 많<BR>아 배우자가 재벌 출신이거나 돈이 많은 사람을 만나<BR>게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4794','','[논]에서 [우렁이]를 캐서 크고 작은 것을 치마에 싸는 <BR>꿈 ','전원오곡에관한꿈','인정 많고 효심이 지극한 장녀를 낳게 되는 꿈으로, 아<BR>들 못지 않은 딸이 되고 집안을 크게 일으키게 되는 꿈<BR>이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4795','','전체적으로 [밝게] 빛나고 [기분좋게] 느껴지는&nbsp;꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','연애운이나 건강운, 또는 성공운 등이 순조롭게 상승<BR>하고 있음을 알리는 꿈으로, 색상이 선명할수록 좋은 <BR>암시이며 영적으로도 고차원적인 꿈이다. <BR><BR>이로써 전세에 대한 단서나 근거를 간과할 수도 있는 <BR>꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4796','','꿈 전체가 [어둡]거나 [희미]하게 느껴지는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','이는 좋지 못한 암시이다. 연애운, 건강운, 인기운, 성공<BR>운 등이 하강을 암시하는 꿈이다. 여러가지 면에서 주<BR>의해야 할 시기이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4797','','[은색]이 강조되는 꿈 ','옷과악세사리에관한꿈','은색은 마음의 만족감을 암시하는 꿈이다. 교양이나 <BR>지성에 대한 자신이 넘치고, 운세도 스스로 끌어당길 <BR>수 있는 사람이 꿀 수 있는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4798','','[금색]이 강조되는 꿈 ','옷과악세사리에관한꿈','금색은 미지의 능력을 의미하는 꿈이다. 이 꿈의 경우<BR>는 예시가 내려지는 것이 특징으로, 특별한 능력을 받<BR>게 될 때 꾸는 꿈으로, 인생에서 한 번 있을까 말까할<BR>정도로 좀처럼 꾸기 힘든 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4799','','[흰색]이 강조되는 꿈 ','옷과악세사리에관한꿈','꿈 속에서의 흰색은 기본적으로 소박, 엄격, 순결, 처녀<BR>성, 항의, 결백, 산뜻함을 의미하는 꿈이다. <BR><BR>아름다운 의미를 갖고 있지만 보답받지 못하는 현실이<BR>강조되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4800','','[검은]색이 강조되는 꿈 ','옷과악세사리에관한꿈','꿈 속에서의 검은 색은 암담, 무의미, 불쾌, 음탕, 죽음,<BR>자비, 부도덕, 강함, 권력, 더럽혀진 마음을 상징하는 꿈<BR>이다. <BR><BR>운수가 강하기 때문에 스스로의 힘으로 사랑이나 권력<BR>을 손에 넣을 수 있는 매력도 갖추고 있는 꿈이다. 그<BR>러나 완전히 검은 색이 아니라 거무스름한 색이라면 <BR>고통이나 슬픔 쪽이 강조되므로 주의해야만 하는 꿈이<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4801','','[붉은색]이 강조되는 꿈 ','옷과악세사리에관한꿈','꿈 속에서의 붉은색은 정열을 상징하는 꿈이다. 붉은<BR>옷을 입었다거나 붉은 꽃이 강조되어 보이는 꿈이라<BR>면, 당신이 정열가임을 나타내거나 또는 지금이야말로<BR>정열적인 행동이 필요한 시기임을 암시하는 꿈이다. <BR><BR>기본적으로 붉은 색에 관한 꿈은 정열, 충성심, 연정, <BR>공격심, 정조관, 난폭함 등을 상징하는 꿈이다. <BR><BR>그리고 붉은 글씨는 휴식이나 거세, 또는 단체에서 당<BR>신이 제외될 것을 의미하는 꿈이다. 붉은','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4802','','[녹색]이 강조되는 꿈 ','옷과악세사리에관한꿈','꿈속에서의 녹색은 생명력, 시기 ,질투, 나약, 애착, 초<BR>창기, 유아기, 성장, 풍요로운 정신 생활 등을 암시하는<BR>꿈이다. <BR><BR>특히 애정면에 있어서는 단계를 거쳐 깊어가는 그런 <BR>타입이다. 대체적으로 행운을 예고하는 꿈이라 할 수 <BR>있는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4803','','[파란]색이 강조되는 꿈 ','옷과악세사리에관한꿈','꿈 속에서의 파란색을 지성을 상징하며, 침착한 성격<BR>이나 지성적인 인생관을 가진 사람이 자주 꾸는 꿈이<BR>다. <BR><BR>꿈 속의 연인이 푸른 셔츠를 입고 있었다면, 연인 관계<BR>가 아니라 친구 관계에 가까운 것임을 암시하는 꿈이<BR>다. 이꿈은 기본적으로 초년, 젊음, 방랑, 투명, 상쾌, 신<BR>선미, 박애주의 등을 상징하는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4804','','[보라]색이 강조되는 꿈 ','옷과악세사리에관한꿈','꿈속에서의 보라색은 겸손, 아늑함, 존경, 수줍음, 선<BR>동 , 고귀한 마음, 도도함, 이상 등을 상징하는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4805','','[노란]색이 강조되는 꿈 ','옷과악세사리에관한꿈','응석이나 자기주장, 버릇없음을 암시하는 꿈이다. 자신<BR>이 꿈 속에서 노란색 옷을 입고 있었다면, 남의 눈에 <BR>띄고 싶어하고 당신의 마음을 반영한 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4806','','[분홍]색이 강조되는 꿈 ','옷과악세사리에관한꿈','연예, 명예, 기쁨 , 애착, 부귀, 선동, 화강 등을 상징하며<BR>고향이나 의뢰심을 암시하는 꿈이다. <BR><BR>이꿈은 남에게 의지하고 싶다거나 응석부리고 싶다는<BR>어린 감정이 특징으로 , 자신의 마음을 그대로 보여주<BR>는 심몽의 일종이 경우가 많다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4807','','[주황]색이 강조되는 꿈 ','옷과악세사리에관한꿈','의무감이나 이성 , 논리적 사고 등을 상징하는 꿈이다.<BR>당신이 완수해야만 할 일이 있으니 사명을 잊지 말라<BR>는 꿈의 예시이다. <BR><BR>그런대로 사업운은 있지만 심신이 지쳐 있어서 좀 쉬<BR>고 싶다든가 긴장감을 잃은 시기에 꾸어지는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4808','','[야윈] [모습]이 [강조]되어 나타나는 꿈 ','사람의몸에관한꿈','자신의 교제 범위가 좁아짐을 의미하는 꿈이다. 그만<BR>큼 운도 약해지고 친구도 떠나가게 되는 꿈이다. <BR><BR>그러나 다른 사람의 살이 빠진 꿈일 경우에는 좋은 꿈<BR>이다. 자기 업무면에 충실하여 성공하게 된다는 신호<BR>이기 때문이다. <BR><BR>그러나 늘 살이 쪄서 고민하는 사람이 이 꿈을 꾸었다<BR>면 단지 소망에 지나지 않는다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4809','','[물방울] [무늬]가 강조되는 꿈 ','옷과악세사리에관한꿈','당신은 지금 애정에 굶주려 쓸쓸해 하고 있는 것 같다.<BR>꿈 속에서의 물방울 무늬는 쓸쓸함이나 고독을 상징하<BR>기 때문이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4810','','[줄무늬]가 강조되는 꿈 ','옷과악세사리에관한꿈','생기 발랄을 의미하는 좋은 암시이다. 특히 건강 면에<BR>서 운수가 상승하고 있으므로 무슨 일이든 생동감 있<BR>게 성장을 지속시킬 수 있는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4811','','[살찐] 모습이 강조되어 나타나는 꿈 ','사람의몸에관한꿈','이꿈은 당신의 인간 관계가 넓어진다는 것을 암시하는<BR>꿈이다. 인간 관계가 넓어지면 당연히 여러 가지의 가<BR>능성도 그만큼 확대되어 간다. <BR><BR>인간관계가 넓어지면서 행운을 얻게 된다는 좋은 암시<BR>이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4812','','[그물]같은 모양을 [몸]에 덮어쓰거나 강조되는 꿈 ','옷과악세사리에관한꿈','그물은 흔히 바다에서 물고기를 잡거나 사냥을 할 때 <BR>쓰이는 것이지만, 꿈 속에서 자기 자신이 그물을 덮어<BR>쓰면 오히려 안전한 수확을 상징하여, 현실에서는 뜻<BR>밖의 재물이나 우리 사주와 같은 주식이 생길 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4813','','[체크] [무늬]가 강조되는 꿈 ','옷과악세사리에관한꿈','혼란스런 상황을 암시하는 꿈이다. 일이 곤란한 지경<BR>에 빠져서 수습할 수 없게 끝없이 확대되어 가는 그런 <BR>상태를 말하는 꿈이다. <BR><BR>당신은 지금 머리가 혼란해져 있는 꿈이다. 따라서 이<BR>런 시기는 과감히 휴가를 갖고 심신을 안정시킬 필요<BR>가 있는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4814','','[종소리]가 아름답게 울려퍼지는 꿈 ','연극 영화 미술에관련된꿈','기쁨이 찾아오거나 좋은 암시이다. 연애, 인기, 일, 건강<BR>등 어느 것이나 운수가 상승 중이어서 당신은 앞으로 <BR>더없는 행복감으로 가득하게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4815','','[작고] 가냘픈 [소리]를 듣는 꿈 ','행동에관한꿈','어떤 소식을 듣게 되거나 남과 다투게 디며, 비밀스러<BR>운 일이 발생했다가 없어지게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4816','','[상대방]의 [소리]만 들리는 꿈 ','행동에관한꿈','상대방의 소식을 듣게 되거나 명령에 복종할 일이 생<BR>길 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4817','','먼 곳으로부터 [총][소리]나 [짐승], [사람] 소리가 들려<BR>오는 꿈','행동에관한꿈','먼 곳의 소식을 듣게 되고, 오랜 시간이 지난 후에 어<BR>떤 사건이나 소식의 진상이 밝혀지게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4818','','[공중]에서 큰 [소리]가 나는 것을 듣는 꿈 ','가재도구에관한꿈','국가에 좋지 않은 일이 발생할 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4819','','[자명종] 소리를 듣는 꿈 ','가재도구에관한꿈','작품이나 계몽 사업 등으로 명예를 얻게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4820','','[종]이 저절로 울리는 꿈 ','연극 영화 미술에관련된꿈','먼 곳에서 새로운 소식을 듣게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4821','','[비명]이나 [신음]소리를 듣고 애처롭게 생각하는 꿈 ','행동에관한꿈','상대방으로 인해 기분 상할 일이 생길 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4822','','[폭포], [파도], [바람], [소나기] 등의 소리를 드는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','전도사업, 작품의 선전, 치하,감탄, 격찬, 작품홍보 등과<BR>관계가 있는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4823','','누군가가 자신을 향하여 큰 [소리]를 외치는 꿈 ','행동에관한꿈','어떠한 외침소리를 들었다면, 그것은 당신에게 주는 <BR>어떠한 경고하고 생각할 필요가 있는 꿈이다. <BR><BR>사고, 질병, 싸움, 불운한 일 등이 일어날 징조이므로<BR>건강에 유의해야 한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4824','','큰 [배]가 [뱃고동]을 울리며 [항구]에 들어오는 꿈 ','배 자동차에관한꿈','일의 성사를 위해 좋은 아이디어를 내게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4825','','[북]이나 [종][소리]가 크게 울리는 꿈 ','연극 영화 미술에관련된꿈','관직에서 승진하게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4826','','누군가로부터 제 [이름]이 불리는 꿈 ','행동에관한꿈','자신이 유명해질 징조이다. 어떤 이유인지는 몰라도 <BR>어쨋든 당신은 당신이 바라는 형태로 그것이 실현되는<BR>꿈이다. <BR><BR>그러나 당신이 남의 이름을 부르는 꿈은 좋지 않는다.<BR>당신의 행운이 다른 사람에게로 옮겨갈 것을 암시하는<BR>꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4827','','[말]을 하려는데 [목소리]가 안나오는 꿈 ','사람의몸에관한꿈','현재 자기 주변에 대해 아주 강한 불만이 있음을 암시<BR>하는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4828','','[사이렌] [소리]가 요란하게 들리는 꿈 ','물과불에관한꿈','생명에 위험이 다가오고 있다는 암시이다. 어떤 사건<BR>이나 사고 등에 휘말리게 될 징조이므로 행동을 신중<BR>하게 해야 하는 꿈이다. <BR><BR>사고가 일어날 가능성이 있는 곳에서 당분간 나가지 <BR>않는 것이 좋을 듯하는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4829','','[하늘]과 [땅]이 합쳐지는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','마음먹었던 것이 뜻대로 이루어지고, 소원성취하게 되<BR>는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4830','','[하늘]이 크게 열리는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','재물과 돈이 나가고 스트레스가 쌓이며, 구설이 많고 <BR>일이 뜻대로 풀리지 않게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4831','','[하늘]이 무너지는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','부모가 병으로 고생하게 되거나 부모상을 당하게 된<BR>다. 또 인연을 맺고 있었던 사람과 헤어지거나 주위에<BR>서 좋지 않은 변화가 일어날 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4832','','[하늘]이 두갈래로 갈라지는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','부모가 병으로 고생하게 되거나 부모상을 당하게 된<BR>다. 또 인연을 맺고 있었던 사람과 헤어지거나 주위에<BR>서 좋지 않은 변화가 일어날 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4833','','[밧줄]을 타고 [하늘]을 올라가는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','신분이 높아지고 입신양명하여 출세하게 되는 꿈이다.<BR>입학, 승진, 취득, 사업의 성공 등의 경사가 있을 것이<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4834','','[하늘]로 날아 올라가는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','신선처럼 구름을 타고 즐거운 여행을 가게 되거나, 장<BR>차 부귀를 얻게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4835','','[날개]가 나서 [하늘]을 날아다니는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','일산상에 경사스런 일이 있고, 관직을 얻어 출세하게 <BR>되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4836','','[하늘]이 붉게 타오르고 있는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','저녁놀과 같이 빨갛고 아름답게 빛나고 있는 하늘이라<BR>면 대단히 좋은 꿈이다. 이꿈은 연애중인 상대에게 청<BR>혼을 받는다는 것을 암시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4837','','아침 [해]가 솟아오르는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','아름다운 예술작품을 창작하게 되고, 자손이 번창하며<BR>만사가 대길할 것이다.','N');
