insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4846','','[하늘]에서 찬란한 [광채]가 나고 [구름] 한 점 없이 맑<BR>게&nbsp;보이는 꿈','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','만사가 뜻대로 되고 모든 사람으로부터 존경을 받게 <BR>되는 꿈이다.','N');
