insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4851','','[태양]을 베고 [잠]을 자는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','부귀를 얻고 훌륭한 지도자가 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4852','','맑은 물[항아리] 속에서 [태양]이 떠오르는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','새로운 아이디어 상품을 개발하여 판매 거래처를 확보<BR>하게 되고, 예체능인은 혜성같이 나타나 유명해질 것<BR>이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4853','','[태양]이 [땅]에 떨어져 구르는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','자신의 업적이나 일의 결과가 세상에 알려지고 ,많은 <BR>사람들에게 큰 영향을 미치게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4854','','[금][빛] [태양]이 저를 향하여 이글거리는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','문제아 자식을 낳게 되지만, 나중에는 그 자식으로 인<BR>해 기쁜 소식을 듣게되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4855','','[태양]이 지는 것을 바라보며 안타까워하는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','여자아이를 출산하게 되고, 처음에는 길하지만 나중에<BR>는 불길하게 되는 꿈이다.','N');
