insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4857','','[태양]이 찬란하게 [빛]을 발하는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','이것은 대단히 좋은 암시이다. 매사에 있어서 하늘이 <BR>당신의 편을 들어주고 있음을 알리는 꿈이다. <BR><BR>사소한 어려움들은 그때그때마다 협력자가 나타나 해<BR>소시켜 주게 되는 꿈이다. 따라서 마음과 열정만 갖는<BR>다면, 모든 일은 순조롭게 풀릴 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4858','','[태양]이 [지붕]에 떨어져서 데굴데굴 구르는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','태몽으로, 예술가나 과학자로 세계에 이름을 떨칠 아<BR>이가 태어날 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4859','','[강]에서 [태양]이 떠오르는 것을 계속 지켜보는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','태몽으로, 아들을 출산하게 되지만 직업관계로 아이와<BR>부모가 헤어질 우려가 있을 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4860','','[태양]과 [달]이 뱃속으로 들어와 [임신]하는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','태몽으로, 임산부는 훌륭한 지도자나 예체능의 스타가<BR>될 명인을 낳게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4861','','[머리]위에 [태양]을 이고 있는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','시험합격, 입학, 승진, 자격취득, 사업의 성사 등의 경사<BR>스런 일이 있을 행운의 길몽이다.','N');
