insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4865','','[태양]이 둥글지 않고 찌그러져 있는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','현재 계획하고 있는 구상이나 추진하고 있는 일에 발<BR>전이 없고 잘 풀리지 않음을 암시하는 꿈이다.','N');
