insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4868','','캄캄한 [굴] 속에 [햇살]이 비추는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','어둡던 과거가 새롭게 태어나 광명을 보게 되며, 풀리<BR>지 않던 일들이 순조롭게 풀릴 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4869','','[태양]을 보고 [절]을 하는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','공공기관에 협조를 얻어 이득을 취하게 되는 꿈이다.','N');
