insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4871','','[문]틈 사이로 찬란한 [햇살]이 들어오는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','어려웠던 사업에 희망이 보이고 기쁜 소식이나 우편물<BR>이 올 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4872','','[달]에게 [절]을 하는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','귀인을 만나 도움을 받거나 청원하여 소원을 이루게 <BR>되는 꿈이다.','N');
