insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4922','','[여행]하다가 [머리]에 [벼락]을 맞는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','간질병이 발생할 수 있고, 꿈 속에 폭풍우를 만나게 되<BR>면 노이로제 증상이 생길 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4923','','높은 [산]이 [벼락]을 맞아 [황금]빛으로 변하는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','어려움을 극복하고 새로게 태어나 부귀영화를 누리게 <BR>되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4924','','[길]을 가다가 [등]에 [벼락]을 맞는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','자신의 동업자나 협조자에게 좋은 일이 일어날 것이<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4925','','[벼락]이 [땅]에 떨어져 [불]이 나는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','투자한 자금을 거둬들이고, 생산업에다 투자하여 사업<BR>성과를 올리게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4926','','[벼락]이 떨어져서 [공]처럼 [땅]위에서 굴러다니는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','응시한 시험에 합격하거나 감히 상상도 할 수 없었던 <BR>일을 성사시킴으로써 많은 사람들로부터 칭송을 받게 <BR>되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4927','','[천둥]이 치며 [번개]불이 번쩍하는 순간에 새로운 물<BR>체가 보이는 꿈&nbsp;','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','새로운 생명체가 탄생하고 , 새로운 변화와 희소식이 <BR>찾아올 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4928','','맑은 [하늘]에서 [천둥]소리가 요란하게 들리는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','집안에 경사스러운 일이 있고, 기쁜 소식을 들으며 소<BR>망을 이루게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4929','','[벼락]을 맞은 [나무]가 다시 살아나는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','어려움을 딛고 일어서게 되고 새로운 사업을 일으키게<BR>되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4930','','[나무]가 [벼락]을 맞아 꺾어진 것을 보는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','사업에 큰 타격을 입거나 오랫동안 계획하고 추진해오<BR>던 일이 잘 풀리지 않게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4931','','[오색][구름]을 보는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','모든 사람들이 부러워할 멋진 사업을 벌이게 되는 꿈<BR>이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4932','','맑은 [하늘]이 갑자기 흐려지며 [캄캄]하게 변하는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','나라에 큰 혼란이 일어나 암울하게 되거나 , 가정이 불<BR>화로 인해 시끄러워질 것이다.','N');
