insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4936','','[검은] [구름]이 당신의 [집]을 뒤덮는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','집안에 병마가 찾아든다거나 안 좋은 일이 생기게 되<BR>는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4937','','[새털][구름] 사이로 [햇살]이 쏟아지는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','사업운이 새로 트이고 발전하며, 집안에 경사가 있고, <BR>소원성취하게 될 징조로, 신의 축복을 받아 만사가 형<BR>통하고 , 교통 체증이 뚫리듯 시원한 일이 있을 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4938','','맑은 [하늘]에 뽀얀 [뭉게][구름]이 산뜻하게 떠있는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','기쁜 소식을 가져오는 것으로, 문예작품의 발표회를 <BR>여는 등 대중 앞에서 찬사를 받게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4939','','[구름]이 [노란]색으로 변하는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','명예와 재물을 한꺼번에 얻게되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4940','','[안개][구름]이 낮게 떠있어 [눈]앞이 보이지 않는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','하는 일마다 막히고 눈 뜬 장님으로 어려움을 겪게 되<BR>는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4941','','[구름]이 [별]을 가리고 있는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','자신에게 피해를 입힐 사람이 나타날 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4942','','넓은 [하늘]에 온통 [먹구름] 뿐인 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','무슨 일을 하든 불쾌감과 불안감이 동반하게 되는 꿈<BR>이다.','N');
