insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4948','','제 [집]에서 [무지개]가 피어오르는 꿈 ','집과건물에관한꿈','진행 중인 혼담이 성사되거나 , 멀리 객지에 나갔던 가<BR>족이 무사히 귀가하게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4949','','[나무]나 [꽃] 등의 [식물]에서 찬란한 [무지개] 빛이 피<BR>어오르는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','어려운 일을 쉽게 처리하게 되거나 부귀영화를 누리게<BR>되는 꿈이다.','N');
