insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4951','','[눈]을 맞으며 걷는 사람을 보는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','집안 사람 중에서 누군가가 죽게 되거나 다치는 등 불<BR>길한 일과 고소당할 일이 생길 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4952','','[눈]덮인 [산]을 오르는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','신앙, 수도 , 학문 등을 상징하는 것이며, 일의 난관을 <BR>맞이하지만 결국에는 극복하게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4953','','[함박눈]을 맞으며 한없이 걷는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','자신의 일에 국가의 지원이나 법을 지킬 일과 직면하<BR>게 되는 꿈이다.','N');
