insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4956','','[눈]위에서 [썰매]나 [스키]를 타는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','사업이 급속도로 번창하게 되고 , 취직, 시험 등에서 좋<BR>은 소리를 듣게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4957','','[눈]이 [방]안에 가득 쌓이는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','재물이 생기고, 청탁, 축하금 등이 쇄도하게 되는 꿈이<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4958','','[눈]을 뭉쳐서 [상대방]에게 던지는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','정신적, 물질적인 자본을 들여 경쟁자와 다툴 일이 생<BR>길 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4959','','[산]과 [들]이 [눈]으로 뒤덮여 있는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','사업, 정치, 학설 등을 주도하여 세상에 이름을 떨치게 <BR>되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4960','','적게 내린 [눈]을 보는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','일 같지도 않은 일들이 얽히고, 설켜서 복잡한 마음이 <BR>사라지지 않을 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4961','','[폭설] 때문에 많은 [건물]이 무너지는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','개인적인 일에 국가가 협조해서 크게 번창하게 되는 <BR>꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4962','','[옷]이나 [모자] 등이 [바람]에 날아가는 꿈 ','옷과악세사리에관한꿈','타인이나 외세의 침범으로 정신적, 물질적 손실을 입<BR>거나 부탁할 일이 생길 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4963','','[태풍]으로 인한 [파도]로 [집]이나, [나무], [사람] 등이 <BR>쓰러지는 꿈','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','자신의 능력이나 재산 따위를 과시하다가 봉변을 당하<BR>거나 몰락하게 되는 꿈이다. <BR><BR>환난과 우환, 고통스러운 일과 관계가 있는 꿈으로 근<BR>심하거나 사업적으로 축소해야 할 시기를 알리는 꿈이<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4964','','제 [집]이 [바람]에 날려 [공중]에 떠있는 꿈 ','집과건물에관한꿈','하고 있던 일이 흔들리고 잘 풀리지 않음을 알린다. 사<BR>업 기반이나 직장, 지위 등을 잃게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4965','','센 [바람]이 불어 [불]길이 더욱 치솟는 꿈 ','물과불에관한꿈','사업을 진행하는 데 있어서 사회적인 도움을 얻어 더<BR>욱 번성하게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4966','','[돌]이나 [자갈] 등이 [바람]에 날리는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','종교적인 기적이 일어나는 것을 보는 것처럼, 생각지<BR>도 못했던 획기적인 사건이 있거나 자신이 만들게 되<BR>는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4967','','[회오리][바람]이 요란스럽게 불고 있는 것을 보는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','뜻하지 않은 재난이 당신을 기다리고 있는 꿈이다. 머<BR>잖아 뜻밖의 장소에서 생각지 못한 형태로 싸움에 휩<BR>쓸리게 되는 꿈이다. <BR><BR>이를 피할 만한 뾰족한 수도 없고, 그렇다고 해서 정면<BR>으로 막아내게 되면 치명상을 입게 되는 꿈이다. 정신<BR>적인 타격에 의해 다시는 재기할 수 없게 될 위험성도 <BR>있으므로 마음의 준비를 하고 지나치게 화려한 존재가<BR>되지 않아야 할 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4968','','[폭풍]우가 불어오는 가운데 서있는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','이런 꿈을 꾸는 것은 현재 자신이 결정내려야 할 큰 문<BR>제를 앞에 놓고, 생각이 잘 정리되지 않아 혼란스런 자<BR>신의 마음에서 오는 심몽의 경우가 많다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4969','','[바람]을 타고 [집]이나 자기가 [공중]을 떠다니는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','세상에 과시할 일이 생기거나 병세의 호전 등을 나타<BR>내며, 운세가 트일 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4970','','[불]이 활활 타오르는 꿈 ','물과불에관한꿈','부귀공명하고 입신출세하며, 사업이 크게 번창하여 많<BR>은 재물을 얻게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4971','','[부싯돌]이나 [촛불]로 [불]을 놓는 꿈 ','물과불에관한꿈','재수가 있고 만약 장사를 하면 돈을 많이 벌게 되는 꿈<BR>이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4972','','[물건]이 타는데도 [불]길은 없고 [연기]만 나는 꿈 ','물과불에관한꿈','주위에 공연한 헛소문이 떠돌게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4973','','[화롯가] 주위에 여러명이 빙 둘러 앉아 있는 꿈 ','물과불에관한꿈','여러 사람이 화합하게 되거나 사소한 시빗거리로 말다<BR>툼을 하게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4974','','[집]이나 귀중한 [물건]이 [불]에 다 타서 [재]만 남는<BR>꿈 ','물과불에관한꿈','사업이 잘 추진되어 가다가 돌발적인 사고로 인해 재<BR>물을 잃어버리게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4975','','[그릇]에 담긴 [물]이나 [오줌], [강물] 등에 [불]이 붙는<BR>꿈 ','물과불에관한꿈','어느 기업이나 회사 등에서 정신적으로나 물질적으로 <BR>사업이 크게 이루어질 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4976','','여러 군데 [불]을 옮겨 붙는 꿈 ','물과불에관한꿈','일이나 작품이 여러 회사나 신문, 잡지 등에 선전 광고<BR>되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4977','','제 [몸]에 [불]이 붙는 꿈 ','물과불에관한꿈','추진 중이고 있는 일이 순조롭게 잘 이루어지고, 신분<BR>의 갱신이 일어날 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4978','','자색 [광선]이 [창문]을 통해 [방]안이나 제 [몸]에 비추<BR>는 꿈','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','사업이나 일 등이 진리임을 사람들로부터 인정을 받게<BR>되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4979','','맹렬한 [불꽃]이 [온몸]을 태우는 꿈 ','물과불에관한꿈','일신이 부귀로워질 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4980','','[전기]가 [합선]되어 [폭음]과 함께 큰 [불]이 나는 꿈 ','물과불에관한꿈','진행중인 일이 크게 성취되어 세상 사람들의 관심사가<BR>되는 꿈이다.','N');
