insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4982','','[아궁이]에 [불]을 때고 있는 꿈 ','물과불에관한꿈','사업을 계획성 있게 추진시켜 나가고, 영세업이 대기<BR>업으로 바뀌게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4983','','[화롯불]이 꺼져가는 것을 보는 꿈 ','물과불에관한꿈','자신의 소망이 좌절되어 가고 있음을 암시하는 꿈이<BR>다.','N');
