insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4987','','밖에서 본 [창문]이 [불빛]에 의해 환하게 밝혀져 있는<BR>꿈 ','물과불에관한꿈','어떤 기관에서 자신의 성실함을 인정해 주게 되는 꿈<BR>이다.','N');
