insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4994','','[집]이 활활 타오르던 [불]길을 끄는 꿈 ','물과불에관한꿈','번창하던 사업이 중도에 어떤 방해를 받아서 중지하게<BR>되는 꿈이다.','N');
