insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('4999','','[물]을 끼얹으며 [불]을 끄는 꿈 ','물과불에관한꿈','물을 끼얹은 횟수만큼 재물의 소비를 하게 되는 꿈이<BR>다.','N');
