insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5002','','큰 [도시]가 [불]타오르는 것을 보는 꿈 ','물과불에관한꿈','헌법 개정, 학설, 교리 등이 전국 또는 지방에 전파되어<BR>감화를 주게 되는 꿈이다.','N');
