insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5005','','[가로등] 밑에서 [일]을 하는 꿈 ','행동에관한꿈','어떤 협조자에 의해서 근심걱정이 해소되는 꿈이다.','N');
