insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5007','','[금은보화]의 [물체]가 [빛]을 발하거나 그 빛이 하늘에<BR>닿는 꿈 ','돈과재물에관한꿈','작품이나 업적 등을 크게 이룸으로써 세상 사람들의 <BR>인정을 받게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5008','','제 [몸]에서 [빛]이 나는 꿈 ','사람의몸에관한꿈','태몽으로, 군인이나 경찰관, 공무원, 사원등의 높은 관<BR>직에 오를 아이를 출산하게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5009','','[침실]에 [빛]이 스며드는 꿈 ','집과건물에관한꿈','귀여운 아들을 출산하게 되고, 집안에 경사가 생길 것<BR>이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5010','','맑은 [하늘]에서 [별][빛]이나 [달]빛이 환하게 비추는 <BR>꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','자신을 존경하거나 사랑하는 사람이 나타나거나 만일 <BR>결혼한 부인이 이러한 꿈을 꾸었다면 남편이나 친척과<BR>불화가 있을 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5011','','[광선]이 강하게 [방]안으로 들어오는 꿈 ','집과건물에관한꿈','어떤 강한 외부 세력이나 종교적인 힘이 자기에게 어<BR>떠한 영향을 미칠 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5012','','[전기][줄]을 [방]안에 새로 가설하는 꿈 ','집과건물에관한꿈','새로운 직장에 취직되거나 새로운 사업을 추진하게 되<BR>는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5013','','투명한 [물건]이 [빛]을 받아 [광선]이 [반사]되는 꿈 ','가재도구에관한꿈','어떤 사람의 업적이나 일거리가 자기에게 도움을 주게<BR>되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5014','','[불][빛]이 환하게 밝혀진 곳으로 가는 꿈 ','물과불에관한꿈','하는 일마다 순조롭게 풀릴 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5015','','[스위치]를 켜도 [전기]가 들어오지 않는 꿈 ','집과건물에관한꿈','건강에 문제가 생길 것이며, 만일 임산부가 이와 같은<BR>꿈을 꾸었다면 건강에 유의하십시오.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5016','','[전기][불]이 깜빡거리는 꿈 ','물과불에관한꿈','하는 일이 발점됨이 없이 계속 지지부진하게 되는 꿈<BR>이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5017','','[물] 위로 걸어 다니는 꿈 ','물과불에관한꿈','흉함이 있고 재수가 없으며, 물 속에 불길이 솟아나는 <BR>꿈은 의외의 행운이 있을 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5018','','[물]이 이곳저곳에서 솟아나와 고이는 꿈 ','물과불에관한꿈','다방면에서 재물을 모아 부자가 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5019','','[물] 위를 달리는 꿈 ','물과불에관한꿈','운수가 대통하는 꿈이다. 그러나 물 위에 앉아 있거나 <BR>서 있으면 불길하고 자신이 의지하는 사람이 죽을 수<BR>도 있는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5020','','[수도]가 [파열]되거나, 온 방안이 [물]에 넘치는 꿈 ','물과불에관한꿈','현재 당신의 억제할 수 없는 감정을 꿈 속에서 해방하<BR>여 방출하고 있는 일종의 심몽이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5021','','[밑] 빠진 [독]에 자꾸 [물]을 붓는 꿈 ','물과불에관한꿈','아무리 벌어도 재물이 모이지 않고 여기저기 돈 쓸데<BR>가 많아지며 소비되어 버릴 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5022','','[물]이 흘러넘치는 꿈 ','물과불에관한꿈','미혼자는 혼인하게 되고, 관리는 진급이나 영전수가 <BR>있고 사업가는 번영하게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5023','','집안의 [물통]이나 [물탱크]에 [물]이 가득 고이는 꿈 ','','집안에 큰 재물이 들어와 부귀하고 번성할 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5024','','[물]이 시원하게 흘러가는 꿈 ','물과불에관한꿈','운수가 대통하고 혼담이 성공하게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5025','','[돌]이 [물] 속으로 자취를 감추는 꿈 ','물과불에관한꿈','어떤 일을 끝마치거나 갑자기 사람이 사라질 것을 암<BR>시하는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5026','','쉬지 않고 [물]을 마시는 꿈 ','물과불에관한꿈','재수가 좋아지고 하는 일이 번창하게 되는데, 마시고<BR>있는 물이 탁하면 특히 건강에 주의하라. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5027','','[소파]에 앉으려는데 [물]이 묻어 젖어있는 꿈 ','물과불에관한꿈','누군가에 대해서 경계심과 시기심, 질투심을 갖고 있<BR>다는 마음을 꿈에서 보여주는 것으로 심몽의 일종이<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5028','','[댐]이 무너지는 꿈 ','물과불에관한꿈','정신적으로 혼란한 상태를 가리키는 것으로, 스트레스<BR>를 풀고 휴식을 가져야 할 시기이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5029','','[물]에 빠진 다른 사람을 자기가 [발견]하는 꿈 ','물과불에관한꿈','하는 일이 마음먹은 대로 풀리지 않아 우울해지거나,<BR>슬픈 일이나 마음이 동요하는 일이 일어날 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5030','','[물]에 빠진 자신을 누군가가 구해주는 꿈 ','물과불에관한꿈','남에게 의지하거나 응석을 부리고 싶다는 생각을 가지<BR>고 있을 때 꾸는 심몽의 일종이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5031','','[물]이 [방]안에 [가득] 고이는 꿈 ','물과불에관한꿈','좋은 아이디어를 개발하여 사업이 크게 번창할 것이<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5032','','[물]을 시원하게 마시지 못하는 꿈 ','물과불에관한꿈','어떤 일이 성사되기는 하지만 만족스럽지 않게 되는 <BR>꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5033','','[몸]이 [물] 속에 잠겨있는 꿈 ','물과불에관한꿈','운수가 대길하고 오랜 소망이 이루어지는 등 아주 좋<BR>은 길몽이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5034','','[산]을 짊어지는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','큰 권세를 잡을 수 있는 길몽으로 , 기구나 단체 등을 <BR>이끌어갈 실력자가 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5035','','[산]을 들어 올리는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','큰 권세를 잡을 수 있는 길몽으로 , 기구나 단체 등을 <BR>이끌어갈 실력자가 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5036','','[눈]이 쌓인 [산]을 [정상]까지 올라가는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','피나는 노력으로 자격을 취득, 성공, 취직등을 하게 되<BR>는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5037','','[돌][산]이 보이는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','새로운 사업계획을 세워 희망적인 미래에 도전하게 되<BR>는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5038','','[산]이 [호랑이]나 [용], [사람] 등으로 변하는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','권력가, 정치가 , 사업가로서 큰 세력을 잡게 되는 꿈이<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5039','','깊은 [산]의 [계곡]에서 맑은 [물]이 흐르는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','집중하거나 연구에 몰두하여 좋은 결과와 성취가 있을<BR>것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5040','','[지팡이]를 짚고 [산]에 오르는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','협조자의 도움을 받거나 자신에게 유리하게 일이 진행<BR>되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5041','','먼 [산]에 올라가야겠다고 생각하는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','먼 산은 외국을 상징하므로 외국에 가고 싶은 소망을 <BR>암시하는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5042','','[화산]의 [분화구]에서 시뻘건 [불]이 뿜어져 나오는 것<BR>을 보는 꿈','꽃과 나무,돌 등 자연물에 관련한꿈','돈과 재물이 생길 것을 암시하는 길몽으로, 많은 사람<BR>들에게 인정받는 큰일을 해낼 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5043','','[정상]에 올라가서 [아래]를 내려다보이는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','산의 모습은 당신이 가지고 있는 이상의 높이를 암시<BR>하는 꿈이다. 따라서 이꿈은 당신이 이상을 실현한다<BR>는 암시로 아주 좋은 길몽이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5044','','[짐]을 지고 [산]에 올라가는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','힘겨운 업무를 맡아 고생하게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5045','','[산]을 오르다가 되돌아 내려오는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','어떤 일을 하다가 중도하차하게 되거나 각종 시험에 <BR>떨어져서 재수하게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5046','','[적]의 [산정]을 [점령]하는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','우승을 하거나 당선이 되는 등 많은 사람들 가운데 뽑<BR>히게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5047','','[산] [고갯길]을 넘는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','사업상의 난관을 극복하거나, 전환점에 이르러서 직장<BR>을 옮기게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5048','','커다란 [산]이 와르르 무너지는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','상대방의 사업이 쇠퇴하여 소득이 생기거나, 조직의 <BR>개편이 이루어질 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5049','','[산]을 보고 [침]을 뱉는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','부모나 상사에게 불경한 짓을 하거나, 말을 잘못하여 <BR>구설수에 오르게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5050','','날아서 [산] [정상]에 오르는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','가장 빠르고 정확한 방법으로 목적을 달성하게 되는<BR>꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5051','','높은 [산]에 오르다가 떨어지는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','신분, 지위,소원, 일 등이 물거품이 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5052','','[산]이 무너지는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','손윗사람이 상을 당할 염려가 있는 꿈이다. 산사태는 <BR>국가나 사회적 환란, 사업 기반의 붕괴를 의미하는 꿈<BR>이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5053','','조그마한 [산]이 점점 높아지는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','영세업이 점점 큰 기업으로 발전하게 되고, 재수생은 <BR>명문학교에 입학하게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5054','','[산] [정상]에서 큰 [소리]로 외치는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','세인의 관심을 한몸에 받거나, 자기 신변에 관한 일을<BR>타인에 의해서 듣게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5055','','[백설]이 쌓인 [산]을 [정복]하는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','입학이나 시험합격, 취직, 승진, 성공, 당선 등 소원성취<BR>하게 될 것을 암시하는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5056','','넘어야 할 [산]이 아득하게 멀게 느껴지는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','일이 성취되려면 아직도 멀었다는 것을 암시하는 꿈이<BR>다.','N');
