insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5060','','[산][봉우리]를 따가지고 [집]으로 돌아오는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','부인은 임신하여 훌륭한 옥동자를 낳게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5061','','[암벽]을 기어오르기가 무척 [고통]스러워 하는 꿈 ','행동에관한꿈','어떤 일을 성사시키는데 많은 어려움이 뒤따를 것이<BR>다. ','N');
