insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5069','','시퍼런 [파도]에 놀라 쓰러지는 꿈 ','연못이나바다에관한꿈','준비할 겨를도 없이 불행이 몰아닥치게 되는 꿈이다.<BR>천재나 인재 등이 생길 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5070','','[바닷물]이 [육지]에 들어왔다가 빠진 흔적을 보는 꿈 ','연못이나바다에관한꿈','어떤 일을 추진해 나가다가 중간에 포기하게 되는 꿈<BR>이다.','N');
