insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5075','','[별]이 [바다]로 떨어져 바다 전체가 푸른 [불]꽃이 되<BR>는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','대중성이 있는 일을 개발하고 이를 생산하여 시중에 <BR>내놓게 될 징조로, 행운을 암시하는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5076','','[바닷물]이 멀리 밀려나면서 광활한 [해저]가 드러나는<BR>꿈&nbsp;','연못이나바다에관한꿈','어떤 강력한 세력이나 꺾을 수 없었던 기존 사상으로<BR>부터 점차 벗어나게 되는 꿈이다.','N');
