insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5078','','[파도]가 거세게 몰아치는 꿈 ','연못이나바다에관한꿈','태몽으로, 머리가 명석하고 용감한 아들을 출산하게 <BR>되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5079','','[바닷물]이 [황금][덩어리]로 변하는 꿈 ','돈과재물에관한꿈','원양업에다 투자하여 돈벼락을 맞을 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5080','','[바다]에 있는 깊은 [산] 속으로 들어가는 꿈 ','연못이나바다에관한꿈','죽음을 암시하거나 외국으로 나갈 일이 생길 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5081','','[바닷물] 위에 떠있는 [돼지]를 건져내는 꿈 ','동물에관한꿈','횡재수가 있어 많은 재물이 생길 꿈이다. 원양업에 관<BR>련된 일로 많은 돈을 벌게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5082','','[강]물 위에서 [해]와 [달]이 만나는 것을 보는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','집안에 혼인과 같은 경사가 생기거나 뜻밖의 행운을 <BR>맞이하게 될 것이며, 선남선녀가 분위기 있는 공간에<BR>서 아름다운 사랑의 꽃을 피우게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5083','','맑은 [강]물 위로 유유히 걸어다니는 꿈 ','연못이나바다에관한꿈','지도자가 되어 올바른 길을 걸어가게 될 것으로, 큰 대<BR>업을 성취하고 입신출세할 길몽이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5084','','[강]물이 갈라가면서 [보물]이 나타나는 꿈 ','돈과재물에관한꿈','한 시대적 이념을 창출하고 훌륭한 지도자가 될 징조<BR>로, 재물이나 학문, 창작, 발굴 등의 경사가 있을 것을 <BR>암시하는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5085','','[강]물에서 [몸]을 씻었는데 오히려 몸이 더러워지는 <BR>꿈 ','물과불에관한꿈','성실하게 일을 해도 성과를 얻지 못하고, 구속당한 곳<BR>에서 헤어나지 못하게 되는 꿈이다.','N');
