insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5088','','[강]이나 [호수]에서 [헤엄]쳐 다니는 꿈 ','물과불에관한꿈','어려운 난관에서 벗어나게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5089','','[강]물 속에서 [황금][덩어리]를 건져내는 꿈 ','돈과재물에관한꿈','돈과 재물이 생기고, 마음먹은 대로 일이 풀리게 될 것<BR>으로, 뜻밖의 횡재를 하게 되는 꿈이다.','N');
