insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5091','','[강]물이 거꾸로 흐르는 꿈 ','연못이나바다에관한꿈','자기의 주장에 대해 공격을 받게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5092','','흐르는 [강]가에서 탐스러운 [꽃] 한송이를 꺽는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','지혜로운 이야기를 듣거나 자신이 해오던 일에 관련되<BR>어 조언을 얻을 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5093','','[강]이나 [개천]의 [물길]이 두 갈래로 갈라지는 꿈 ','물과불에관한꿈','신앙이나 사업의 방향을 잃게 되거나, 두 방향으로 나<BR>뉘게 될 것을 암시하는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5094','','[사랑]하는 [사람]과 함께 [호숫가]를 거니는 꿈 ','물과불에관한꿈','친구와 애인을 만나 분위기 있는 장소에서 아름다운 <BR>이야기꽃을 피우게 되는 꿈이다.','N');
