insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5097','','[호숫가]에 들어가 [몸]을 깨끗이 씻는 꿈 ','물과불에관한꿈','과거의 자기 잘못을 깨닫고 참회하여 참사람으로 다시<BR>태어나게 될 징조로, 하는 일마다 순순히 잘 풀리는 좋<BR>은 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5098','','[동물]이 [호수]로 들어가는 꿈 ','동물에관한꿈','어떤 기관에 입사하거나 작품 발표를 하게 되는 꿈이<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5099','','[호수]에서 [머리]를 감는 꿈 ','물과불에관한꿈','학생은 머리가 총명해져 학업 성적이 오르게 되는 꿈<BR>이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5100','','[냇물]에서 [손][발]을 씻는 꿈 ','물과불에관한꿈','어떤 단체에서 자기가 소원한 일이 성취되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5101','','맑은 [물]이 [개간지] [중앙]을 흐르는 것을 보는 꿈 ','물과불에관한꿈','어떤 계몽 사업이나 교회 사업이 마음먹은 대로 잘 추<BR>진되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5102','','맑은 [호수] 위를 걸어다니는 꿈 ','물과불에관한꿈','미혼자는 혼담이 잘 진행되어 혼인을 하게 되고, 관리<BR>는 진급이나 영전수가 있으며 사업가는 번영할 것이<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5103','','[호수]에 빠지는 꿈 ','물과불에관한꿈','어릴 때와 같이 안전하게 있고 싶다는 소망을 암시하<BR>는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5104','','마른 [개천]에 [물고기]가 바글거리는 꿈 ','물과불에관한꿈','자기에게 유리한 조건으로 돈을 취득하거나 운영난에 <BR>빠질 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5105','','[숲] 속에서 [꽃]을 꺾어드는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','어떤 기관으로부터 상을 받는 등의 명예로운 일이 생<BR>길 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5106','','[숲] 속의 [계곡]물에서 [물고기]를 잡는 꿈 ','물과불에관한꿈','계획하고 있는 일이 잘 되며 좋은 성과를 얻게 되는 꿈<BR>이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5107','','[숲] 속에 [길]이 환히 트여 보이는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','지금까지 어렵고 힘들던 일들이 말끔히 가시고 희망찬<BR>광명이 환히 보일 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5108','','[숲] 속에서 [호랑이] 새끼를 얻는 꿈 ','동물에관한꿈','태몽으로, 부인은 임신을 하여 귀한 옥동자를 낳을 것<BR>이며, 수입이나 명예, 낚시, 먹거리, 선물 등을 암시하는<BR>꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5109','','[숲] 속에서 아름다운 [음악][소리], [새]소리, [매미]소<BR>리가 들리는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','문화의 공간에서 야회 음악회가 열리게 될 것이며, 음<BR>악감상, 잔치, 모임, 의식,파티 등을 암시하는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5110','','[망령]이 자신을 [숲]속으로 [인도]하는 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','다방면으로 박식한 사람을 소개받을 일이 생기거나 정<BR>신적으로 이익이 될 만한 일을 보게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5111','','[대나무] [숲]을 조심스럽게 걷는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','자신에 대한 나쁜 소문이 나돌게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5112','','[숲] 속을 거닐다가 [도사]나 [선녀]를 만나는 꿈 ','신에관련된꿈','출장길이나 외지에서 뜻밖의 귀인을 만나 도움을 받게<BR>되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5113','','[모래] 한 줌을 쥐자 [손] 밑으로 모래가 주르르 빠져나<BR>가는 꿈','전원오곡에관한꿈','그동안 힘들게 모아 두었던 재산이 일시에 빠져나가게<BR>될 것으로, 여러 곳으로 지출할 일이 많아진다. <BR><BR>또한 한 나라의 민족성이 통일성과 응집력이 부족한 <BR>때를 암시하는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5114','','[모래사장]에 제 [발자국]을 남기는 꿈 ','행동에관한꿈','어떤 기관에 자신의 경력이나 행적을 남기게 되는 꿈<BR>이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5115','','[사막]에서 [오아시스]를 만나는 꿈 ','물과불에관한꿈','어려운 난관에 처해있는 일들이 서서히 풀리게 되는 <BR>꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5116','','[사막] 중간에서 [길]을 찾아 헤매이는 꿈 ','지리에관한꿈','실력 발휘를 하지 못하고 운세가 절망 상태에 놓이게 <BR>되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5117','','꿈에 [모래시계]를 보는 꿈 ','옷과악세사리에관한꿈','사람과 약속을 하거나 일을 계획성 있게 처리하게 될 <BR>것이며, 자신의 행위에 대하여 깊이 성찰하게 되는 꿈<BR>이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5118','','[모래][성]을 쌓는 꿈 ','전원오곡에관한꿈','학문 연구에 깊이 몰두하거나 자기 발전을 위해서 많<BR>은 지식과 자료를 얻게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5119','','[모래][밭]에서 [금][반지]를 줍는 꿈 ','옷과악세사리에관한꿈','돈과 재물이 생기고 횡재수가 있을 것을 암시하는 꿈<BR>이다. 자연 공간에서 사랑의 연을 맺게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5120','','[모래][산]이 [황금][빛]으로 찬란한 꿈 ','돈과재물에관한꿈','시험합격, 취직, 승진, 당선, 성공, 재물 등을 상징하는 <BR>길모으로, 운수가 대통하여 일이 잘 풀리고 매사기 순<BR>조로울 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5121','','[모래][밭]에서 [금][덩어리]를 줍는 꿈 ','돈과재물에관한꿈','제조업, 생산업 등에 투자하여 사업의 성과를 올리게 <BR>될 것이며, 돈이나 재물 , 횡재 등을 암시하는 부자가 <BR>되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5122','','[모래][밭]에 [씨앗]을 뿌리는 꿈 ','전원오곡에관한꿈','자기 분수에 맞지 않는 사업을 시작함으로써 향상 마<BR>음이 불안하게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5123','','깊은 [물] 속에서 [돌덩이]를 건져내는 꿈 ','물과불에관한꿈','사업에 투자하여 많은 돈을 벌게 되는 꿈이다. 횡재 , <BR>선물, 물품과 먹거리 등이 생길 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5124','','큰 [바위]를 부수어 [자갈]로 만드는 꿈 ','전원오곡에관한꿈','여러 사람이 함께 일을 시작하게 될 것으로, 어떤 일을<BR>분담받거나 자신의 일을 나누어 주어야 할 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5125','','[하늘]에서 떨어지는 [돌]을 [손]으로 받는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','생각지도 못했던 윗사람의 도움을 얻어서, 일을 유리<BR>하게 진행시키거나 사업에 성공하게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5126','','높은 [돌][산]을 우러러보는 꿈 ','전원오곡에관한꿈','앞으로 큰 계획을 세워 뜻대로 성취하게 되고, 귀인을 <BR>만나 도움을 받게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5127','','[돌][덩이]가 변해 큰 [바위]로 변하는 꿈 ','전원오곡에관한꿈','작은 사업이 점차 확대되어 큰 사업으로 번창하게 되<BR>는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5128','','[벽돌]을 많이 [생산]하는 꿈 ','행동에관한꿈','어떤 학문적이 자료를 얻거나 훌륭한 인재를 모으게 <BR>되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5129','','[벽돌]을 [집]으로 들여오는 꿈 ','집과건물에관한꿈','어떤 학문적이 자료를 얻거나 훌륭한 인재를 모으게 <BR>되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5130','','[강]가나 [개울]가에서 빛나는 [수석]을 줍는 꿈 ','연못이나바다에관한꿈','태몽으로 앞으로 태어날 아이가 높은 관직에 올라 크<BR>게 성공하게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5131','','[주먹]으로 [바위]를 쳐서 [산산조각]을 내는 꿈 ','전원오곡에관한꿈','어떤 단체나 모임에서 자기의 주장을 피력하여 서로 <BR>화합을 이루게 할 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5132','','[개울가]에서 예쁜 [차돌]을 주워서 [집]으로 가져오는 <BR>꿈 ','연못이나바다에관한꿈','태몽으로, 똘똘한 아들을 낳을 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5133','','[조약][돌]을 [손]에 쥐고 만지작거리는 꿈 ','전원오곡에관한꿈','임신한 부인은 쌍둥이 옥동자를 낳아 출세시킬 것이<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5134','','[방]안에 푸른 [차돌]이 가득하는 꿈 ','집과건물에관한꿈','호박이 넝쿨째로 굴러들어오게 될 것으로 영세업을 하<BR>다가 많은 돈을 벌고 부귀해질 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5135','','맑은 [냇가]에 [차돌]이 쫙 깔려 있는 꿈 ','연못이나바다에관한꿈','새로운 아이디어가 떠서 그로 인해 재물과 돈이 들어<BR>올 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5136','','[산] 고갯마루에 [돌]을 쌓아 놓는 꿈 ','전원오곡에관한꿈','신앙 생활을 하게 되거나 푼돈 모아 목돈을 만들 것이<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5137','','여러 곳에 흩어진 [돌]을 주워서 [그릇]에 담는 꿈 ','전원오곡에관한꿈','여러 곳에 깔아 놓은 빚이나 농산물, 곗돈 등을 거두게<BR>되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5138','','[반석] 위에 앉는 꿈 ','전원오곡에관한꿈','어떤 단테를 이끌어 나갈 지도자가 되거나, 하는 일마<BR>다 순리대로 잘 풀려나갈 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5139','','[거리]에 [자갈]을 깔아 놓는 꿈 ','전원오곡에관한꿈','어떤 교리를 설파하거나 여러 사람에게 일에 대하는 <BR>방법과 도리를 알려주게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5140','','[돌]의 종류와 관계없이 돌을 [집]으로 가지고 들어오<BR>는 꿈 ','전원오곡에관한꿈','재수가 좋은 길몽으로, 돌의 크기와 비례하여 재물이 <BR>생기고 좋은 일이 생길 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5141','','[돌]이 저절로 부숴지는 꿈 ','전원오곡에관한꿈','돌이 부숴지고 산이 무너지는 꿈은 집안에 좋지 않은 <BR>액운이 있어 사고가 나거나 질병이 드는 등 흉사가 있<BR>을 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5142','','[땅]에서 [돌]을 주워보니 [황금]으로 변해 빛나는 꿈 ','돈과재물에관한꿈','복권에 당첨될 확률이 많고, 눈먼 돈이 들어올 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5143','','[돌]로 [울타리]를 쌓는 꿈 ','집과건물에관한꿈','다른 사람의 협조를 얻어 신분이나 사업이 새로워질 <BR>것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5144','','[흙]을 파내어 그 속에서 [물건]을 얻는 꿈 ','행동에관한꿈','단체에서 그 물건이 상징하는 어떤 이득이 생길 것이<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5145','','[길]에 파놓은 [함정]을 穿爭磯 꿈 ','지리에관한꿈','어렵고 힘든 여건을 굴하지 않고 잘 극복해 나갈 것이<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5146','','누런 [흙탕물]이 흐르는 것을 보는 꿈 ','전원오곡에관한꿈','진리를 깨닫거나 특수 사업체와 관련된 일을 하게 되<BR>는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5147','','[황토]를 [그릇]에 담아 [집]안으로 가져오는 꿈 ','전원오곡에관한꿈','돈과 재물이 들어오고 음식거리를 장만하게 되는 꿈이<BR>다. 집안에 뜻밖의 복이 들어올 것을 암시하는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5148','','[흙]을 빚어 여러 가지 형태를 만드는 꿈 ','전원오곡에관한꿈','어려운 고비를 극복하고, 재물이나 사업 성과를 얻게 <BR>되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5149','','[논][밭]에 있는 [흙]이 검게 보이는 꿈 ','전원오곡에관한꿈','사업상 자기에게 유리한 조건을 확보하게 되는 꿈이<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5150','','[몸]이나 [옷]에 [흙]이 묻는 꿈 ','사람의몸에관한꿈','질병에 걸리거나 다른 사람으로 인하여 오해를 받고<BR>누명을 쓰게 될 일이 생길 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5151','','맑은 [물] 속에 하얀 [흙]이 매끄럽게 깔려 있는 꿈 ','물과불에관한꿈','정신적으로 편안해지고 풍요로워지며, 매사가 생각대<BR>로 순조롭게 잘 풀려나갈 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5152','','갑자기 붉은 [흙][산]이 생긴 것을 보는 꿈 ','전원오곡에관한꿈','사회적으로나 국가 방위상 불안한 일이 생기며, 자신<BR>과 직접적인 관계가 아니어도 불길한 운세를 보게 되<BR>는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5153','','주위에서 [흙][먼지]가 뿌옇게 일어나는 꿈 ','전원오곡에관한꿈','사회적으로 불안하고 유행병이 번질 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5154','','[흙]을 파서 [금][은][보화]나 고고학적 [유물]을 얻어<BR>가지는 꿈&nbsp;','돈과재물에관한꿈','뜻밖의 행운을 얻는 것으로, 몸담고 있는 곳에서 자신<BR>의 권리를 얻거나 횡재가 생길 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5155','','[진][흙]이나 [수렁]에 빠지는 꿈 ','행동에관한꿈','하는 일마다 제대로 풀리지 않아 곤경에 빠지게 되는 <BR>꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5156','','남이 파놓은 [함정]에 빠지는 꿈 ','행동에관한꿈','하는 일마다 제대로 풀리는 일이 없고, 몸에 병이 생길<BR>것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5157','','[흙]으로 [정원]을 덮는 꿈 ','집과건물에관한꿈','하는 일이 점차 기반을 튼튼히 잡아 날로 번창하게 되<BR>는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5158','','제 앞에서 [흙][먼지]가 일어 눈을 뜰수 없는 꿈 ','사람의몸에관한꿈','현재 주변의 일들이 마음에 들지 않고, 보고싶지 않은 <BR>사람이나 일이 있어서 멀리하고 싶은 마음을 나타내주<BR>는 심몽이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5159','','[흙]을 파서 그 안에 들어가는 꿈 ','행동에관한꿈','기본적으로 흙 속에 몸이 들어가는 것은 재수가 있고 <BR>좋은 징조이다. <BR><BR>그 흙에 불순물이 들어있거나 축축하여 불쾌한 기분이<BR>들었다면 좋은 일에 액운이 있을 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5160','','[흙][담]을 높이 쌓는 꿈 ','집과건물에관한꿈','어떤 일에 공헌과 업적을 쌓고, 학생은 노력 끝에 학업<BR>성적이 오를 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5161','','솟아나는 [물]이 깨끗하고 아름답게 보이는 꿈 ','물과불에관한꿈','당신의 운세는 대단히 길하는 꿈이다. 물처럼 돈도 넘<BR>쳐날 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5162','','처음엔 [우물]물이 탁했는데 나중에 맑아져서 떠마시<BR>는 꿈','우물에관한꿈','소원, 취직, 결혼 등이 난관에 부딪혔다가 성사되는 꿈<BR>이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5163','','심산유곡에서 [샘물]을 [발견]하는 꿈 ','우물에관한꿈','오래된 자료들이 새롭게 빛을 발하고, 사업구상에 옛 <BR>것이 재창조되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5164','','살고 있는 [집]의 [우물]들이 철철 넘쳐 흐르는 꿈 ','우물에관한꿈','집안에 경사가 생기고, 태몽으로는 돈과 재물을 많이 <BR>모을 아들을 출산하게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5165','','[산] 속에서 [샘물]을 마시는 꿈 ','우물에관한꿈','학식과 지식이 높고 크게 성공할 자녀를 출산하게 되<BR>는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5166','','[샘]이나 [우물]물이 탁해 보이는 꿈 ','우물에관한꿈','신경질환이 생길수 있고, 여색을 조심해야 하는 꿈이<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5167','','[우물]에서 어떤 [이성]와 함께 [두레박][질]을 하고 있<BR>는 꿈','우물에관한꿈','미혼자는 여러번 혼담이 오간 후에 결혼이 성사되는<BR>꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5168','','[우물] 속에서 [짐승]이 나오는 것을 보는 꿈 ','우물에관한꿈','사업적으로 자신이 오랫동안 필요로 했던 자료나 일거<BR>리를 구하게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5169','','[산] 밑에서 [샘물]이 솟아나는 꿈 ','우물에관한꿈','상부기관이나 자신이 처한 곳보다 크다고 생각되는 기<BR>관에서 정신적, 물질적인 재물을 얻게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5170','','[이끼] 낀 [우물]이나 [연못]을 보는 꿈 ','우물에관한꿈','일의 진행 과정에서 방해 요소가 생겨 그것을 제거하<BR>는데 힘이 들게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5171','','[우물]물을 떠서 [손][발]을 씻는 꿈 ','우물에관한꿈','오랫동안 말못하고 있던 근심 걱정이 해소될 징조로, <BR>입학이나 결혼, 청탁 문제가 해결될 것을 암시하는 꿈<BR>이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5172','','[우물] 속에 [산]이 보이는 꿈 ','우물에관한꿈','뜻밖의 큰 사업체가 생기거나 배우자가 나타날 것이<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5173','','[우물]에서 [물]을 퍼올려 [그릇]에 담는 꿈 ','우물에관한꿈','사업에 투자하여 돈을 많이 벌게 벌게 되고, 직장, 사회<BR>등에서 승진을 하게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5174','','[집]에 갑자기 [우물]이 생기는 꿈 ','우물에관한꿈','어떤 회사에 취직이 되거나 미혼자의 경우엔 혼담이 <BR>오갈 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5175','','[우물] 속에서 무슨 [소리]가 들려서 들여다보는 꿈 ','우물에관한꿈','구설수에 오르게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5176','','[우물]에서 다른 사람이 저보다 [먼저] [물]을 떠 마시<BR>는 꿈 ','우물에관한꿈','다른 사람이 자기보다 먼저 진급을 하게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5177','','[땅]을 파니 맑은 [샘물]이 [하늘]로 솟구치는 꿈 ','우물에관한꿈','생산업에다 투자하여 사업 성과를 올리고 번창하게 되<BR>는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5178','','[선녀], [신랑] , [사람] 등이 [우물]에서 나오는 꿈 ','우물에관한꿈','관청 등 기관에서 인재가 나오거나 연구해야 할 일이 <BR>생길 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5179','','[우물] 안에 숨는 꿈 ','우물에관한꿈','감옥에 가는 등의 좋지 않은 일이 생길 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5180','','[우물]을 찾아 헤매는 꿈 ','우물에관한꿈','입학,취직, 청탁 기관 등의 결정에 고통을 겪게 되는 꿈<BR>이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5181','','[우물]에 빠지는 꿈 ','우물에관한꿈','뜻밖의 어려운 일이 생기고, 수하인에게 걱정거리가 <BR>생길 것이다. 옥살이 하게 되거나 원한이 길어지고, 가<BR>까운 사람들의 모함에 빠지게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5182','','[우물]에 [사람]을 넣고 묻어 버리는 꿈 ','우물에관한꿈','자기의 사생활을 지켜며 , 은행에 장기 저축을 하게 되<BR>는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5183','','수[풀]이 [무성]한 곳에서 [샘물]이 솟아나는 꿈 ','연못이나바다에관한꿈','사업자의 경우 부진하던 일들이 풀리게 될 것이며, 새<BR>로운 사업을 하게 되거나 투자, 재물, 돈, 횡재 등을 상<BR>징하는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5184','','[수돗물]이 쏟아지는데 받을 [그릇]이 없어서 쩔쩔매는<BR>꿈 ','물과불에관한꿈','사업이 어려워지고 빚을 많이 지게 되며, 수입은 없고 <BR>지출할 일만 생길 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5185','','[수염]이 긴 [백발] [노인]이 [샘물]을 떠주는 꿈 ','연못이나바다에관한꿈','근심과 만병이 사라지고 생각지도 않았던 재물이 생길<BR>것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5186','','[수도]에서 [물]이 나오지 않는 꿈 ','물과불에관한꿈','사업체나 가정이 경제적인 어려움을 겪게 되는 꿈이<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5187','','[폭포]수 안에서 [선녀]가 [목욕]하는 것을 보는 꿈 ','물과불에관한꿈','아름다운 애인을 만나거나 중매를 받게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5188','','[폭포]수 밑에서 [목욕]을 하는 꿈 ','물과불에관한꿈','하고자 하는 일이 순탄하게 풀릴 징조로 마음을 비우<BR>고 깨끗하게 살아가야 할 시기를 알려주는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5189','','[폭포]수가 떨어져 큰 [바다]가 되는 꿈 ','물과불에관한꿈','어려움을 딛고 일어나 대업을 성취하고 , 발전하게 되<BR>는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5190','','[용]이 [폭포]수를 타고 [하늘]로 올라가는 것을 보는 <BR>꿈 ','용과관련된꿈','세상에 이름을 떨치고 입신출세하게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5191','','[폭포]수가 쏟아져 콸콸 흐르는 꿈 ','물과불에관한꿈','하는 일들이 일사천리로 풀리게 될 징조로, 새로운 발<BR>전과 희망이 보이는 좋은 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5192','','[어깨]가 아플 정도로 [폭포]수를 맞는 꿈 ','물과불에관한꿈','주변에서 중상모략을 받거나 구설수에 올라, 그로 인<BR>해 스트레스가 쌓이게 되는 꿈이다.<BR>&nbsp;<BR>하지만 그 폭포수를 지나 몸을 피했다고 생각되면, 귀<BR>찮은 구설이나 스트레스에서 벗어나게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5193','','[폭포]를 [기둥]처럼 잡고 있는 꿈 ','물과불에관한꿈','훌륭한 귀인을 만나 도움을 받고, 일확천금을 가지게 <BR>되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5194','','[폭포]수로 [머리]를 깨끗이 감는 꿈 ','물과불에관한꿈','깨끗한 마음으로 새로운 것을 맞이하게 될 징조이며, <BR>학생은 머리가 맑아지고 학업 성적이 오르게 되는 꿈<BR>이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5195','','[논]에 [물]이 가득 차있는 꿈 ','전원오곡에관한꿈','하고 있는 일의 환경이나 여건 등이 잘 갖춰질 것을 의<BR>미하며, 자신의 정신 태도가 자신감에 차 있음을 암시<BR>하는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5196','','[논] 가운데 [풀]이 무성해 보이는 꿈 ','전원오곡에관한꿈','크게 길하며, 재물이 생기는 등 사업상 좋은 일이 일어<BR>날 것이다.','N');
