insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5249','','[산]에서 [신령]적인 존재나 [호랑이] 등의 큰 [짐승]을 만나 는 꿈','신에관련된꿈','어떠한 단체에서 지위가 높아지며, 좋은 직책을 맡게<BR>되는 꿈이다 ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5250','','[신령]이 주는 [음식]을 먹는 꿈 ','신에관련된꿈','세상 사람들에게 존경받는 사람으로부터 일거리를 맞<BR>게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5251','','[산]으로부터 [길]을 [안내]받는 꿈 ','신에관련된꿈','훌륭한 지도자를 만나게 되어 일이 순조롭게 진행되는<BR>꿈이다.<BR>&nbsp;','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5252','','[신령]적인 존재가 [문서]를 가져다 주는 꿈 ','신에관련된꿈','이것이 태몽이라면, 학문 연구를 하는 후계자를 얻게<BR>되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5253','','죽은 [사람]이 나타나는 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','죽은 사람이 당신에게 뭔가를 알리고 싶어하는 꿈이<BR>다. 그 사람의 표정이 즐거워 보이면 당신이 그 영혼에<BR>의해 보호받고 있다는 증거가 되지만, 당신을 원망스러워하는 분위가라면 당신이 그 사람에게 죄책감을 느<BR>끼고 있다는 증거이다. <BR><BR>그리고 조상이 나타나 무엇인가를 당신에게 알리는 꿈<BR>은, 그 분의 말씀이나 분위기, 태도 등을 주목할 필요가<BR>있는 꿈이다. <BR><BR>그 안에는 중요한 메시지가 들어있기 때문이다. 그','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5254','','[억울]하게 죽은 [사람]이 나타나는 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','이는 자기를 괴롭히는 심적 고통이나 병마를 상징하는<BR>꿈이다. 따라서 머지않아 정신적으로 고통을 받을 만<BR>큼 힘겨운 일이 발생하거나 질병에 시달리게 되는 꿈<BR>이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5255','','돌아가신 [조상]에게 [음식]을 [대접]하는 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','뜻하지 않은 횡재수가 생기고, 취직이나 입학, 진급 등<BR>평소 바라고 있던 소원이 이루어질 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5256','','[조상]이 제 [머리]를 쓰다듬는 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','집안에 우환이 생기거나 질병에 걸리고, 자신을 비롯<BR>하여 집안식구들이 뜻하지 않은 사고에 처할 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5257','','돌아가신 [조상]에게 [음식]을 [대접]하지만 먹지 않는 <BR>꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','기다리던 소망을 이루기 힘들거나 수정해야 할 징조이<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5258','','죽은 [사람]이 저를 안아주는 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','크게 길하는 꿈이다. 그러나 죽은 사람을 자신이 안고<BR>울면 집안이나 일신에 좋지 않을 일이 일어날 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5259','','[조상]에게 [꾸지람]을 듣는 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','추진하던 일에 차질이 생기고, 집안에도 뜻하지 않은<BR>말썽과 손재로 곤란을 당하게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5260','','[조상]에게서 [음식]을 받거나 [식탁]에서 [대화]를 하<BR>는 꿈. ','조상 귀신 /도깨비 시체 에관련된꿈','사업의 계획, 소망을 이룰 수 있는 좋은 꿈이다. 가까운<BR>시일 내에 기다리던 좋은 일이 생길 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5261','','자기가 죽은 [사람]의 [영혼]이라는 생각이 드는 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','물질적인 만족감을 얻지는 못하지만, 정신적으로 크게<BR>만족할 만한 일을 처리하게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5262','','꿈에 돌아가신 [친지]나 [조상]의 [모습]이 [초췌]하게<BR>보이는 꿈&nbsp;','조상 귀신 /도깨비 시체 에관련된꿈','그 사람의 자손에게 액운이 있다는 뜻의 암시이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5263','','죽은 [사람]이 다시 살아나는 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','성공 직전까지 간 일이 한순간에 수포로 돌아가게 되<BR>고, 발랄하던 사업도 제자리로 돌아올 것을 암시하는 <BR>꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5264','','죽은 [사람]과 [음식]을 나눠 먹는 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','하는 일마다 순조롭게 풀리고 만사가 형통할 징조이다 ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5265','','[생전]에 자기에게 잘 대해 준 [누님]을 보는 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','어떤 협조자를 만나게 되어 사업이나 일이 순조롭게<BR>풀릴 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5266','','죽은 [사람]이 [지기]를 보며 웃거나 [말]을 하는 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','웃으면 중병이 낫고, 말을 하면 사업이 번창할 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5267','','죽은 [사람]을 [목욕]시키는 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','만사가 형통하고 재수가 있을 길몽이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5268','','죽은 [사람]의 [몸]에서 [총][검]을 빼았는 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','계획한 일이 원만히 진행되지만, 다른 곳에서 좋지 않<BR>은 일이 발생하게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5269','','돌아가신 [부모님]이나 [친척]이 괴로워하는 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','현실에서 실제의 부모님이나 친척의 산소가 나쁘던지<BR>그 영혼에 대한 액운이 있다는 암시이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5270','','[병석]에 있는 [사람]이 [꿈]에 [먼길]을 가는 꿈 ','행동에관한꿈','실제로 병석에 누워있는 그 사람은 사망하게 되는 수<BR>가 많고, 그 환자에게 노인이 음식이나 약을 주어 먹는<BR>것을 보면 속히 병석에서 회복할 징조이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5271','','[유령]이 [공중]을 날며 제 [머리채]를 잡는 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','정신병, 두통 등과 같이 머리와 연관된 병을 얻게 되는<BR>꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5272','','[유령]에게 이끌려 [산] 속으로 들어가는 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','입학, 취직이 되거나 중대한 문제에 직면하게 되는 꿈<BR>이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5273','','[동자][귀신]이 나타나 웃는 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','남하고 말다툼이 생기고 구설수에 오르내리게 되는 꿈<BR>이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5274','','[몽둥이]로 [귀신]을 때려잡는 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','평소에 하던 일이 잘 풀리고 정신적 고민거리가 해소<BR>되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5275','','[물귀신]이 나타나 저를 끌어안는 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','이런 꿈을 꾸었을 땐 바닷가나 물가에 가지 않는 것이<BR>좋다. 그리고 남의 잘못된 일로 구속 등의 불운이 닥칠<BR>것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5276','','[붉은] 색 [망또]를 입은 [귀신]이 [춤]추는 것을 보는 <BR>꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','불량배들로부터 봉변을 당하거나 망신을 당하게 되는<BR>꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5277','','[총각][귀신]이 벌거벗고 나타나는 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','집안에 우환과 질병이 생기고, 심신이 고통을 받게 되<BR>는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5278','','목매어 죽은 [귀신]이 나타나는 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','하루종일 가슴이 답답하고 숨막히는 일이 생기며, 생<BR>각지도 않은 누명을 쓰게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5279','','[귀신]과 싸워서 이기는 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','이기면 길하지만, 만일 진다면 흉하는 꿈이다. 그리고<BR>또 승부가 나지 않는다면 건강해지고 명이 길어질 징<BR>조이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5280','','[도깨비]가 [금은보화]를 가지고 나타나는 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','신의 도움으로 졸지에 일확천금을 손에 거머쥐게 될<BR>징조로, 횡재나 재물 , 돈, 행운 등이 따를 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5281','','[도깨비]가 [쌀] [가마니]를 지고 제 [집]으로 들어오는<BR>꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','집안에 재물과 돈이 들어와서 오랫동안 물질적 풍요를<BR>누리게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5282','','[허깨비]가 보이는 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','심신이 불안하고 잡념과 망상이 떠올라, 하는 일마다<BR>실패를 거듭하게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5283','','[귀신]이 주는 [약]을 받아서 먹는 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','재물에 관련되어 자신이 원하던 이권을 얻으며, 입학<BR>이나 취직이 이루어질 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5284','','[여우][귀신]이 나타나 저를 [유혹]하는 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','주색에 빠져 사경을 헤매게 되거나 고질병에 걸릴 것<BR>이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5285','','[귀신]과 다투어 이기는 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','행운이 있고 매사가 뜻대로 풀리는 등 운세가 대길할<BR>길몽이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5286','','[귀신]이 제 [집] [지붕] 위에 앉아 우는 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','집안의 어른이 돌아가시거나 친척들에게 큰 사고가 있<BR>고, 가장이 하던 일이 졸지에 망하여 패가망신할 흉몽<BR>이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5287','','[귀신]에게 몹시 쫓기는 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','뜻하지 않은 곳에 사고가 생기거나 잘 하고 있던 일에<BR>도 걸림돌이 생기는 등 운세가 나쁘고 흉할 것이다. ','N');
