insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5333','','[무덤]이 [반쪽]으로 갈라지는 꿈 ','제사와무덤에관한꿈','시험에 합격하거나 취직을 하게 되며, 잘 풀리지 않던 <BR>일이 시원하게 풀릴것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5334','','[무덤]의 [둘레]가 유난히 길다고 생각하는 꿈 ','제사와무덤에관한꿈','배경이 든든한 사람을 만나서 사업사의 일을 의논하게<BR>되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5335','','[무덤] 앞에 서 있는 [망부석]을 보는 꿈 ','제사와무덤에관한꿈','지금까지 잘 해오던 일이나 사업에 직접 거래하지 못<BR>하고 중개인을 내세워야 할 일이 생길 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5336','','제 [집]에 [초상]이 나서 [곡성]이 들리는 꿈 ','죽음에관한꿈','소원이나 사업이 성취되어 큰 소문이 날 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5337','','[관] 속에서 [사람]이 나오는 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','귀인을 만나 징조이나 관재구설이 예상되니 각별히 말<BR>조심하고, 배신당할 징조이니 거래처를 점검해야 할 <BR>일진이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5338','','[상여]가 나가는데 [만장]이 펄럭이고 [조객]이 많은 꿈 ','제사와무덤에관한꿈','일마다 거듭 실패하게 되지만, 머지않아 기관의 협조<BR>를 받아 세상 사람들이 놀랄 만한 일을 성사해 명성을 <BR>얻게 되는 꿈이다. <BR><BR>그리고 태몽이라면, 사회에 명성을 떨칠 훌륭한 인물<BR>이 태어날 징조이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5339','','[장의차]가 달리는 것을 보는 꿈 ','제사와무덤에관한꿈','일이 순조롭게 잘 진행되거나 사업체나 집을 옮기게 <BR>되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5340','','[관] 속에 [시체]를 넣는 것을 보는 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','횡재할 꿈, 추첨이나 투기해서 목돈이 들어올 길몽으<BR>로, 모든 일이 잘 풀려나가게 되는 좋은 징조이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5341','','[제삿상]에 자기가 직접 [술]을 따라 올리는 꿈 ','제사와무덤에관한꿈','개인의 힘으로는 도저히 해결할 수 없는 일을 정부나<BR>상부기관, 단체 등의 도움을 받아 해결하게 되는 꿈이<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5342','','[제사]를 지내다가 자기가 [퇴주]를 하는 꿈 ','제사와무덤에관한꿈','어느 기관에 부탁할 일이 마무리되거나 아니면 취소도<BR>는 등 확실한 결말을 보게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5343','','[조상]의 [묘]에 [성묘]를 하는 꿈 ','제사와무덤에관한꿈','협력자나 가까운 친구에게 부탁할 일이 생길 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5344','','[국상] [행렬]을 보는 꿈 ','제사와무덤에관한꿈','생에 최고의 명예로운 일이 자신이나 주위 사람에게 <BR>일어날 징조이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5345','','[식구]들이 모여서 [조상]에게 [제사]를 지내는 꿈 ','제사와무덤에관한꿈','집 안에 불화가 없어지고 화목하고 편안하게 지낼 것<BR>이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5346','','[국기]에 대한 [경례] 혹은 [장교]에 대해 경례를 하는 <BR>꿈 ','행동에관한꿈','자신이 몸담고 있는 직장이나 모임, 국가 등에 충성심<BR>을 나타내야 할 일이 생길 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5347','','[신]이나 옛 [성인]에게 절을 하는 꿈 ','행동에관한꿈','권력자의 힘을 빌어 소원을 달성할 수 있음을 암시하<BR>는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5348','','[답례]하는 [상대방]을 보는 꿈 ','행동에관한꿈','그 상대방에게 청탁하거나 보상받을 일이 무산되는 꿈<BR>이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5349','','누군가에게 공손히 [절]을 하는 꿈 ','행동에관한꿈','꿈 속의 사람에게 실제로 부탁할 일이 생기며, 그 일이<BR>좋은 결과를 가져오게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5350','','손[윗사람]이나 [아랫사람]이 자기에게 [절]을 하는 꿈 ','행동에관한꿈','손윗사람은 자기보다 높은 지위에 있는 사람, 손아랫<BR>사람을 자기보다 낮은 지위에 있는 사람이나 동생, 후<BR>배 등을 상징하며, 자신에게 어떤 일을 부탁해 올 징조<BR>이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5351','','[상대방]에게 [절]을 하고 그가 [답례]하는 것을 보는 <BR>꿈 ','행동에관한꿈','누군가에게 부탁했던 일이 이루어지지 않을 징조이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5352','','[절]을 하는데 [상대방]이 [외면]해 버리는 꿈 ','행동에관한꿈','청탁한 일이 무산되고 다른 사람으로부터는 전혀 도움<BR>을 받지 못할 징조이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5353','','[중환자]가 [큰절]을 받는 꿈 ','행동에관한꿈','현실에서 그 중환자가 실제의 인물이라면, 병세가 더<BR>욱 악화되거나 운명의 날이 멀지 않았음을 암시하는<BR>꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5354','','[집]안 [어른]에게 큰[절]을 하는 꿈 ','행동에관한꿈','공공기관이나 자신이 몸담고 있는 단체로부터 상을 받<BR>거나 부탁할 일이 생길 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5355','','[신랑]과 [신부]가 [맞절]을 하는 꿈 ','가족 친척 부부에 관한꿈','상대방이 자기의 일을 망쳐 놓았음을 의미하며, 하는 <BR>일마다 꼬이고 뜻대로 되는 일이 없을 징조이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5356','','제 [결혼식]에서 [상대자]가 바뀌어 버리는 꿈 ','결혼또는편지에관한꿈','계약할 일이 생기게 되거나 협약을 하게 되며, 자신에<BR>게 유리한 조건이 생길 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5357','','[결혼] [잔치]에서 [술잔]이 여기저기 나뒹굴고 있는 꿈 ','결혼또는편지에관한꿈','근심걱정거리가 많아질 징조이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5358','','[결혼]한 사람이 결혼[식장]에 늦어 허둥대는 꿈 ','결혼또는편지에관한꿈','혀재 하고 있는 일이나 주변에 분주하게 해야할 일이 <BR>많은 상태로, 불안하고 초조해하는 자신의 마음을 비<BR>춰주는 심몽의 일종이다. <BR><BR>이럴 때는 여유를 갖고 휴식을 취해야 할 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5359','','[결혼식]장에서 [신랑]의 [예복]이 유난히 [눈]에 들어<BR>오는 꿈 ','결혼또는편지에관한꿈','그 예복이 훌륭하면 훌륭할수록 자신의 집안 운수가 <BR>상승하고 있다는 증거이다. 집안 식구들의 건강도 좋<BR>고 장사나 사업도 향상되어 번창할 징조이다. <BR><BR>또 한편으로는 집안이나 직장에서 확고한 격식을 갖추<BR>고 있음을 암시하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5360','','한 [장소]에서 [합동][결혼식]을 하는 것을 보는 꿈 ','결혼또는편지에관한꿈','진지한 회담에 참석하게 되고 그 회담이 몇 시간에 걸<BR>쳐 이루어질 징조이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5361','','[결혼식장]에 서 있는 자기 [모습]을 [거울]로 보는 꿈 ','결혼또는편지에관한꿈','이꿈을 유부녀가 꾸었다면 결혼 전에 사랑했던 사람을<BR>우연히 만나게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5362','','[군인]에 관한 꿈 ','칼 창 북 종 화살 방패 총에관한꿈','군인은 무력의 상징이다. 점령과 지배욕의 표현이다. <BR><BR>군인 꿈을 꾸었다면 전쟁에서 승리하고, 선거에서 당<BR>선되고, 입찰에서 낙찰 받을 것이다. 그러나 다복한 승<BR>리가 아니고 어느 정도 고독한 승리이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5363','','[경관]에 관한 꿈 ','칼 창 북 종 화살 방패 총에관한꿈','연애나 업무 일이 엉키고 엉키어 어디론가 도망가고 <BR>싶은 심리 상태이다. <BR><BR>우선 기분 정리부터 하고 다시 법을 지키며 분발해야 <BR>한다는 의미이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5364','','[기인]에 관한 꿈 ','연극 영화 미술에관련된꿈','기인이 나타나는 꿈을 꾸었다면 나태해진 자신을 돌아<BR>보라는 의미도 있고, 상식적인 분위기에서 큰 색다른 <BR>분위기로 바꾸고 싶은 심리 상태를 나타낸다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5365','','[스님]과 [목사]에 관한 꿈 ','불도에관한꿈','스님과 목사 등 성직자 꿈은 영적 협력자가 나타나서 <BR>이상향이 이루어진다는 의미다. <BR><BR>그리고 고독한 칩거 생활이 있을 수 있다는 예고도 있<BR>을 수 있다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5366','','[외국인]에 관한 꿈 ','사람의몸에관한꿈','외국인은 낯선 사람이다. <BR><BR>이 꿈을 꾸었다면 새로운 사업이 낯설게 시작된다든가<BR>갑자기 일상생활에 변화가 일어난다는 경고용도 된다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5367','','[가족]에 관한 꿈 ','가족 친척 부부에 관한꿈','꿈에 가족이 나타난다는 것은 지금이 가족적인 분위기<BR>조성에 가장 적절한 시기니 관심 집중시키라는 암시이<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5368','','[왕]에 관한 꿈 ','신에관련된꿈','퍽이나 쾌유한 꿈이다. 만사 형통하여 지도자가 된다<BR>는 암시이다. <BR><BR>요즈음에 인기가 최고 상승세라는 암시도 된다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5369','','[하느님]에 관한 꿈 ','신에관련된꿈','그리스도, 석가모니, 공자 등을 포함해서 하느님을 보<BR>는 꿈은 영적 최고의 꿈이다. <BR><BR>일생 일대의 최고의 영적 메시지를 전달하려는 꿈이<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5370','','[기자]에 관한 꿈 ','연극 영화 미술에관련된꿈','새로운 정보를 얻어서 일생에 망설임 없이 현명한 진<BR>로에 고민 해결하는 징표이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5371','','[점쟁이]에 관한 꿈 ','신에관련된꿈','자신의 상식으로는 해결할 수 없고. 꿈속의 점쟁이 말<BR>속에 풀리는 미래의 열쇠가 있음을 알리는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5372','','[강도]에 관한 꿈 ','도둑에관한꿈','대단히 중요한 물건을 잃어버릴 수 있다는 암시고, 운<BR>세의 하강을 의미한다. <BR><BR>아니면 뜻밖의 것에서 행운이 있는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5373','','[살인] [현장]을 보는 꿈 ','죽음에관한꿈','사람이 살해당하는 꿈은 자신이 살해당할 위험이 있으<BR>므로 부디 주의하라는 암시이다. <BR><BR>살해당하지 않고 도망쳐 돌아오는 쪽의 사람은 손실이<BR>나 부도가 난다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5374','','쫓고 [쫓기는] 꿈 ','행동에관한꿈','남에게 쫓기고 있는 꿈은 고민이나 해결이 나지 않은 <BR>문제를 안고 있는 사람들이다. <BR><BR>상품 매출을 먼저 하고 수표 부도를 막으라는 징조이<BR>다. <BR><BR>i는 꿈은 수험생이면 이루어진다. 잡히지 않으면 고<BR>민이 해결된다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5375','','[피]가 흐르는 꿈 ','사람의몸에관한꿈','이 꿈은 언뜻 보면 나쁜 꿈이지만 한편 좋은 꿈일 수 <BR>있다. <BR><BR>피가 먹피를 보면 중병 악화나 부상, 교통사고의 예몽<BR>이요, 적고 맑은 피는 상대에게 의리를 보이라는 예고<BR>이기도 하다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5376','','[재판]의 꿈 ','행동에관한꿈','재판을 하고 있거나 구속 및 심문을 당하고 있는 꿈은 <BR>명예훼손의 시비가 개입된다. <BR><BR>동업자는 언쟁이 일어난다는 암시이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5377','','[거지]의 꿈 ','행동에관한꿈','조상 산소 이장 및 제사 모시는 일로 친족간에 다투고 <BR>이간되는 현상을 조심하라는 경고이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5378','','[간통]의 꿈 ','성과섹스에관한꿈','주부가 외간 남자와 간통하는 꿈을 꾸었다면 미혼남녀<BR>는 교제하는 사람과 오해의 벽이 생기고 기혼자는 삼<BR>각관계에서 갈등하게 되는 예측이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5379','','[화장실] 꿈 ','집과건물에관한꿈','화장실을 수리하거나 짓는 꿈은 항문이나 생식기에 중<BR>병 악화를 예고하는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5380','','[이빨]이 빠지는 꿈 ','사람의몸에관한꿈','이빨이 빠지는 꿈은 형제 문제로 근심하거나 몸이 아<BR>파 병원 신세로 고통받든지 자식이나 후배. 손아랫사<BR>람 문제로 상호 원수 지는 문제가 발생된다는 암시이<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5381','','[나환자]의 꿈 ','질병에관한꿈','징그러운 나환자들이 보이는 꿈은 삶에 불안, 초조, 공<BR>포 등 육체적, 정신병에 심히 시달리거나 동생이나 후<BR>배, 손아래 조카 등이 불안 초조한 상태임을 나타낸다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5382','','[귀신]의 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','흰옷 입은 귀신이 나타나는 꿈은 본인이나 가까운 친<BR>척에 초상을 겪게 된다는 암시이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5383','','[수술]의 꿈 ','질병에관한꿈','자신이 수술 받는 꿈은 건강 상태가 어려워지고 매매<BR>관계가 성사 직전에 무산되는 예측이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5384','','[병원]의 꿈 ','질병에관한꿈','병원에 입원한 환자를 방문하거나 본인이 병원 신세질<BR>일이 생긴다. <BR><BR>이민이나 외국 갈 수속이 순조롭게 이루어진다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5385','','[약국]의 꿈 ','질병에관한꿈','약사가 약을 조제해 주는 꿈이라면 집안에 행운이, 직<BR>장인은 영전하고 사업은 성업할 꿈이다. <BR><BR>약병이 흩어져 있는 꿈은 모든 일이 행운의 방향으로 <BR>전개되나 손아래 사람으로 인하여 골치 아픈 일이 발<BR>생한다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5386','','[환자]의 꿈 ','질병에관한꿈','인간관계에 배신을 당하거나 이성간의 배신이 생긴다<BR>는 징조니 지나친 욕망을 자제하라. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5387','','[초상집]의 꿈 ','제사와무덤에관한꿈','초상집에 가게 되거나 교통사고나 시체를 보고 듣는<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5388','','[나체]의 꿈 ','사람의몸에관한꿈','그대가 나체의 꿈을 꾸었다면 성교하고 싶은 상태에 <BR>있거나 기존 도덕 질서를 깨고 하늘을 보고 싶다는 욕<BR>망을 나타낸다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5389','','[간호원]의 꿈 ','질병에관한꿈','입원해서 간호원 꿈은 퇴원한다는 좋은 꿈이요, 퇴원<BR>해서 꾸었다면 다시 병원에 입원할 수 있다는 예고이<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5390','','[강변]의 [호텔] 꿈 ','집과건물에관한꿈','여름에 손님이 물밀 듯이 온다는 예고다. 러브호텔 출<BR>입할 여인이 생긴다는 암시도 된다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5391','','[시골집]의 꿈 ','집과건물에관한꿈','평화스러운 시골집이 나타나면 과로한 생활에서 벗어<BR>나 휴양을 하라는 예고이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5392','','[집]을 [증축]하는 꿈 ','집과건물에관한꿈','이 꿈은 집을 넓히고 싶다는 욕망이다. 그러나 지나친<BR>욕망은 이웃과 갈등을 일으킬 수 있다는 경고이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5393','','[집]을 [수리]하는 꿈 ','집과건물에관한꿈','집 수리하여야 할 시기에 와 있다는 것이다. 그리고 지<BR>금 하고 있는 일을 계속하라는 의미도 있다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5394','','[맨션]을 사는 꿈 ','집과건물에관한꿈','맨션사는 꿈을 꾸었다면 그대는 맨션을 팔고 싶다고 <BR>생각하고 있다는 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5395','','[마루]의 꿈 ','집과건물에관한꿈','마루 밑의 밝은 꿈은 인생이나 회사나 가정에 뭔가 터<BR>무니없는 일이 일어난다는 암시다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5396','','[지하실]의 꿈 ','집과건물에관한꿈','지하에 있는 방에 들어가는 꿈은 풍요로운 생활이 이<BR>루어지고 상담이 성사된다는 예고이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5397','','[저당][건물]의 꿈 ','집과건물에관한꿈','뉴스시간에 텔레비전을 켜보면 정계 인물에 대한 중요<BR>한 뉴스에 접한다는 예고이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5398','','[호텔]의 꿈 ','집과건물에관한꿈','외국 여행이나 국내 여행을 하고 싶다는 심리 상태이<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5399','','[문]의 꿈 ','집과건물에관한꿈','그대가 문이 닫히고 깨지는 꿈을 꾸면 집안에 가출하는 사람이 생긴다는 예고다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5400','','[은행] [건물]에 관한 꿈 ','집과건물에관한꿈','저축을 해야 행운을 잡을 수 있다는 충고이거나 돈을 <BR>저축할 일이 발생될 수 있다는 돈복이기도 하다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5401','','[음식]을 먹고 [만족감]을 느끼는 꿈 ','음식물에관한꿈','성욕, 식욕, 물욕, 지배욕 등을 만족시킬 수 있다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5402','','[음식]을 대접받는 꿈 ','음식물에관한꿈','남에게 고용되어 심복이 되거나 그 사람이 시키는 일<BR>을 책임지게 된다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5403','','[음식]을 자기가 [남]에게 [대접]하거나 먹이는 꿈 ','음식물에관한꿈','어떤 일을 상대방에게 시키고 맡겨주며 , 심복을 만들<BR>거나 자기 의사에 따라 줄 사람을 얻게 된다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5404','','[잔치][음식]을 잘 먹는 꿈 ','음식물에관한꿈','맡은 일이 만족할 만하고 자기가 제출한 일거리. 청원<BR>서가 잘 처리된다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5405','','[상대방]과 나란히 앉아 [식사]를 하는 꿈 ','음식물에관한꿈','의견이 일치되고, 결혼, 사업, 계약 등의 일이 잘 이루<BR>어진다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5406','','[밥]은 없는데 [반찬]만 [상]에 놓여있는 꿈 ','음식물에관한꿈','주체적인 일을 하지 못하고 부수적인 일에만 관여하게<BR>된다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5407','','[식사]할때 [국물]을 마시는 꿈 ','음식물에관한꿈','보통 다음날 감기에 걸리거나 정신적인 일에 관계하게<BR>된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5408','','[떡장수]에게 [떡]을 사 먹는 꿈 ','음식물에관한꿈','중개업자나 중매쟁이에 의해 일 또는 결혼 등이 성립<BR>된다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5409','','[빵]에 [잼]이나 [크림]을 발라먹는 꿈 ','음식물에관한꿈','어떤 일을 다듬어 훌륭하게 만든다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5410','','[애인]과 더불어 [아이스크림]이나 아이스[캔디] 등을 <BR>사 먹는 꿈 &nbsp;','음식물에관한꿈','혼담 또는 이별이 급격히 이루어지고 감정이나 인연이<BR>곧 해소된다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5411','','[간장] [독]의 간장이 넘어 주변에 [냇물]같이 흐르는 <BR>꿈 ','음식물에관한꿈','지출도 많고 소비도 많은 부자가 된다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5412','','잘 다듬어진 [길]을 걷는 꿈 ','행동에관한꿈','일신이 안락하고 하는 일이 잘 성사된다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5413','','[애인]과 계속 [변화] 있는 곳을 걷는 꿈 ','행동에관한꿈','화제인물일 땐 그와의 대화가 다채롭게 진행될 것이<BR>고, 어떤 일거리의 상징이라면 일의 진도나 성취과정<BR>을 묘사한 것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5414','','급한 [일]이 있어 빨리 걸어야 할텐데 도무지 [걸음]이<BR>빨라지지 않는 꿈','행동에관한꿈','어디에 청탁할 일이 잘 진행되지 않아 안타까워 할 일<BR>이 생긴다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5415','','[연인]과 [어깨동무]하고 뛰는 꿈','행동에관한꿈','서로의 책임전가에 의하여 부안과 고통이 따른다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5416','','어떤 [고장]을 걷다가 [길가]에 앉아 쉬는 꿈 ','지리에관한꿈','일의 중단, 기다림, 일자리에 한동안 머무는 것을 암시<BR>한다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5417','','[테이블]을 사이에 두고 [마주] 앉거나 서있는 꿈. ','행동에관한꿈','두 사람 사이의 의견 대립이나 시비 거리가 생긴다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5418','','[의자]를 나란히 해서 같은 [방향]으로 앉는 꿈 ','행동에관한꿈','의견일치를 가져오고 나란히 걸어가면 동업이나 협조<BR>적인 일이 생긴다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5419','','[상대방]을 때리는 꿈 ','싸움에관한꿈','육체적인 타격을 가하는 것이 아니라 정신적 타격, 즉 <BR>시비, 공박, 야유, 비평 등으로 상대방을 곤경에 몰아넣<BR>거나 혹평해 줄 일이 있게 된다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5420','','[상대방]에게 [매]맞는 꿈 ','싸움에관한꿈','만족할 만한 남의 호평을 받거나 남에게 공격, 비난을 <BR>받을 일이 각각 있게 된다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5421','','자기가 넘어지는 꿈 ','사람의몸에관한꿈','신분, 지위, 사업체가 몰락함을 뜻한다. ','N');
