insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5583','','[눈길]에 [사고]가 나서 빨간 [피]가 흩어져 있는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','의지와 노력만이 최선의 길. 상대가 남자이면 법적인<BR>해결이 필요하고 여자면 타협이 필요하다. ','N');
