insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5585','','[눈]을 치우는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','재정, 예금관리에서 이익을 봤다고 생각했는데 난관이<BR>따른다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5586','','큰 [눈덩이]가 [천장]을 뚫고 떨어지는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','일을 시작할 행운의 기회다. 입학시험, 입사시험에 좋<BR>은 결과가 따른다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5587','','[홍수]로 [집]과 [동물]이 떠내려 가는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','경쟁자와 합리적인 타협을 해 일의 진행이 잘될수 있<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5588','','[집] 천장에 [비]가 새는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','앞날을 위해 일시적인 어려움은 견뎌내야. 돈을 너무<BR>많이 갖고 다니지 말라. 손재수가 있다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5589','','세찬 [비]가 그치고 갠다 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','경쟁이 뜨겁게 달아오름을 암시한다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5590','','[홍수]가 나 [구경]을 하는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','원하는 결과를 얻을 꿈이다.재운이 따른다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5591','','[천둥]과 [번개]가 치는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','승진이나 진급이 있을 길몽이다. 학자는 큰 명성을 얻<BR>고 사업가는 계획한 일이 순조롭게 진행된다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5592','','[벼락]을 맞는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','자신을 돕거나 아껴주는 사람이 주변에 많이 있으며<BR>부귀를 누린다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5593','','떠오르는 [아침] [해]가 무서울 정도로 이글거리는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','기회는 자주 오는게 아니다. 계획하고 생각하는 일은<BR>망설이지 말고 곧바로 추진하라. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5594','','[별]을 [치마폭]에 담는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','태몽이다. 아들을 낳는다. 남자는 여자 덕분에 큰 재물<BR>을 얻거나 명예가 올라간다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5595','','[무지개]를 타고 있는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','유학을 떠날까, 이민을 떠날까 고민은 많지만 떠나는 <BR>것이 좋다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5596','','저녁 [노을]을 보는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','말년에 큰 업적을 남길 사람과 관계한다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5597','','[북극성] 또는 [십자성]을 보는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','희망과 목표가 생기고 조언자나 협조자를 만나며 법<BR>률, 교리 등이 생긴다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5598','','[물]속에 [달]이 비치는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','진행중인 혼담이 깨질 수도 있고 사업에 좋지 않은 일<BR>이 생길수도 있다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5599','','[비]가 오는데 [우산]이 없는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','가까이 있는 사람과 헤어지거나 이사할 일이 생긴다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5600','','[폭풍]이나 [태풍]에 휘말려 날아가는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','다른 사람의 모함을 받거나 계략에 빠질 우려가 있다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5601','','[얼음]이 어는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','앞길이 꽉 막히는 불길한 꿈이다. 사업이나 직장에서<BR>의 모든일들이 순조롭지 못하다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5602','','[날씨]가 맑아서 [파도]가 잔잔한 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','윗사람의 눈에 들어서 매사가 즐거우며, 모든 일에 희<BR>망이 있고 웃음이 있다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5603','','[별]이 찬란하게 줄지어 있는 것을 보는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','관직. 신분. 명예 등이 새로워지거나 이사갈일이 생긴<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5604','','새로 산 [신발]이 [발]에 맞지 않는 꿈 ','사람의몸에관한꿈','사업. 생활 등을 정리할 일이 생긴다. 외부의 지출및 채<BR>무관계가 압박을 가해온다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5605','','자신이 [학생] [시절]로 돌아간 꿈 ','행동에관한꿈','여자로 인해 가정이 심란하고 집안이 산란하다. 재물<BR>로인한 다툼이 있거나 분쟁이 생긴다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5606','','[물]에 빠진 [신발]을 건지는데 여러 컬레가 따라 나오<BR>는 꿈','물과불에관한꿈','친한 사람이 도움을 준다. 경솔한 언행으로 손해보기<BR>쉬우니 말조심하라. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5607','','웨딩 [드레스] 입은 [신부]를 보는 꿈 ','결혼또는편지에관한꿈','임신이나 출산 및 신분상의 진전을 의미한다. 남쪽 사<BR>람의 덕을 본다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5608','','무거운 [가방]을 메고 가는 꿈 ','옷과악세사리에관한꿈','미혼남이나 홀아비라면 장가갈 꿈이다. 다만 금전 거<BR>래는 손재수가 따른다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5609','','[강물]에 [신발]을 띄우거나 [꽃]이나 [나뭇가지]를 꺾<BR>어 띄우는 꿈 &nbsp;','연못이나바다에관한꿈','애정은 이별을 조심하고 환자는 치유를 서두르지 않으<BR>면 안된다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5610','','[강물]이 [장마]로 불어나서 [논]과 [밭]을 덮어버리는 <BR>꿈 ','연못이나바다에관한꿈','작가나 교육자. 학자에게 아주 좋은꿈이다.언론 출판<BR>계에 작품을 발표하거나 명성을 얻을 일이 생긴다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5611','','얕은 [물]에서 [고기]를 잡는 꿈 ','물과불에관한꿈','태몽. 아들을 낳게 된다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5612','','마른 [냇물]에 [물고기]가 놀고 있는 꿈 ','연못이나바다에관한꿈','폐업. 이혼 혹은 사업 자금난을 겪게된다. 무리한 은행<BR>대출 및 사채 이용은 가급적 삼가라. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5613','','[분수]물이 치솟아 자신의 [얼굴]이나 [옷]을 적시는 꿈 ','물과불에관한꿈','매입 및 매매때 타인의 조언을 들으면좋다. 종교인이<BR>되려는 사람에게도 자주 나타나는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5614','','잔잔한 [호수]에 [시체]가 떠오르는 꿈 ','연못이나바다에관한꿈','원하는 땅을 사게되고 집과 토지를 상속받을 일이생긴<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5615','','[수영]을 하거나 [목욕]하는 꿈 ','행동에관한꿈','삼각관계로 고민한다. 인연이 아니라면 눈 딱 감고 정<BR>리한다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5616','','[폭포] 옆에서 [가족]들과 [밥]을 해먹는 꿈 ','물과불에관한꿈','임신부는 낙태를 생각하게 된다. 사랑과 이별로 고민<BR>할&nbsp;일이 생긴다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5617','','[바다]에서 [거북]을 타고 다니는 꿈 ','연못이나바다에관한꿈','세력이 커져 명예회복을 할수 있다. 유학. 해외이민. 외<BR>국합작 사업구상. 바이어 상담에 행운이 있다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5618','','넓은 [바다]에서 [수영]하는 꿈 ','연못이나바다에관한꿈','앞으로 활동범위가 넓어질 것을 예고하며 해외로 드나<BR>들일이 생긴다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5619','','[물]위를 걷는 꿈 ','물과불에관한꿈','크게 길하다. 그러나 물위에 앉아 있거나 서 있는 것은<BR>가까운 사람의 죽음을 암시한다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5620','','여러 사람과 함께 [목욕]하는 꿈 ','행동에관한꿈','취업, 면학, 신앙생활 등이 원만히 이루어진다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5621','','자신의 [집]에 [불]이 난 꿈 ','물과불에관한꿈','이사를 할 일이 생긴다. 귀인이 나타나 자금 마련을 돕<BR>는다. 세력가 및 재력과와 좋은 인연을 맺는다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5622','','[산불]이 난 것을 구경하는 꿈 ','물과불에관한꿈','작은 아이디어가 당신을 성공으로 이끈다. 작은 힘이<BR>큰힘되니 정상 정복의 길을 모색한다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5623','','자신의 [몸]에 [불]이 붙어 타고 있는 꿈 ','물과불에관한꿈','호기심이 좋은 결과를 가져온다. 작품 발표회 성공 및<BR>남의 재산을 이전 등기, 명의 변경하여 크게 부자가 된<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5624','','[시장]. [빌딩]. 고층[건물]에 [불]이 나는 꿈 ','물과불에관한꿈','서두르면 일을 그르친다. 한번더 깊이 생각하도록하<BR>라. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5625','','[무대]에서 강한 [스포트라이트]를 받는 꿈 ','연극 영화 미술에관련된꿈','세상에 크게 알려지고 소원, 계획이 성취된다. 인기가<BR>급상승 한다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5626','','[논]이나 [들판]에 [불]을 지르는 꿈 ','물과불에관한꿈','언론. 출판. 광고. 서비스업 종사자에게 절호의 기회. 재<BR>물운도 최상이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5627','','자신이 [수술]받는 도중 [목숨]을 잃는 꿈 ','죽음에관한꿈','환자라면 상태가 어려워진다. 매매 관계는 성사직전에<BR>깨진다. 애정은 과감이 승부를 걸면 행복이 보장된다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5628','','자신이 [교통사고]로 [불구]가 되는 꿈 ','질병에관한꿈','관재 구설이 일어나거나 뜻밖의 사고로 의욕을 잃는<BR>다. 오로지 본인 업무에만 충실하라. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5629','','[의사]가 [약]을 [처방]해 주는 꿈 ','질병에관한꿈','직장인은 영전하거나 사업이 날로 발전, 번영할 꿈이<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5630','','[형제] [자매]가 [환자]가 된 꿈 ','질병에관한꿈','사업상 어려운 결정을 해야 할 시기다. 투자에 적은 돈<BR>을 아끼면 차질이 생긴다. ','N');
