insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5906','','임산부가 나는 [새]를 보는 꿈 ','동물에관한꿈','태몽으로 꿈을 꾼 사람과 생이별을 하게 되거 나 사별<BR>하기 쉬우나 새가 일이나 기타의 상징물로 해석될 때<BR>는 상관없다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5907','','기르고 있던 [새장]의 [새]가 도망가는 꿈 ','동물에관한꿈','아내나 애인이 떠나 버려서 혼자가 되거나 하던 일이<BR>상실되고 작품 등이 분실되거나 타기관으로 옮겨지 게<BR>되는 일이 생긴다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5908','','자신이 [새]에게 [먹이]를 주는 꿈 ','동물에관한꿈','새와 동일시될 수 있는 어떤 사람에게 피해 를 주거나 <BR>일에 손실이 생기고 작품에 수정을 가할 일이 생긴다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5909','','세 마리의 [새]가 있는데 그 중에 한 마리가 [손바닥]에<BR>앉는 꿈','동물에관한꿈','세 여성 중에 한 여성과 결혼하게 되어 행복한 삶을 꾸<BR>려나가게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5910','','[꿈]에서 [독수리]나 [솔개]를 보는 꿈 ','동물에관한꿈','그것은 억세고 대담한 장교, 경찰 간부가 될 것을 상징<BR>하고 권세를 얻거나 큰 일을 하게 됨을 의미한다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5911','','[독수리]나 [솔개]가 [접촉]해 오거나 자신의 손과 [발]<BR>을 무는 꿈&nbsp;','동물에관한꿈','야심가인 경우 권세를 잡게 되고 학생은 수석이 되며, <BR>처녀는 씩씩한 아름다운 배우자 를 만나게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5912','','[독수리]가 자기를 채어 [공중]을 날아가는 꿈 ','동물에관한꿈','은 어려운 상황에서 협조자를 만나 일이 이루어 지게 <BR>되고 처녀는 훌륭한 배우자를 만나게 된다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5913','','자기가 [독수리]로 변해서 많은 [닭]을 물어 죽이는 꿈 ','동물에관한꿈','자신이 상대하고 있는 적을 무찌르고 항복받는 것과<BR>같은 상황이 발생하고 승리로 이끌게 된다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5914','','자신이 [독수리]를 타고 [하늘]을 날게 되는 꿈 ','동물에관한꿈','사업가인 경우 사업체를 이끌 어 나가는데 순조롭지 <BR>못하고 흥망성쇠가 거듭되어 고통을 당하게 되 고 처<BR>녀가 꾼 꿈이라면 장차 남편의 사업이 계속해서 부진<BR>하게 되고 연속선으로 어려운 상황이 계속되어 고통을<BR>받게 된다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5915','','[독수리]가 자기를 해치려 하는 꿈 ','동물에관한꿈','자신과 관계있는 마음이 나쁜 사람으로부터 시달림을 <BR>받아 고통을 당하거나 질병에 걸릴 염려가 있다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5916','','[매]가 자신의 [집]에서 기르던 [닭]을 물어 가는 꿈 ','동물에관한꿈','자기가 소유하던 세력의 일 부나 재물을 강력자에게 <BR>강탈당하거나 거느리던 사람 중에 누군가가 시집가게 <BR>된다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5917','','자신이 [훈련]시킨 [매]가 사냥하는 도중 [새]를 잡아오<BR>는 꿈&nbsp;','동물에관한꿈','심복을 시켜 자기가 원하던 여성을 데려오게 하거나<BR>재물을 얻을 일과 상관하게 된다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5918','','임산부가 [매]나 [족제비], [금붕어], [잠자리]로 변해 벽에 붙어 있는 꿈','동물에관한꿈','태몽이다. 이후에 태어날 아이는 일찍 죽을 것이며 그<BR>때까지의 생활환경이 심하게 변화하게 되고 일반인인 <BR>경우 자신의 삶이 허무하게 계속되어 내부에서의 환상<BR>만 가득찬 생활을 하게 될 가능성이 있다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5919','','자신이 가지고 있지 않던 [공작새]를 [소유]하게 되는 <BR>꿈 ','동물에관한꿈','미혼자는 바라던 이상적인 여성이나 남성을 만나게 되<BR>고, 임산부인 경우 태몽이며 태어날 아이가 부귀영화<BR>를 누리고 지위가 높은 사람이 되며, 작가나 학자라면<BR>작품이나 연구에 성과를 얻게 되어 재 물과 명예를 얻<BR>게 된다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5920','','[공작새]가 자신의 [머리] 위나 [주변]을 나는 꿈 ','동물에관한꿈','예술가가 예술작품을 성공적으 로 완성하여 세상에 이<BR>름을 날리게 되고 재물과 명예를 얻게 된다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5921','','[공작새]가 [날개]를 펴는 것을 보는 꿈 ','동물에관한꿈','자신의 권리가 신장이 되고 또는 작품을 성취하여 명<BR>예를 얻게 되고 세상 사람을 감동시킬 일에 상관하 게 <BR>된다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5922','','자신의 [나무]에 달린 [벌집]에 수많은 [벌]이 드나드는<BR>꿈&nbsp;','곤충 벌레에관한꿈','큰 사업체를 경영하여 크게 성공하게 되고 많은 사람<BR>들을 고용하게 되는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5923','','갑자기 [벌]이 날아와 벌에게 쏘이는 꿈 ','곤충 벌레에관한꿈','병에 걸리거나 기혼자인 경우 아기를 임신하게 되고,<BR>작가는 자기 작품에 대해서 우수한 평가를 받게 되어 <BR>명성을 떨치게 된다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5924','','수없이 많은 [벌떼]가 자기에게 덤벼 들어 고통을 당하<BR>는 꿈&nbsp;','곤충 벌레에관한꿈','악당에게 시달림을 받거나 고통거리가 생겨 어려운 상<BR>황이 됨을 예견한다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5925','','두려움의 [대상]이었던 큰 [말벌]을 [손]으로 잡는 꿈 ','곤충 벌레에관한꿈','자신이 계획하고 있던 계약이 성립되고, 꽃에 벌이 모<BR>여드는 것을 보면 경사가 있어 잔치를 하게 되고 손님<BR>을 접대하게 되며 자기 작품을 호평할 사람이 많아 지<BR>게도 된다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5926','','[꿀벌]통에 [꿀]이 많은 것을 보는 꿈 ','곤충 벌레에관한꿈','막대한 사업자금이 생겨서 큰 사업을 벌이게 되고, 그 <BR>꿀벌통으로 많은 꿀벌이 모여들면 많은 사람을 고용하<BR>게 되고 사업이 융성케 된다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5927','','자신이 기르던 [꿀벌]이 모두 달아나 버리는 꿈 ','곤충 벌레에관한꿈','자기 세력권이나 기업이 와해되어 손해를 보게 된다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5928','','[나비]를 보는 꿈 ','곤충 벌레에관한꿈','태몽이며 대체로 여자아이가 태어나지만 성별에 구애<BR>되지 않고 태어난 아이는 자라나서 크게 성공하게 되<BR>며 많은 재물을 얻게 된다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5929','','[나비]가 여러 마리가 모여서 날아다니며 [유희]하는<BR>것을 보는 꿈','곤충 벌레에관한꿈','예상하지 못했던 경사가 생기고, 꽃에 나비가 앉으면<BR>사랑하는 사람이 생겨 연인 사이가 되거나 친구를 만<BR>나게 된다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5930','','[하늘]에서 [별]이 떨어지고 주위에 세 마리의 [나비]가<BR>날아오는 꿈&nbsp;','곤충 벌레에관한꿈','태몽이며 장차 세상에 이름을 떨칠 아기를 낳게 되며,<BR>그 아기는 자라나서 살아가는 동안 세명의 여성과 깊<BR>은 인연을 맺게 되고 도움을 받게 된다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5931','','자신이 [나비]가 되어 여기저기 날아다니면서 [꿀]을 <BR>찾게 되는 꿈&nbsp;','곤충 벌레에관한꿈','예술가인 경우 훌륭한 작품을 쓰거나 완성시키게 되며<BR>인기인이 되어 이름을 떨치게 된다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5932','','임산부가 날아다니는 [곤충]을 보는 꿈 ','곤충 벌레에관한꿈','태몽이며 태아가 장차 인기인이 되어 이름을 널리 알<BR>리게 되지않는 한 단명하거나 부모와 생이별하게 된<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5933','','가을 하늘에 [고추잠자리]가 무리져서 나는 것을 보는 <BR>꿈&nbsp;','곤충 벌레에관한꿈','귀하고 아름다운 여성을 만나 경사가 있거나 선전을 <BR>위한 광고류의 일이 잘 되게 된다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5934','','[잠자리] [표본]을 보게 되는 꿈 ','곤충 벌레에관한꿈','우연한 기회에 사진이나 출판물을 볼 수 있고, 벽에 붙<BR>은 오색잠자리의 태몽으로 태어난 여자아이는 일찍 죽<BR>게 된다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5935','','[거미줄]에 매달린 [거미]를 보는 꿈 ','곤충 벌레에관한꿈','자신의 주위에 있는 어떤 사람이 계교를 부리고 있음<BR>을 예시한 것이고, 거미가 먹이를 감고 있으면 재물이 <BR>생기거나 자신의 일을 도와 줄 충실한 사람을 얻게 된<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5936','','[거미줄]이 [사방]에 쳐져 있는 것을 보는 꿈 ','곤충 벌레에관한꿈','사업을 크게 벌이게 되고 또는 수사망을 펼쳐 처리할 <BR>일이 생기고, 자신의 방구석 또 는 천장 등에 거 줄이 <BR>얽혀 있으면 두통이 생겨서 괴로움을 겪거나 운세가 <BR>막혀 어려 움을 당한다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5937','','[거미줄]에 걸린 [곤충]을 떼어 주는 꿈 ','곤충 벌레에관한꿈','곤경에 처한 사람을 구하게 되어 덕을 쌓게 되고, 거미<BR>줄이 몸에 감기거나 붙으면 질병이나 근심, 걱정거리 <BR>가 생겨서 괴로움을 당한다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5938','','무수한 [거미떼]가 자신에게 덤비어 [괴로움]을 당하는<BR>꿈 ','곤충 벌레에관한꿈','악당에게 시달리거나 저주와 시비를 받게 되고, 거미<BR>에게 물리면 어떤 사업가의 혜택을 받아 성공하게 된<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5939','','산[잉어]를 보는 꿈 ','동물에관한꿈','웃사람의 사랑을 받아 성공하고, 무슨 일이든지 힘쓸 <BR>수록 대길하다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5940','','산[도미]를 보는 꿈 ','동물에관한꿈','길하다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5941','','오래된 [생선]을 보는 꿈 ','동물에관한꿈','길하나 길게 가지 못 할것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5942','','[고기]가 뛰어 [뱃속]으로 들어오는 꿈 ','동물에관한꿈','입신양명 할 운이며, 투기하는 사람은 무엇이든 사면<BR>이익을 본다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5943','','[고래]를 보는 꿈 ','동물에관한꿈','길하고 입신양명 할 운수이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5944','','[고기]가 [물속]에서 노는것을 보는 꿈 ','동물에관한꿈','고향에 돌아가서 입신양명하고, 고기를 잡으면 귀인에<BR>게 선택을 받는다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5945','','[어부]가 [고기]를 많이잡는 것을 보는 꿈 ','동물에관한꿈','싸움을 할 운수이니 삼가 주의하라. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5946','','[냇가]에서 [고기]를 잡는 꿈 ','동물에관한꿈','좋은 상사를 만나고, 숭어가 그물에 걸리면 물가가 오<BR>른다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5947','','[굴]을 먹는 꿈 ','동물에관한꿈','흉하고 병이 생길 수있으니 주의하라. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5948','','[어부]가 [고기]를 잡아가지고 오는것을 보는 꿈 ','동물에관한꿈','불길한 꿈이다. ','N');
