insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5953','','[사실적]이거나 [투시적]인 꿈 ','행동에관한꿈','꿈속에 나타난 그 사람을 미래의 현실에서 실제로 상<BR>관하게 된다. ','N');
