insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5957','','[우물] 속에 비친 [본인]의 [얼굴]을 보는 꿈 ','우물에관한꿈','지위와 이름이 높아지고, 사업의 발전하여 일신의 안<BR>분이 따르게 될 길몽이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5958','','[어머니]가 무서운 [얼굴]로 변해 자신을 쫓아오거나 <BR>덤비는 꿈&nbsp;','가족 친척 부부에 관한꿈','자신의 잠재의식이 반영된 꿈으로 현실에서 어머니에 <BR>대해 부담감을 많이 느끼고 있기 때문에 이런 꿈을 꾸<BR>게 된다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5959','','자다가 깨 보니 [어머니]가 머리맡에서 본인의 [얼굴]<BR>을 보고 있는 꿈&nbsp;','가족 친척 부부에 관한꿈','어머니의 신상에 좋지 않은 일이 일어날 것을 암시하<BR>거나 자신에게 위험이 닥치고 있다는 것을 예시하는 <BR>것이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5960','','[할머니](할아버지)가 와서 맞았는데 근심어린 얼굴로<BR>보시는 꿈','가족 친척 부부에 관한꿈','자신이나 부모, 집안 전체가 좋지 않은 일을 겪게 되거<BR>나, 식구들 중 누군가의 신변에 위험이 생기고 있음을 <BR>알려 주는 꿈이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('5961','','[애인]과 [포옹]을 하고 있다가 [얼굴]을 보니 무섭게 <BR>느껴지는 꿈 &nbsp;','가족 친척 부부에 관한꿈','애인에게 다른 연인이 생겨 자신과의 사이가 결국은 <BR>멀어지게 될 암시이다. ','N');
