insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('6997','','[채석장]이 보이는 꿈 ','집과건물에관한꿈','남자는 급료가 오른다. 여자가 꾸면 남편이 호화로운 <BR>주택 을 지어줄 것이다. 수감된 죄인이면 징역 기간에 <BR>고된 일을 하게 된다. <BR><BR>환자가 이 꿈을 꾸면 병상에 장기간 누워 있을 것이다. <BR>여행자는 숨겨 진 보물을 발견할 것이다. 군대 장교가 이런 꿈을 꾸면 적들과 치열한 전투가 벌어 졌다가 나<BR>중엔 실패로 끝날 것이다.&nbsp; ','N');
