insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7046','','[쌀밥]을 먹는 꿈 ','음식물에관한꿈','당신이 큰돈을 벌어 대단히 기뻐할 꿈이다. 기혼 여자<BR>가 꿈에 쌀밥을 먹었다면 해산하게 된다. <BR><BR>미혼 남자는 오래지 않아 결혼하게 되고, 환자는 건강<BR>을 회복하게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7047','','[김치]를 먹는 꿈 ','음식물에관한꿈','당신의 건강은 갈수록 나빠질 것이다. 기혼 남자가 김<BR>치를 먹었다면 결혼식에 초대되어 갈 것이고, 미혼 남<BR>자는 연인을 더욱더 사랑하게 될 것이다. 환자가 꿈에 <BR>김치를 먹었다면 건강이 회복될 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7048','','[김치]를 만드는 꿈 ','음식물에관한꿈','상서로서 집안 살림에 근심 걱정이 모두 없어지게 된<BR>다.','N');
