insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7050','','남에게 [김치]를 주는 꿈 ','음식물에관한꿈','가장 친한 벗과 소식을 끊을 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7051','','[상한] [김치]를 먹는 꿈 ','음식물에관한꿈','재난에 부딪치게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7052','','[야채][국]을 보는 꿈 ','음식물에관한꿈','오래지 않아 기쁜 소식이 들리게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7053','','[야채][국]을 먹는 꿈 ','음식물에관한꿈','오래지 않아 귀중한 예물을 선물 받게 된다. 기혼 여자<BR>가 이런 꿈을 꾸면 임신하게 되고 환자는 병세가 호전<BR>된다. 상인은 출국하여 큰돈을 벌게 된다. <BR><BR>지만 여행자가 꿈에 야채스프를 마셨다면 여행 중에 <BR>병이 생길 것이다.','N');
