insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7078','','[빵]을 먹는 꿈 ','음식물에관한꿈','생활이 즐겁고 행복하게 된다. 여인이 이 꿈을 꾸면 아<BR>이의 신체가 튼튼할 것이고, 상인은 장사가 번창하게 <BR>된다. 환자가 이 꿈을 꾸면 건강이 회복되며 여행자가<BR>꿈에 토스트를 먹었다면 성공된 여행을 하게 된다.','N');
