insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7095','','[파]나 [마늘] 등을 사는 꿈 ','음식물에관한꿈','태어난 아이가 성장하면 성직자, 교육자 등 정신적인 <BR>지도자가 된다.','N');
