insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7097','','[돈]을 받고 [물건]을 내어주는 꿈 ','행동에관한꿈','액수만큼의 재물 손실이 따른다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7098','','[복권]을 사거나 얻는 꿈 ','돈과재물에관한꿈','소개장 또는 상품권, 계약증서 등을 받는다.','N');
