insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7100','','남이 주는 [지폐]를 받았는데 [편지]나 [문서]로 변하는<BR>꿈 ','돈과재물에관한꿈','남의 강압적인 지시나 명령에 따를 일이 생긴다.','N');
