insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7215','','새로 [다리]를 놓는 꿈 ','지리에관한꿈','많은 사람들에게 덕을 베풀게 되리라는 예시이다. 뿐<BR>만 아니라 처음 어려움이 있더라도 시일이 지나게 되<BR>면 하는 일마다 순조롭게 진행되고 성공하게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7216','','[다리]가 무너지거나 [중간]에 [끊기는] 꿈 ','지리에관한꿈','관액이 이르게 되어 체포당할 일이 생길 수도 있고 자<BR>손에게 좋지 못한 일이 생길 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7217','','[다리] 위에 편안히 앉아 쉬는 꿈 ','행동에관한꿈','앞으로 벼슬을 하게 되거나 직업을 얻게 되고 편안한 <BR>생활을 누리게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7218','','누군가 [다리] 위에 서서 자신을 [부르는] 꿈 ','행동에관한꿈','재판중일 경우 재판에서 이길 가능성이 크다. 하지만 <BR>이러한 꿈을 꾼 사람이 노인이라면 좋지 않다.','N');
