insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7504','','[땅]에서 [불]이 나는 꿈 ','물과불에관한꿈','질병을 얻는다. 그리고 땅에서 얻은 기운이 오르는 꿈<BR>도 흉몽이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7505','','[땅][속]으로 들어가는 꿈 ','행동에관한꿈','만사가 길하다. 그리고 스스로 땅을 파서 자신을 묻으<BR>면 재산이 는다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7506','','[땅]이 울퉁불퉁하게 보이는 꿈 ','지리에관한꿈','괴로운 일이 있거나 몸이 불편하며 뜻밖의 일에 휘말<BR>려 고생한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7507','','[지진]이 일어나 [집]이 흔들리는 꿈 ','지리에관한꿈','다른 사람과 다투거나 소송할 일이 생긴다. 혹은 몸에<BR>부상을 입게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7508','','[흙][덩어리]를 [집]으로 갖고오는 꿈 ','집과건물에관한꿈','재수가 길한 꿈이나 자진이 흙을 만져보면 수치스러운<BR>일을 당한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7509','','[길]을 고치는 꿈 ','지리에관한꿈','만사가 화합하여 대길하다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7510','','[길]에서 [물건]을 파는 꿈 ','행동에관한꿈','남에게 음식대접을 받는다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7511','','[길]에서 [재물]을 줍는 꿈 ','돈과재물에관한꿈','만사가 형통하게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7512','','[길]에서 [물건]을 파는 꿈 ','행동에관한꿈','남에게 음식대접을 받는다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7513','','[상인]의 경우 [거리]에 들어가는 꿈 ','행동에관한꿈','큰 부자가 될 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7514','','[길]을 잃는 꿈 ','지리에관한꿈','길을 잃거나 정처없이 이리저리 헤매는 것은 부모나 <BR>친척과 불화하며 모든 일에 해결을 보기 어려운 징조<BR>이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7515','','[물]에서 [헤엄]치는 꿈 ','물과불에관한꿈','어떠한 혜택을 받아 일이 잘 진행된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7516','','[탁류]에서 [헤엄]치는 꿈 ','물과불에관한꿈','흉사가 들 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7517','','[물]에 빠지는 꿈 ','물과불에관한꿈','물에 빠져서 밖으로 나오지 못하고 허우적거리면 흉하<BR>니 조심해야 한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7518','','[물]에 빠졌다가 밖으로 나오는 꿈 ','물과불에관한꿈','길몽이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7519','','누군가 [물]에 빠진 것을 [발견]하는 꿈 ','물과불에관한꿈','슬픈 일이나 마음이 동요하는 일이 일어날 전조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7520','','[물] 위에 앉거나 서 있는 꿈 ','물과불에관한꿈','가까운 사람의 죽음을 보거나 이별을 암시한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7521','','[물] 위를 걷는 꿈 ','물과불에관한꿈','크게 길하다. 그러나 물위에 서있거나 앉아 있는 것은 <BR>가까운 사람의 죽음을 암시한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7522','','[집]이 맑은 [물]로 덮이는 꿈 ','물과불에관한꿈','가업이 번창하고 집안이 화목하며 부모에게 기쁜 일이<BR>있다. 또 집안에 훌륭한 인물이 태어날 태몽이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7523','','[집]안에 [우물]이 있는 꿈 ','집과건물에관한꿈','길몽으로 집안에 우애가 있고 화목함을 뜻한다. 자신<BR>을 도와주는 사람이 나타나 크게 성공할 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7524','','[우물]을 파는 꿈 ','우물에관한꿈','우물을 파서 맑은 물이 나오면 대길하나 물이 나오지 <BR>않으면 집에 근심이 생긴다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7525','','[우물]을 찾아 헤매는 꿈 ','우물에관한꿈','결정해야만 하는 일 때문에 고심하게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7526','','[수돗물]이 콸콸 쏟아지는 꿈 ','물과불에관한꿈','받을 그릇이 없으면 소비가 많아 사업상 부채만 지게 <BR>된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7527','','[웅덩이]에 [물]이 고여있는 꿈 ','물과불에관한꿈','뜻하지 않은 기회로 재산을 늘이게 될 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7528','','여러 사람과 함께 [목욕]하는 꿈 ','물과불에관한꿈','취업, 면학, 신앙생활 등이 원만히 이루어진다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7529','','[산]과 [들]이 온통 [물]로 뒤덮인 꿈 ','물과불에관한꿈','큰 세력을 잡거나, 세상 사람들이 깜짝 놀랄 만한 업적<BR>을 남긴다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7530','','[폭포]가 힘차게 쏟아지는 꿈 ','물과불에관한꿈','곧 귀인을 만나 크게 성공하게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7531','','[물]이 조용히 흘러가는 꿈 ','물과불에관한꿈','마음속으로 원하는 사람과의 결혼에 성공하거나 사랑<BR>이 시작된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7532','','자기가 [물]을 많이 마시는 꿈 ','물과불에관한꿈','길몽이다. 자신이 도움을 받는 일이 있거나 선물을 받<BR>게 되며 재산을 모은다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7533','','[물]이 몹시 흐려 보이는 꿈 ','물과불에관한꿈','건강이 나빠질 징조다. 여자문제로 고생할지도 모르므<BR>로 조심할 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7534','','큰 [물]로 [집]이 떠내려가는 꿈 ','물과불에관한꿈','가족 중의 누가 고소를 당하거나 해서 법적으로 심판<BR>을 받거나 철창신세를 진다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7535','','[얼음]이 어는 꿈 ','물과불에관한꿈','앞길이 꽉 막히는 불길한 꿈이다. 사업이나 직장에서<BR>의 모든 일들이 순조롭지 못한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7536','','[얼음]이 녹는 꿈 ','물과불에관한꿈','풀리지 않던 일들이 해결되고 기다리던 사람으로부터 <BR>소식을 받는다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7537','','[천둥]과 [번개]가 치는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','승진이나 진급이 있을 길몽, 학자는 큰 명성을 얻게 되<BR>고, 사업가는 계획한 일이 순조롭게 진행된다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7538','','[벼락]을 맞는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','자신을 돕거나 아껴주는 사람이 주변에 많이 있으며 <BR>부귀를 누린다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7539','','[비] 때문에 [길]이 막히는 꿈 ','물과불에관한꿈','집안에 경사가 생기고 자녀에게 행운이 온다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7540','','[소나기]가 세차게 쏟아지는 꿈 ','물과불에관한꿈','사회적 여론, 정신적 혜택, 작품 평, 기타의 소원 충족<BR>과 관계된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7541','','[비]가 오는데 [우산]이 없는 꿈 ','물과불에관한꿈','가까이 있는 사람과 헤어지거나 이사할 일이 생긴다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7542','','큰 [눈]이나 [비]로 [길]이 막히는 꿈 ','물과불에관한꿈','뜻밖의 재난을 만나고 형제간의 불화도 있다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7543','','[홍수]가 일어나 [길]이 막히는 꿈 ','물과불에관한꿈','하는 일마다 재수가 없다. 윗사람 혹은 동료와 다투거<BR>나 큰 고통을 당할 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7544','','[폭풍]이나 [태풍]이 부는 꿈 ','물과불에관한꿈','건강이 나빠지고 매사가 순조롭지 못하다. 서두르면 <BR>오히려 이익이 되기도 한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7545','','[폭풍]이나 [태풍]에 휘말려 날아가는 꿈 ','물과불에관한꿈','다른 사람의 모함을 받거나 계략에 빠질 우려가 있다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7546','','큰 [눈]이나 [비]로 [길]이 막히는 꿈 ','물과불에관한꿈','뜻밖의 재난을 만날 수도 있으니 용기를 잃지 말도록 <BR>한다. 특히 형제간의 불화가 생기기 쉬우므로 조심하<BR>도록 한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7547','','[보슬][비]가 오는 꿈 ','물과불에관한꿈','슬픔과 눈물, 불만과 불쾌의 상징이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7548','','[눈]과 [비]가 함께 오는 꿈 ','물과불에관한꿈','말과 행동이 다른 것을 보게 될 징조로 계획한 일이 서<BR>로 시기하는 사람들에 의해서 잘 추진되지 않을 징조<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7549','','[눈]을 맞으며 걸어가는 꿈 ','물과불에관한꿈','사회나 국가적인 혜택을 받을 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7550','','[비][바람]이 세차게 부는 꿈 ','물과불에관한꿈','어떤 위험한 사태가 있을 것을 예시해 주는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7551','','[파도]가 이는 [바다]를 보는 꿈 ','물과불에관한꿈','우환이나 횡포 등으로 고통을 받게 되고 내외간에 구<BR>설이 있다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7552','','넓은 [바다]에서 [수영]하는 꿈 ','연못이나바다에관한꿈','앞으로의 활동범위가 넓어질 것을 예고하며 해외로 드<BR>나들 일이 생긴다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7553','','[배]를 타고 [강], [바다]를 건너는 꿈 ','연못이나바다에관한꿈','귀인을 만나 큰 도움을 받는다. 직장을 얻거나 지위가 <BR>올라갈 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7554','','[냇가]에서 [낚시][질]하는 꿈 ','연못이나바다에관한꿈','물고기를 잡으면 경사스런 일이나 재물이 쏟아져 들어<BR>온다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7555','','[배]를 타고 [강]이나 [바다]를 건너는 꿈 ','연못이나바다에관한꿈','지위가 올라가거나 직장을 얻게 되며 귀인을 만나 큰 <BR>도움을 받을 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7556','','[날씨]가 맑아서 [파도]가 잠잠한 꿈 ','연못이나바다에관한꿈','윗사람의 눈에 들어 매사가 즐거우며, 모든 일에 희망<BR>이 있고 웃음이 있다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('7557','','[파도]가 사납게 이는 꿈 ','연못이나바다에관한꿈','연인이 헤어지거나 친구와 다투는 일이 있다. 뿐만 아<BR>니라 친지와 멀어질 징조이다.','N');
