insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('8223','','[남편]([아내])이 [바람]피워 [아이]를 낳아 데리고 오는<BR>꿈 ','가족 친척 부부에 관한꿈','남편의 일이 잘되어 소득이 생길 꿈이다. 남편의 일에 <BR>처음엔 불안했지만 나중에는 크게 만족한다.','N');
