insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('8225','','[애인]이 [전쟁][터]로 나가는데 매달리며 서럽게 우는 <BR>꿈 ','가족 친척 부부에 관한꿈','이별을 의미한다. 우는 것은 마음의 정리가 되었다는 <BR>의미이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('8226','','[부부]간의 [만족]스런 [성][관계]를 하는 꿈 ','성과섹스에관한꿈','성관계의 불만이 있으므로 각별히 신경을 써야 한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('8227','','[애인]과의 [성][관계]를 가지는 꿈 ','성과섹스에관한꿈','사소한 오해로 말다툼이 생기니 한발 양보해야 하는 <BR>꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('8228','','[애인]의 [품]에 안겨 있거나 [무릎]을 베고 누워 있는 <BR>꿈 ','애락병사에관한꿈','자신이 힘들 때 이런 꿈을 꾸는데 주위 사람의 정신적 <BR>도움이 필요한다.애인이 떠날까봐 불안해 하는 경우이<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('8229','','[애인]을 아무리 불러도 오지 않고 점점 더 멀어지는 <BR>꿈 ','가족 친척 부부에 관한꿈','자신이나 애인의 일이 뜻대로 풀리지 않음을 암시하는<BR>꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('8230','','[애인]에게 [다른]사람이 생겨 [실연] 당하는 꿈 ','가족 친척 부부에 관한꿈','막연한 생각 자신이 그래 봤으면 하거나 서로의 마음<BR>이 불편해서 그럴 수도 있다.','N');
