insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('8232','','[짝][사랑]하던 사람과 사랑이 이루어져 [행복]해하는 <BR>꿈 ','행동에관한꿈','현실에서 이루기가 어려워 꿈에서나마 사랑이 이루어<BR>진 것이다.','N');
