insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('8235','','[낯선] [아이]가 졸졸 자기를 따라오는 꿈 ','행동에관한꿈','일을 아무리 해결해도 문제가 계속 발생하는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('8236','','[낯선] [아이]가 자기에게 [엄마]([아빠])라고 부르는 꿈 ','행동에관한꿈','꿈에서 그아이를 반갑게 맞으면 집안에 새식구가 생기<BR>고, 모른체하면 쓸데없는 사건에 휘말려 망신이나 속<BR>을 썩게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('8237','','누워있는 자신의 [몸][위]에서 [아기]가 놀거나 잠들어 <BR>있는 꿈&nbsp;','행동에관한꿈','골치 아픈 문제나 짐이 있는 꿈, 일을 해도 성과가 없<BR>고 힘만 든다.','N');
