insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('8239','','[놀이터]나 기타장소에서 아이들이 [노는] 것을 바라 <BR>보는 꿈','행동에관한꿈','가정이나 사업에 어려움이 생기는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('8240','','자신이 [어린] [아이]가 되어 울고 있는 꿈 ','행동에관한꿈','자신의 상황이 어려워 도피하고 싶어하는 꿈, 책임없<BR>는 어린 시절을 그리워한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('8241','','[교통][사고]로 [아이]가 죽는 꿈 ','죽음에관한꿈','그 아이가 자신의 아이면 걱정 마라. 아이에게 좋은 <BR>꿈, 모르는 아이라면 새로운 일이나 사업에 도전하라<BR>는 암시이므로 과감하게 도전해도 괜찮을 시기가 온<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('8242','','[화재][현장]에서 [아이]를 [불]길속에서 구해오는 꿈 ','물과불에관한꿈','사업이 번창하고 실속있는 큰 이득을 얻게될 길몽, 하<BR>지만 구하지 못하고 쳐다만 보았다면 자신의 일에 어<BR>려움이 닥치고 재산의 손실이 따름을 암시한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('8243','','[어린][아이]를 [야단]치며 때리는 꿈 ','행동에관한꿈','아이가 위험하니 각별히 신경을 더 써주어야 함을 암<BR>시한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('8244','','[우는] [아이]를 달래는 꿈 ','행동에관한꿈','걱정거리가 생길 꿈이다.사랑 때문에 결심을 해 시도<BR>하나 마음이 흔들려 이루어지지 않음을 암시한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('8245','','[잠든] [아이]를 안거나 같이 잠들어 평온한 꿈 ','행동에관한꿈','평화롭고 행복한 나날들이 이어진다. 모든일이 순조롭<BR>게 풀림을 암시한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('8246','','자신이 [어린][아이]를 버리는 꿈 ','행동에관한꿈','고민이나 걱정거리가 해결되거나 골칫거리가 제거되<BR>는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('8247','','[갓] 태어난 [아기]를 [목욕]시킨 꿈 ','행동에관한꿈','자기보다 능력이 한 수 위인 사람이 나타나 자신의 일<BR>이나 작품등의 미비점을 보완해 준다.','N');
