insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('8250','','[여자][귀신]이 자신에게 다가오거나 덤비는 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','병이 생길 꿈이다.','N');
