insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('8253','','당신 자신이 [귀신]이 되어 [남]을 괴롭히는 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','당신의 불만이나 결함을 해소하고 욕망을 만족시키려<BR>는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('8254','','문밖에서 [유령]이나 [도깨비] 등이 딩굴며 [춤]추는 것<BR>을 보는 꿈','조상 귀신 /도깨비 시체 에관련된꿈','병에 걸리거나 우환이 생긴다.','N');
