insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('8338','','자신이 유명한 [연예인]이 되어 [팬]들의 [지지]를 받는<BR>꿈 ','행동에관한꿈','자신의 현실에 대한 불만의 표시, 기회를 주지 않는 현<BR>실에 대한 불만의 의미이다.','N');
