insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9114','','남의 [집] [비둘기]가 날아와서 잡는 꿈 ','동물에관한꿈','비둘기는 평화와 선량한 사람을 나타내므로 남의 집에<BR>있던 여인, 가정부가 내게 와 한동안 살게 된다. 그러나<BR>새는 종내 하늘로 날아가므로 언젠가는 떠나게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9115','','[비둘기]가 떼로 모여있는데 자신이 그곳에 모이를 뿌<BR>려주는 꿈 ','동물에관한꿈','제자나 문하생을 가르치게 되고 좋은 사람들을 만나게<BR>된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9116','','[제비]가 [처마] 밑에 [집]을 짓는 꿈 ','동물에관한꿈','사업 계획을 세워 차근차근 일을 진행시키게 되며 제<BR>비가 오면 기쁜 소식이 전해진다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9117','','[제비]가 [방][안]으로 들어와 잠깐 머물다 날아가는 꿈 ','동물에관한꿈','제비는 여인에게 비유되고 어여쁜 모습을 상징하므로 <BR>그 여인과 살게 되고 날아가면 여인이 떠나가게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9118','','[제비]가 여러 마리 떼를지어 [집][안]으로 날아 들어오<BR>는 꿈','동물에관한꿈','사업이나 가정에 크게 도움을 줄 귀인을 만나게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9119','','[제비]가 [지붕] 밑으로 날아오는 꿈 ','동물에관한꿈','외부에서 소식이 전해지거나 손님이 오게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9120','','[제비][집]을 허무는 꿈 ','동물에관한꿈','집안이나 사업장에 사고가 나거나 재난이 닥치게 된<BR>다.','N');
