insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9122','','[까마귀]떼가 무리지어 나는 데 여기저기서 까마귀 우<BR>는 소리가 나는 꿈 ','동물에관한꿈','연회나 회식에 참석하지만 말썽이 생기고 손재수 등이<BR>있게 된다.','N');
