insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9130','','[참새] 두세 마리가 [전깃줄]에 [감전]되어 죽는 꿈 ','동물에관한꿈','죽는 것은 길몽이므로 하고 있는 두세 가지 일이 성취<BR>된다.','N');
