insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9432','','[하늘]로 올라가는 [용]의 [꼬리]를 잡았다가 놓치게 되<BR>는 꿈&nbsp;','용과관련된꿈','주위 만류와 저해를 뿌리치고 출세할 사람과 관계하게<BR>되어 그 사람의 도움을 받게 되고 성공을 하게 된다.','N');
