insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9438','','[용]이 [사람]을 물어 죽이는 것을 보는 꿈 ','용과관련된꿈','강대세력에 의해서 자신이 추진하던 일이 성취가 되어<BR>주위에 있는 다른 많은 사람들에게 두터운 신용이 생<BR>기게 된다. ','N');
