insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9440','','두 마리의 [용]이 마주 보고 있다가 차츰 [접근]해 오는<BR>꿈','용과관련된꿈','두 개의 세력단체가 서로 의견을 달리하여 라이벌 관<BR>계에 놓이게 됨을 예시한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9441','','[용]이 [공중]에서 떨어지는 것을 보는 꿈 ','용과관련된꿈','지위가 떨어지고 권세를 잃게 되고 자신에게 벅찬 일<BR>이 성취되기도 한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9442','','[용]을 타고 [산]으로 들어가는 꿈 ','용과관련된꿈','학생인 경우 학업에서 크게 성적인 오르거나 사업이 <BR>크게 이루어지거나 관직에 오르게 되어 자신이 바라던<BR>일이 이루어지게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9443','','[땅]에 살고 있는 [용]을 본 꿈 ','용과관련된꿈','자신의 업적에 벅찬 일이 생김을 상징한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9444','','[적룡]과 [흑룡]이 서로 몸을 뒤틀며 [하늘]로 오르는 <BR>꿈 ','용과관련된꿈','태몽이며 태어날 아이가 장차 文과 武를 겸한 훌륭한 <BR>인물이 되고, 남자 여자가 결합을 하게 되어 혼사가 있<BR>음을 예시한 꿈이기도 하다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9445','','[물] 속에서 잠자는 [용]을 보는 꿈 ','용과관련된꿈','자신이 관계하고 있는 어느 기관에 보류되어 있는 일<BR>이나 또는 작품 등에 관계하게 되거나 희귀하게 여겨<BR>지는 금은보화를 보게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9446','','[우물][가]의 [나무]뒤에 서서 [용]이 [우물]에 들어간 <BR>것을 보는 꿈 ','용과관련된꿈','다니고 있는 직장에서 승진을 하게 되거나 감옥에 들<BR>어가게 되고, 자신이 관계하고 있는 곳에서 추진중이<BR>던 일이나 작품 등이 채택되기도 한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9447','','눈앞에 있던 [용]이 날아가서 [시야]에서 완전히 사라<BR>져 버리는 꿈&nbsp;','용과관련된꿈','자신을 옆에서 보살펴 주던 협조자, 권세, 명예, 일 등<BR>이 한때 세상에 알려져 명성을 떨치게 되지만 차츰 사<BR>라져 감을 예시한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9448','','[용]과 싸우는 꿈을 꾸다가 [잠]을 깨는 꿈 ','용과관련된꿈','자신에게 벅찬 과업을 진행 시키는 데 있어서 많은 노<BR>력이 필요하여 어려움을 암시한 것이며 정치가인 경우<BR>정권 또는 당권투쟁이 치열해져 어려운 상황을 체험하<BR>게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9449','','[용]이 [뱀], [호랑이], [여성] 등으로 변하여 [싸움]을 걸<BR>어오는 꿈 ','동물에관한꿈','명예를 잃게 되거나 큰 사업을 일으키고 성취하는데 <BR>어려운 고비를 여러 번 겪고 고통을 당한 다음에야 비<BR>로소 자신이 바라던 일이 성취될 것을 예시한다. 수험<BR>생 등에게 부합되는 꿈이라 할 수 있다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9450','','꿈에서 [용]의 [문장]이나 [조각]이 보이는 꿈 ','용과관련된꿈','저명인사에 관련이 있거나 위인에 관한 기사를 읽거<BR>나 희귀한 물건이나 서적 등을 대하게 되어 자신에게 <BR>도움이 될 수 있음을 의미한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9451','','[용]이 [공중]을 날아 다니며 울거나 [말]을 하는 꿈 ','용과관련된꿈','세상에 명성을 떨쳐소문 낼 일이나 업적 등이 생기게 <BR>되고, 용이 사람과의 동일시될 때에는 그 사람 또는 해<BR>당되는 무리들에게 불이익이 생기고 억압당할 일이 생<BR>기게 된다.','N');
