insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9749','','[새집]에 [이사]가서 [가구]를 들여 놓는 꿈 ','집과건물에관한꿈','대길한 꿈이며 날로 발전을 이룰 징조의 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9750','','[의자]를 끌어당겨 [책상]에 앉는 꿈 ','가재도구에관한꿈','중요한 직책을 맡게되고 자기의 입지가 확고해지는 꿈<BR>이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9751','','다른사람의 [책상]에 앉아 있는 꿈 ','행동에관한꿈','입학시험에 무사히 통과하게 되고 취직도 문제 없는 <BR>꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9752','','높은 사람의 [책상]에 앉는 꿈 ','행동에관한꿈','자기가 속한 곳에서 최고의 자리에 오르게 될 길몽이<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9753','','자기 [책상]의 [서랍]이 모두 열려 있는 꿈 ','문무기구에관한꿈','새로운 기회가 펼쳐져 있다. 좋은 기회를 앞두고 있으<BR>니 신중히 판단하라.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9754','','[책상] [서랍]을 열려고 하는데 잠겨있어 열지 못하는 <BR>꿈 ','문무기구에관한꿈','뜻하지 않은 어려움이 닥칠 징조이며 꾸준한 노력과 <BR>인내로 좋은 결과를 얻을 수 있다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9755','','[서랍] 안이 텅 비어있는 꿈 ','문무기구에관한꿈','열심히 일을 해도 결과가 없다는 것을 보여 주는 꿈이<BR>다. 또는 엄청난 스트레스에 시달리게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9756','','좁은 [의자]에 간신히 앉는 꿈 ','문무기구에관한꿈','자신의 환경을 원망하고 있는 자신의 심리표현이다. <BR>혼담이 오가는 사람은 다시 한번 생각해 보아야 한다<BR>는 암시이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9757','','[낡은] [의자]에 앉는 꿈 ','문무기구에관한꿈','어떤일에 휘말려 좌천되거나 직위의 하락, 만족스런 <BR>결혼생활을 의미한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9758','','[고급][의자]에 앉아 창밖 [경치]를 [구경]하는 꿈 ','문무기구에관한꿈','성공에 대한 강한 소망이 담긴 꿈으로 성공을 예시한<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9759','','[대합실] 같은데서 앉으려고 하나 [자리]가 없는 꿈 ','행동에관한꿈','현재하고 있는 일에서 결과를 기대하기 어렵거나 직장<BR>에서의 직위가 깎이는 운이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9760','','자기[의자]에 다른사람이 앉아 있는 꿈 ','문무기구에관한꿈','시험의 낙방,실패, 혹은 연인과의 이별수를 뜻한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9761','','[하늘]에서 [용상]이 내려오는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','국가적인 권리나 직위, 명예를 얻을 꿈이다.','N');
