insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9770','','[도서관]에서 필요한 [책]을 찾는 꿈 ','문무기구에관한꿈','현재의 자신의 문제를 해결하기 위해 수단과 방법을 <BR>모색하는 꿈이다.','N');
