insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9799','','[우체부]가 [편지]를 자기에게 주면서 [눈물]을 흘리는 <BR>꿈 ','문무기구에관한꿈','아는 사람의 죽음이나 나쁜 소식을 듣게 될 꿈이다.','N');
