insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9801','','[생일][카드]나 [성탄]카드를 받는 꿈 ','문무기구에관한꿈','업무상 중요한 사실을 알게 되거나 중요한 아이디어를<BR>얻을 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9802','','가지고 있던 [지도]가 찢어지거나 잃어 버리는 꿈 ','지리에관한꿈','무리하게 일을 추진하다가 결국 실패하게 된다는 암시<BR>이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9803','','[배]를 타고 어디론가 떠나는 꿈 ','배 자동차에관한꿈','인생에 있어 중요한 전환기를 맞게 된다는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9804','','[배]를 타고 [강]을 건너는 꿈 ','배 자동차에관한꿈','인생의 고비를 의미하거나 죽음을 의미한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9805','','자기가 탄 [배]가 [항구]로 들어오는 꿈 ','배 자동차에관한꿈','지금까지 해온 일에 성과를 보는 꿈이다. 만선으로 들<BR>어오면 횡재수가 있다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9806','','자기가 탄 [배]가 [항구]를 떠나는 꿈 ','배 자동차에관한꿈','인생의 새로운 출발을 의미하고 용기를 내어 새로 일<BR>을 시작하면 목표에 도달할 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9807','','자기가 탄 [배]가 [항구]에 [정박]해 있는 꿈 ','배 자동차에관한꿈','인생의 침체기에 들어섰음을 상징한다. 혹은 인생의 <BR>목표를 잃고 방황하는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9808','','자기가 탄 [배]가 뒤집히거나 가라앉는 꿈 ','배 자동차에관한꿈','인생의 위기를 암시한다. 속임수나 배반에 주의하고 <BR>가정의 불화를 조심하라.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9809','','[배]가 [침몰]하는 것을 보는 꿈 ','배 자동차에관한꿈','큰 사업이나 어떤 소원을 성취시킬 일이 생기는 꿈이<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9810','','자기가 탄 [배]가 [하늘]을 나는 꿈 ','배 자동차에관한꿈','행운의 징조이다. 성공의 호기가 찾아오거나 엄청난 <BR>부귀를 가지게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9811','','[모터][보트]를 타고 [수면]을 달리는 꿈 ','물과불에관한꿈','불안과 긴장에 휩싸여 있다는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9812','','자기가 탄 [배]가 [바람]을 타고 순조롭게 [운항]하는 <BR>꿈 ','배 자동차에관한꿈','벌이고 있는 일이 순조롭게 풀리고 해결될 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9813','','자기가 탄 [배]가 [불]이 나는 꿈 ','물과불에관한꿈','사업이나 집안일이 번창할 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9814','','자기가 탄 [비행기]가 [추락]하는 꿈 ','배 자동차에관한꿈','지금까지 정성들인 일이 하루 아침에 무너지는 꿈이<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9815','','[차]를 몰고 [드라이브]하며 즐거워하는 꿈 ','배 자동차에관한꿈','조만간에 행운이 찾아올 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9816','','[차]가 [고장]나서 [길] 한가운데 서있는 꿈 ','배 자동차에관한꿈','하고 있는 일에 장애가 생길 꿈이다. 일의 지체를 의미<BR>한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9817','','[트럭]에 [소금]을 [운반]하는 꿈 ','배 자동차에관한꿈','사업자금을 마련할 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9818','','[차]가 뒤집히고 구르는 꿈 ','배 자동차에관한꿈','하던 일의 좌절을 의미한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9819','','[차]가 [물] 속이나 [수렁]에 빠지는 꿈 ','배 자동차에관한꿈','사업기반을 잃게 될 꿈이다. 하던일이 남에게 넘어가<BR>는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9820','','[운전]하는 사람이 없는데 [차]가 가는 꿈 ','배 자동차에관한꿈','죽음이나 사망을 의미한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9821','','[차]에 치어 자기가 죽는 꿈 ','배 자동차에관한꿈','모든일에 행운이 찾아 올 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9822','','자기[차]가 [남]을 치어 죽이는 꿈 ','배 자동차에관한꿈','횡재수를 암시한다. 사업의 활기차고 일이 잘 풀리고 <BR>이득을 볼 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9823','','[차]에 [기름]이 떨어지는 꿈 ','배 자동차에관한꿈','사업자금이나 재산의 여유가 없어지는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9824','','자신이 찬 [공]이 [운동장] 밖으로 나가는 꿈 ','행동에관한꿈','공로를 치하받거나 능력을 과시하는 일이 생긴다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9825','','[동물]이 [헤엄]치는 꿈 ','동물에관한꿈','자신의 사업이 정부기관의 개입으로 호전된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9826','','[연주회]를 듣고 있는 꿈 ','연극 영화 미술에관련된꿈','자신의 매력을 과시하고 싶음을 뜻한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9827','','[대중]앞에서 [노래]를 부르는 꿈 ','연극 영화 미술에관련된꿈','많은 사람들을 따르게 한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9828','','[오랜만]에 만난 [사람]과 함께 반기며 [기뻐]하는 꿈 ','만남과이별의꿈','무관심이나 불만이 있다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9829','','[돼지]가 [똥]을 누는 꿈 ','배설물에관한꿈','횡재수가 발동하여 머지않아 당신 손에 엄청나게 큰 <BR>돈이 들어오게 될 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9830','','[돼지]가 떼로 몰려오는 꿈 ','동물에관한꿈','전혀 예상하지 못했던 일이 순조롭게 풀리거나, 소액<BR>을 투자한 일이 뜻밖의 호재로 인해 일확천금을 가져<BR>다 줄 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9831','','[돼지]와 함께 노는 꿈 ','동물에관한꿈','현재 진행 중인 사업이 순조롭게 진행되어 머지않아 <BR>큰 돈을 만질 수 있게 될 것이다. 재물과 돈이 저절로 <BR>굴러 들어오는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9832','','[아내]가 [돼지]를 안고 있는 꿈 ','동물에관한꿈','태몽으로 재복과 인덕을 갖춘 아기를 잉태하게 될 징<BR>조이다. 횡재수가 들어오게 되어 전혀 예상하지 못했<BR>던 일로 인해 금전적인 이득을 보게 될 수도 있다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9833','','[돼지]를 본 꿈 ','동물에관한꿈','운수대통의 꿈을 상징하므로 복권의 당첨, 매매 등으<BR>로 뜻하지 않는 횡재와 환희를 맛보는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9834','','[돼지] [우리]에 [불]이 나는 꿈 ','물과불에관한꿈','하는 일마다 순조롭게 번창하고 횡재수까지 들어오게 <BR>될 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9835','','[황소]만한 [돼지]가 [방] 안으로 들어오는 꿈 ','동물에관한꿈','꾸준히 추진한 일이 성사되어 돈이 차차 들어오기 보<BR>다는 전혀 뜻하지 않은 일 또는 투자 등으로 별안간 재<BR>물이 생길 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9836','','[돼지]를 타고 [강], [호수] 또는 [바다]를 건너가는 꿈 ','동물에관한꿈','재물 또는 사업 등에 있어서 횡재를 할 수 있는 좋은 <BR>꿈이다. 현재 진행 중인 사업 또는 투자에서 좋은 결과<BR>를 예상할 수 있다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9837','','[돼지][새끼]를 안아 올리는 꿈 ','동물에관한꿈','증권, 부동산 등에 투자한 돈이 뜻밖의 호재를 만나 큰<BR>돈이 되어 돌아올 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9838','','[돼지]를 타고 다니는 꿈 ','동물에관한꿈','특히 산돼지를 타고 다녔다면 장차 대길할 징조이다.<BR>현재 추진하는 투자 또는 사업 등에서 좋은 결과를 예<BR>상할 수 있다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9839','','[용]을 타고 날아다니는 꿈 ','용과관련된꿈','좋은 징조이다. 대운이 찾아와 소원하던 일을 성취할 <BR>수 있으므로 하던 일은 막힘 없이 풀려나가며 후일에<BR>는 부귀영화가 찾아오게 됨을 예시한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9840','','[용]을 낳는 꿈 ','용과관련된꿈','태몽으로 아내나 새댁이 임신하게 되어 건강하고 훌륭<BR>하게 장성할 옥동자를 잉태하게 될 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9841','','깜깜한 [동굴] 속에서 [용]이 [불]을 뿜어내는 꿈 ','용과관련된꿈','전혀 예상하지 못했던 친지 또는 귀인으로부터 희소식<BR>이 날아와 당신의 사업 또는 문제해결에 엄청난 도<BR>움을 주게 될 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9842','','[용]이 울부짖으며 [하늘]로 올라가는 꿈 ','용과관련된꿈','용이 하늘로 무사히 승천했다면 머지않아 좋은 소식이<BR>있을 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9843','','[해룡](海龍)이 [불]을 토하며 [승천]하는 꿈 ','용과관련된꿈','장차 큰 조직의 우두머리 또는 책임자가 되어 수많은 <BR>부하직원이나 따르는 무리를 거느리게 될 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9844','','[용]([황룡])이 울부짖으며 [승천]하는 꿈 ','용과관련된꿈','황룡꿈은 주로 절대적인 권력과 관련이 많은 꿈이다.<BR>천하통일, 소원성취, 부귀영화, 입신양명, 금의환향 등<BR>의 일이 있다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9845','','[용]이 [입]으로 [금괴] 또는 [옥][구슬] 등을 토해내는 <BR>꿈 ','용과관련된꿈','집안 또는 회사에 경사가 있고, 각종 경쟁에서 당당히 <BR>승리하여 엄청난 재물을 얻게 될 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9846','','[용]이 [집][안]을 훤히 밝혀주는 꿈 ','용과관련된꿈','대단한 행운이 집안에 찾아들 징조이다. 아직 결혼하<BR>지 못한 미혼자가 있다면 좋은 반려자를 만나 성대한 <BR>결혼식을 올리게 될 것이고, 장사나 사업을 하는 사람<BR>은 대호황을 누리게 될 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9847','','[용] 두 마리가 날아와 [집][안] 혹은 [옷] 속으로 들어<BR>오는 꿈','용과관련된꿈','새댁이나 주부가 있는 집안이라면 쌍둥이를 가지게 될<BR>태몽이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9848','','[용]으로 변해 [승천]하는 꿈 ','용과관련된꿈','소원하던 바를 이루게 되니 후일에 큰 명성을 얻어 세<BR>상에 알려지게 되어 명예로운 일을 하게되는 것을 암<BR>시한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9849','','자신이 [화장실]을 치우는 꿈 ','배설물에관한꿈','화장실을 치면 횡재할 운이 있으니 재복 즉, 금전운이 <BR>좋아지며 제법 큰 돈이 손에 들어오게 될 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9850','','자신이 [똥]을 짊어지고 오는 꿈 ','배설물에관한꿈','아주좋은 징조이다. 대소변을 짊어지고 집으로 돌아오<BR>면 대길할 운이다. 특히, 사업가가 이꿈을 꾸었다면 사<BR>업이 번창하여 재물이 들어오는 좋은 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9851','','[똥]을 [손]으로 주무르는 꿈 ','배설물에관한꿈','현재 추진 중인 사업 또는 투자건이 순조롭게 잘 진행<BR>되어 머지않아 큰 돈을 만지게 될 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9852','','[변소] 속에 빠졌다가 나오는 꿈 ','배설물에관한꿈','좋은 징조이다. 현실에서 대변은 더러운 것으로 여기<BR>지만 돈 즉, 재물을 상징한다. 뜻밖의 횡재나 복권 또는<BR>경품행사에 당첨될 가능성이 많다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9853','','[하늘]의 [태양]이 갑자기 자신의 [입] 속으로 들어오는<BR>꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','이 세상 부러운 것이 없을 정도로 최고의 행운이 따른<BR>다. 사업을 하는 사람은 사업의 번창과 더불어 유능한 <BR>사원을 얻게 되고, 연예인은 인기정상에 오르게 된다. <BR><BR>또한, 국가고시 등 중요한 시험을 앞둔 고시생 또는 수<BR>험생의 경우에는 우수한 성적으로 합격하게 된다. 만<BR>일, 새댁이나 주부가 이 꿈을 꾸었다면 장차 훌륭한 인<BR>물로 성장하게 될 총명한 아기를 잉태하게 되거나, 이<BR>미 잉태했을 가능성이 많다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9854','','[해]가 다가와 [품] 속으로 들어오는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','태몽으로, 장차 인격과 덕망을 갖춘 훌륭한 지도자로 <BR>성장하게 될 총명한 사내아이가 태어나게 될 징조이<BR>다. 이 아이가 태어나 성장함에 따라 가세가 번창하게 <BR>되고 온 집안이 평안하게 된다 ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9855','','[태양]이 붉게 빛나고 있는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','윗사람으로부터 칭찬을 받거나 좋은 소식이 전해진다.<BR>직장인인 경우에는 좋은 자리로 승진를 하게 되고, 소<BR>설가인 경우에는 독자로부터 좋은 평을 얻어 명예를 <BR>획득하게 된다. <BR><BR>소원성취, 부귀공명, 입신양명하게 될 징조이다. 또한, <BR>결혼한 새댁이나 부인이 이 꿈을 꾸었다면 장차 훌륭<BR>한 인물로 성장하게 될 아들을 잉태하게 되거나, 이미 <BR>잉태했을 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9856','','뜨거운 [해]를 [입]으로 삼키는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','오랜 세월동안 염원해 온 일이 성사되며, 아내 또는 새<BR>댁은 임신을 하여 훌륭한 옥동자를 낳게 될 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9857','','[산] [봉우리] 위로 [해]가 떠오르는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','권력, 명예, 부귀, 승리 등과 관련이 깊은데, 바로 눈 앞<BR>의 이익보다는 보다 장기적인 차원에서의 성공을 암시<BR>하는 길몽 중의 길몽이다. <BR><BR>또한, 부인, 새댁 또는 임산부가 이 꿈을 꾸었다면 장차<BR>국가에 큰 공을 세울 훌륭한 사내아이를 잉태하였거<BR>나, 곧 잉태하게 될 가능성이 많다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9858','','[바다]에서 [해]가 솟아 오르는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','그 동안의 고생이나 노력의 성과로서 집안 또는 회사<BR>에 큰 경사가 있을 징조이다. 입학, 취직, 승진, 합격, 당<BR>선, 승리 등 그 동안 애타게 바라던 소망이 곧 이루어<BR>질 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9859','','[무지개] 뒤쪽에서 [햇빛]이 비쳐오고 있는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','좋은 꿈이다. 이 꿈이 암시하는 것은 타인의 도움을 받<BR>아 성공할 수 있다는 것이다. 직장인은 웃사람의 칭찬<BR>을 받거나 신임을 얻게되며, 사업을 하는 사람은 큰 이<BR>익을 남기게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9860','','[해]를 향해 [절]을 하거나 [기도]하는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','현재 무엇인가를 강렬하게 원하고 있다는 것을 암시하<BR>는 꿈으로서 신앙심이나 자신에 대한 믿음을 더욱 두<BR>텁게 하여 난국을 헤쳐나가면 머지않아 좋은 소식이 <BR>올 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9861','','[방문] 틈으로 따사로운 [햇살]이 들어오는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','현재 추진하고 있는 일이 의외로 순조롭게 풀려 머지<BR>않아 좋은 소식을 듣게 될 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9862','','[불]을 켰는데 한번에 [불꽃]이 잘 일어나는 꿈 ','물과불에관한꿈','계획했던 일이 순조롭게 진행된다. 사업을 하는 사람<BR>은 일이 잘돼서 재물을 모으게 된다. 또한 공직자나 직<BR>장인의 경우에는 좋은 직무나 직위가 상승하게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9863','','깜깜한 [동굴] 속에서 [용]이 [불]을 뿜어내는 꿈 ','용과관련된꿈','전혀 예상하지 못했던 친지 또는 귀인으로부터 희소식<BR>이 날아와 사업 또는 문제해결에 엄청난 도움을 주게 <BR>될 징조이다. <BR><BR>뿜어져 나오는 불길의 정도에 따라 다소 차이가 날 수<BR>는 있겠지만, 횡재수 또는 입십출세의 길이 눈 앞에 가<BR>까이 와 있다고 볼 수 있다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9864','','[바다] 위로 [불][길]이 솟아 오르는 꿈 ','물과불에관한꿈','길몽 중의 길몽으로 재복과 성공을 암시하는 꿈이다. <BR>그 동안 추진해온 일들이 우여곡절 끝에 마침내 성사<BR>되며, 그 결과 또한 매우 흡족할 것이다.<BR>&nbsp;<BR>대부분 금전운을 가져다 주는 이 꿈은 소원성취, 부귀<BR>공명, 금의환향 등을 암시하는 좋은 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9865','','[무덤] 위에 [불]이 나는 꿈 ','제사와무덤에관한꿈','무덤 위에 불이 나면 재수가 대통할 징조이다. 특히, 복<BR>권을 샀다면 1등에도 당첨될 수 있는 아주 좋은 꿈이<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9866','','[솥] 밑에서 [불]을 지피는 꿈 ','물과불에관한꿈','좋은 꿈이다. 솥 밑에서 불을 지피면 세상에 이름을 널<BR>리 떨치게 되고 재물도 얻게 될 징조이다. 머지않아 재<BR>물이 쌓이게 될 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9867','','온 [몸]이 활활 타는 꿈 ','물과불에관한꿈','자신을 희생하여 좋은 일을 할 징조이다. 따라서 여러 <BR>사람으로부터 존경받는 위치에 오르게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9868','','[촛불]을 들고 있는 꿈 ','물과불에관한꿈','좋은 징조이다. 사랑하는 사람을 그리워 하는 애정을 <BR>나타내는 꿈이다. 하지만 이 꿈을 계기로 애정이 싹트<BR>게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9869','','[배]가 [불]에 타고 있는 꿈 ','물과불에관한꿈','미혼남녀는 여러 곳에서 혼담이 들어오게 된다. 직장<BR>인은 승진하게 되고, 사업을 하는 사람은 일이 순조롭<BR>게 진행된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9870','','[궁궐]이 [불빛]으로 인해 환해지는 꿈 ','물과불에관한꿈','좋은 징조이다. 가족 중 누군가가 출세하는 일이 생기<BR>며 행운이 찾아오고 현재의 고민이 깨끗이 해결된다. <BR><BR>특히, 수험생이나 고시생이 있는 집안은 오랜 동안의 <BR>수험생활을 벗어나 고시나 시험에 합격하는 영광을 누<BR>리게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9871','','[램프]에 [불]이 켜진 꿈 ','물과불에관한꿈','좋은 징조이다. 램프에 불이 켜진 꿈은 현재의 사업이<BR>나 계획한 일이 생각한 대로 만족하게 진행될 것을 나<BR>타내는 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9872','','[입][안]으로 [별]이 들어오는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','좋은 징조이다. 사업을 하는 사람의 경우 사업이 번창<BR>하고, 직장인인 경우에는 승진할 수 있다. <BR><BR>또한, 새댁이나 부인이 이 꿈을 꾸게 되면 총명하고 건<BR>강한 사내아기를 잉태하게 되거나, 이미 잉태했을 가<BR>능성이 많다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9873','','빛나는 [별]을 보고 있는데 어디선가 [뱀]이 나타나는 <BR>꿈 ','동물에관한꿈','매우 경사스런 일이 생길 수 있다. 주변 사람들로부터 <BR>신임을 얻게 되어 찬사와 부러움을 한 몸에 받게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9874','','[별]이 반짝이며 일렬로 쭉 서 있는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','별은 군인이나 연예인을 의미하는 경우가 많다. 따라<BR>서, 군인은 진급하게 되고 연예인은 최고의 인기를 얻<BR>게 된다. 또한 미혼여성은 장차 이름을 떨치게 될 훌륭<BR>한 배우자를 만나게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9875','','[구름]을 타고 가다가 [별]을 보는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','자신이 세운 목표가 달성될 시기에 거의 도달해 있음<BR>을 암시한다. 처음에 세운 계획대로 일관성 있게 일을 <BR>진행시킨 사람은 좋은 결과를 얻을 수 있다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9876','','[밤] [하늘]에 [별]이 한 개만 반짝이고 있는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','좋은 징조이다. 경사스런 일이 생기고, 사회적으로 인<BR>정받아 이름을 떨치게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9877','','[밤][하늘]에 [달]과 [별]이 함께 빛나고 있는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','여자 보다는 남자에게 대길한 꿈으로서 만사가 순조롭<BR>게 진행되어 좋은 결실을 맺게 될 것을 암시한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9878','','[밤] [하늘]에 [별]들이 모여 있는데 그 가운데 [달]이 <BR>빛나고 있는 꿈&nbsp;','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','좋은 징조이다. 자신이 계획했던 일이 주위 사람들의 <BR>도움을 받아 잘 풀려나갈 수 있다. 특히, 사업가는 협력<BR>자의 도움으로 사업이 크게 번성하여 부귀영화를 누리<BR>게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9879','','[밤] [하늘]에 갑자기 [별][빛]이 찬란하고 별이 많이 나<BR>오는 꿈','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','좋은 징조이다. 사업을 하는 사람은 사업이 잘되며, 경<BR>사스런 일이 생긴다. 또한 연예인의 경우에는 인기 정<BR>상에 오르게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9880','','[나무] 위에 [별] 세 개가 일렬로 늘어서 있는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','좋은 징조이다. 자신의 실력을 발휘해서 남으로부터 <BR>존재를 인정받게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9881','','[밤][하늘]에 [별]들이 초롱초롱하게 빛나고 있는 꿈 ','하늘 해 달 별 안개 비 눈 번개 등에관한꿈','행복이 찾아오는 꿈이다. 오랫동안 고민했던 일이나 <BR>풀리지 않아 가슴답답했던 일들이 모두 해결된다. <BR><BR>암울했던 날들은 사라지고 활력이 넘치는 새로운 날들<BR>이 기다리고 있다. 친구와는 우정이, 이성과는 사랑이 <BR>진전되며, 화목한 가정을 꾸미게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9882','','[바다] 위를 걸어 다니는 꿈 ','연못이나바다에관한꿈','큰 조직이나 단체에서 막중한 역할을 성공적으로 수행<BR>하여 주변 사람들을 놀라게 하고 존경을 받게 될 징조<BR>이다. <BR><BR>즉, 훌륭한 업적과 실적을 바탕으로 힘과 재력을 손에 <BR>쥐게 될 것이다. 소원성취, 부귀공명, 금의환향하게 된<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9883','','잔잔하고 드넓은 [망망대해]가 끝없이 펼쳐져 있는 꿈 ','연못이나바다에관한꿈','재복과 인덕을 겸비한 총명한 여자아이를 잉태하거나,<BR>이미 잉태했을 징조이다.<BR><BR>이러한 꿈을 꾸고 나은 아이는 자애롭고 후덕하여 만<BR>인의 존경과 부러움을 한 몸에 받으며 일생을 살아가<BR>게 된다. 또한, 바다는 자원의 보고로서 재물과 연관이 <BR>되기도 하므로 현재 추진 중인 사업 또는 투자로 인해 <BR>막대한 이익을 보게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9884','','[돼지]를 타고 [강], [호수] 또는 [바다]를 건너가는 꿈 ','동물에관한꿈','재물 또는 사업 등에 있어서 횡재를 할 수 있는 좋은 <BR>꿈이다. <BR><BR>현재 진행 중인 사업 또는 투자에서 좋은 결과를 예상<BR>할 수 있으므로, 소원성취하게 된다. 단, 끝까지 무사히<BR>잘 건너야 한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9885','','[바닷속]이 [거울] 보듯이 들여다 보이는 꿈 ','연못이나바다에관한꿈','동업자 또는 상대방의 속마음을 간파하고자 하는 당신<BR>의 잠재의식과 연관된 꿈으로서, 치밀하고 냉철한 예<BR>지력으로 앞날을 예상하고 준비하여 머지않아 좋은 소<BR>식을 접하게 될 징조이다. <BR><BR>재물과 돈이 손에 들어올 것이며, 만인의 부러움을 받<BR>게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9886','','[바다] 위로 [불][길]이 솟아 오르는 꿈 ','연못이나바다에관한꿈','길몽 중의 길몽으로 재복과 성공을 암시하는 꿈이다. <BR>그 동안 추진해온 일들이 우여곡절 끝에 마침내 성사<BR>되며, 그 결과 또한 매우 흡족할 것이다.<BR>&nbsp;<BR>대부분 금전운을 가져다 주는 이 꿈은 소원성취, 부귀<BR>공명, 금의환향 등을 암시하는 좋은 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9887','','[섬]을 향해 [바다]를 [헤엄]치는 꿈 ','연못이나바다에관한꿈','좋은 징조이다. 어려움에 봉착되어 있다가 드디어 실<BR>마리를 찾아 번창하게 됨을 암시하는 꿈이다.<BR><BR>학생은 성적이 오르거나 인기가 높아지고 직장인은 주<BR>요한 직책을 수임하게 되며, 사업은 순풍에 돛 단 듯 <BR>잘 진행된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9888','','[바닷물]을 벌컥벌컥 마셔대는 꿈 ','연못이나바다에관한꿈','오랜 세월동안 갈구하며 소원했던 일들이 머지않아 이<BR>루어질 징조이다. <BR><BR>그 동안의 갈증과 고통을 뒤로 하고, 재물과 권력을 한<BR>손안에 다 잡게 될 것이나, 끝에 가서 다소 힘겨운 경<BR>쟁이나 싸움을 해야 할 수도 있다. 그러나, 행운의 여신<BR>은 당신을 쳐다보고 있다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9889','','유유히 흐르는 [강][물]이나 [바닷물]의 꿈 ','연못이나바다에관한꿈','현재 추진 중인 사업이나 투자 등의 일이 순조롭게 진<BR>행될 것을 암시하는 꿈이다. <BR><BR>큰 어려움이나 장벽 없이 원만하게 진행되어 머지않아<BR>좋은 결과를 기대할 수 있으며, 대부분 그 결과는 금전<BR>적인 보상으로 나타난다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9890','','큰 [배]가 [바다] 위를 떠다니는 꿈 ','배 자동차에관한꿈','좋은 꿈이다. 재물운이 강하게 작용하고 있음을 암시<BR>하고 있다. 재수가 좋아져 금전적인 이익이 있을 것이<BR>다. 주위의 사람들이 서로 도와 화합하게 되고 부러움<BR>을 사는 일이 생길 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9891','','커다란 [소나무]를 보고 올라가는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','대길의 운이 찾아오니 입신양명하는 길이 눈앞에 펼쳐<BR>지고 있는 꿈이다. <BR><BR>하던 일이 잘 풀려 그에 상응하는 재운과 명성이 찾아<BR>올 것을 암시한다. 소나무의 크기에 비례하여 길운의 <BR>정도 차이를 알 수 있다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9892','','자신의 [집]에 [소나무]가 [산더미]처럼 쌓여 있는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','소나무는 대길함을 상징하므로 소나무가 무성할 수록 <BR>또한 클 수록 집안에 경사스런 일이 겹쳐 번창할 수 있<BR>으며 부귀영화가 찾아왔음을 상징한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9893','','[열매]가 많이 달린 [나무]를 보는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','좋은 징조이다. 재물복이 있다. 사업을 하는 사람은 사<BR>업이 번창하며, 직장인은 승진을 할 수 있다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9894','','자신의 [집][안]에 있는 [꽃나무]에서 [벚꽃]이 [만발]하<BR>는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','좋은 꿈이다. 현실에서는 귀인을 만나게 될 것이다. 자<BR>신을 도와줄 수 있는 사람으로서 자신과는 좋은 인연<BR>을 맺을 수 있는 협력자가 나타나게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9895','','[무덤] 위에 [나무]가 자라는 꿈 ','제사와무덤에관한꿈','무덤 위에 나무가 자라면 길하고, 나무가 부러지면 흉<BR>할 징조이다. <BR><BR>특히, 무덤 위에 나무가 자라나면 사업가, 상인, 직장인<BR>에게는 매우 길하며, 금전운과 명예운을 동시에 가져<BR>다 준다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9896','','[나무]를&nbsp;지고 [집][안]으로 들어가는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','좋은 징조이다. 재물을 등에 지고 집안으로 들어가는 <BR>것으로 해석이 가능하므로 귀한 물건을 얻을 수 있거<BR>나 하던 일이 성공으로 이어져 부귀해질 수 있음을 암<BR>시한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9897','','[뽕나무] [열매]를 먹는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','뽕나무 열매를 먹으면 귀자를 낳을 징조이다. 결혼한 <BR>여자가 이 꿈을 꾸면 임신을 하게 되고 장차 태어날 아<BR>기도 출세하게 되는 아주 좋은 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9898','','뒷동산 아래가 [소나무] [숲]으로 꽉 채워져 있는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','가정에는 경사스런 일이 겹쳐 큰 재물이 들어 올 것임<BR>을 상징하며 자신에게도 재운이 생겨 사업이 호전되어<BR>큰 성공을 하게 되거나, 자금난에 허덕이고 있었다면 <BR>새로운 자금원을 구하게 되는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9899','','[다양한] [종류]의 [나무]를 자기자신이 보는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','좋은 꿈에 해당한다. 꿈에서 나무는 대체로 신체를 의<BR>미하며 가지는 신체의 일부분을 상징한다. 잎이 많은 <BR>나무는 원기 왕성한 젊음을 상징한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9900','','자기 [집] 앞에 [소나무]나 [대나무] 등이 빽빽이 들어<BR>서 있는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','아주 좋은 꿈이다. 이 꿈은 가문이 번창할 꿈이며, 그 <BR>자손들의 장래가 보장되는 아주 좋은 꿈이다. <BR><BR>또한 자기 집 앞에 대나무가 나 있는 꿈은 운수대통할 <BR>좋은 징조이다. 이 꿈을 꾸었다면 매사에 운이 따라 주<BR>어 이익을 얻게 된다. <BR><BR>특히, 사업가나 직장인인 경우에는 사업이 한 단계 성<BR>장하거나 파격적인 승진을 할 수 있는 좋은 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9901','','[임금님]과 [궁전]에서 마주 앉아 있는 꿈 ','행동에관한꿈','어려움에 부딪혀 실마리를 찾지 못했던 일이 점차 해<BR>결의 실마리를 찾게 된다. <BR><BR>또한 집안에 경사스런 일들이 일어난다. 특히, 사업가<BR>의 경우에는 협력자의 도움으로 사업이 한 단계 성장<BR>하여 많은 이익을 보게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9902','','[어의]를 입은 [임금님]을 본 꿈 ','행동에관한꿈','실력자 또는 귀인의 도움으로 평소 소원하던 바를 이<BR>루게 된다. <BR><BR>승진, 특진, 영전, 당선, 재물, 권력 등 하늘과 조상님들<BR>의 은총으로 소원성취, 부귀영달, 금의환향하게 될 징<BR>조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9903','','[왕]의 [부름]을 받는 꿈 ','행동에관한꿈','조만간 기쁜 일이 생길 징조이다. 재력가 또는 실력자<BR>로부터 막중한 임무를 위임받아 회원님의 실력을 선보<BR>일 절호의 기회를 잡게 될 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9904','','[임금님]이 [방] 또는 [거실]에 앉아 있는 꿈 ','집과건물에관한꿈','집안에 경사스런 일이 생길 징조이다. 친지 또는 귀인<BR>의 도움으로 자녀들에게 이로운 일이 생기며, 재물운<BR>도 들어오게 된다. <BR><BR>장차 유복하고 화평한 가정을 이루고 온 가족이 웃음<BR>지으며 살 수 있게 될 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9905','','[임금님]으로부터 [술]을 [하사]받는 꿈 ','음식물에관한꿈','그 동안의 노고와 공로를 확실히 인정받게 되어 주요<BR>한 관직 또는 요직에 임명받게 될 징조이다. <BR><BR>가정주부께서 이 꿈을 꾸셨다면 남편의 승진, 특진, 영<BR>전, 합격, 당선 등이 예상된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9906','','[태자]의 [부름]을 받는 꿈 ','행동에관한꿈','태자 또는 왕자가 부르는 꿈은 머지않아 집안에 경사<BR>가 생길 징조이다. <BR><BR>주변 사람들 또는 동료들의 인정을 받아 요직에 임명<BR>되거나, 중요한 사업에 책임자로 선정되어 실력을 인<BR>정받게 된다. 부귀공명, 금의환향하게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9907','','[제왕]과 더불어 [대화]하는 꿈 ','만남과이별의꿈','제왕을 보고 말하는 꿈을 꾸면 하늘 또는 훌륭한 선조<BR>님들의 은총으로 장차 대길할 징조이다. <BR><BR>그 동안 소망했던 일들이 순조롭게 잘 풀리게 되고, 주<BR>변에 있는 귀인들의 도움으로 하는 일마다 번창하게 <BR>될 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9908','','[대통령]으로부터 [문서] 등을 [수여]받는 꿈 ','행동에관한꿈','직장인이 이 꿈을 꾸었다면 이번 인사발령 때, 분명히 <BR>승진, 특진 또는 영전 등을 기대해 볼 수 있다. <BR><BR>또한, 그 동안의 노고와 공덕을 인정받아 각종 상금 또<BR>는 포상 등도 기대해 볼 수 있으며, 많은 사람들로부터<BR>존경과 부러움을 받게 될 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9909','','[대통령]과 [악수]하는 꿈 ','만남과이별의꿈','귀인이나 실력자의 도움으로 평소 소망하던 바를 이룰<BR>수 있게 될 징조이다. <BR><BR>소망하던 것이 돈이였다면 더 이상 바랄 것이 없는 꿈<BR>으로 횡재수가 들어오게 되어 뜻하지 않은 큰 돈을 만<BR>지게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9910','','[대통령]에게 [인사]드리는 꿈 ','만남과이별의꿈','가까운 장래에 기쁜 소식이 찾아 올 징조이다. 보다 중<BR>요하고 막중한 임무를 수임하게 되어 먼 곳으로 직장 <BR>또는 보직을 이동하게 될 가능성이 많으며, 많은 사람<BR>들로부터 실력과 공로를 인정받아 금의환향, 부귀공명<BR>하게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9911','','[하늘]에서 [금은보화]가 떨어지는 꿈 ','돈과재물에관한꿈','하늘이나 조상님들께서 내려주신 은총을 암시하는 꿈<BR>으로서 아내나 새댁이 총명하고 재복있는 옥동자를 잉<BR>태하게 될 태몽이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9912','','[보석] 실은 [배]를 타는 꿈 ','돈과재물에관한꿈','좋은 꿈이다. 이 꿈을 여성이 꾸었다면 태몽이다. 소망<BR>했던 귀한 자식을 얻게 되고, 집안에는 재물이 들어오<BR>게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9913','','[배]에 번쩍이는 [보석]이 가득한 꿈 ','돈과재물에관한꿈','태몽으로 기다리던 귀한 자식을 얻을 징조이다. 뿐만 <BR>아니라 집안에 재물이 늘어나고 가정은 화목해 진다.<BR><BR>기혼녀가 이 꿈을 꾸면 장차 태어날 아이가 재상의 반<BR>열에 까지 오를 수 있는 아주 좋은 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9914','','[동굴] 또는 [숲]속에서 [보물상자]를 찾아내는 꿈 ','돈과재물에관한꿈','그 동안 고생하며 추진해 온 일이 급작스레 진전되어 <BR>좋은 결과를 가져올 징조이다. 소원성취, 부귀공명, 금<BR>의환향 하시게 될 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9915','','[용]이 [입]으로 [금괴] 또는 [옥][구슬] 등을 토해내는<BR>꿈 ','용과관련된꿈','집안 또는 회사에 경사가 있고, 각종 경쟁에서 당당히 <BR>승리하여 엄청난 재물을 얻게 될 징조이다. <BR><BR>또한, 횡재수가 발동하여 복권 등 뜻밖의 희소식으로 <BR>만사태평, 소원성취 하시게 될 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9916','','[호수]나 [강][물]에서 [금은보화]를 건져 올리는 꿈 ','돈과재물에관한꿈','조심스럽게 추진해 오던 일들이 원만히 해결되어 아주<BR>좋은 결과를 가져오게 될 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9917','','[뜰]에 [금은보화]가 산처럼 쌓여 있는 꿈 ','돈과재물에관한꿈','집안이 번창하고 융성하게 될 징조이다. 전혀 예상하<BR>지 못했던 횡재수로 인해 집안에 재물과 돈이 넘쳐나<BR>게 되어 생활수준 또는 삶의 질이 엄청나게 윤택해 진<BR>다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9918','','[옥][구슬]이 달려있는 [옷]이나 옥으로 만든 옷을 입는<BR>꿈 ','옷과악세사리에관한꿈','주변 인물들의 추천으로 대규모 조직이나 주요한 부서<BR>의 책임자(長)로 임명될 징조이다. <BR><BR>공무원이라면 대관직에 오르거나, 직장인이라면 부서<BR>장의 위치에 임명될 가능성이 매우 높다. 부귀공명하<BR>고 만인에게 이름이 알려지게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9919','','다른 사람의 [보석]이나 [귀금속]을 빼앗아 오는 꿈 ','돈과재물에관한꿈','좋은 징조이다. 돈문제가 해결될 징조로서, 빌려주고 <BR>받지 못했던 채권문제가 어느 정도 해결될 것이며, 전<BR>혀 예상치 못했던 가운데 우연하게 일이 풀리게 된다. <BR><BR>남편이나 시어른 또는 친정식구가 이 꿈을 꾸게 되면 <BR>아내, 며느리 또는 출가한 딸이 임신하게 될 가능성도 <BR>많다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9920','','[호숫가]나 [강가]에서 [옥돌] 또는 [옥][구슬]을 줍는 <BR>꿈 ','옷과악세사리에관한꿈','총명하고 건강한 사내아이를 잉태하거나, 이미 잉태했<BR>을 가능성이 많다. <BR><BR>공부 잘 하며, 영리한 아이로 성장할 것을 암시한다. <BR>또한, 횡재수도 있으므로 조만간 기쁜 일이 생길 징조<BR>이다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9921','','[과일]이 [그릇]에 가득 들어있는 꿈 ','음식물에관한꿈','그동안 노력한 결과가 만족할 만한 재물로 되어 돌아<BR>온다. 가족 중에 경사스런 일이 생길수 있으며 고통스<BR>런 일들은 곧 사라지게 된다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9922','','[과일]을 따는 꿈 ','음식물에관한꿈','좋은 꿈이다. 기다리던 귀한 자식을 얻게되는 꿈이기<BR>도 하며 운수가 대통하여 주어진 환경에서 간절히 원<BR>하던 것을 얻게됨을 예견한다. <BR><BR>특히, 기혼녀가 꾸면 장차 태어날 아이가 출세하여 효<BR>도하는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9923','','[복숭아]나 [감]을 먹는 꿈 ','음식물에관한꿈','꿈에 복숭아나 감을 먹으면 이별하였던 사람과 다시 <BR>만나게 될 좋은 징조이다. 옛친구나 연인으로부터 머<BR>지 않아 다시 연락이 온다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9924','','[배]를 먹는 꿈 ','음식물에관한꿈','꿈에서 자신이 배를 먹으면 재물을 잃게 될 징조이다.<BR>특히, 사업가나 상인의 경우 현재는 별 문제가 없어 보<BR>이나, 장차 매출부진, 자금압박 등 경영상의 어려움을 <BR>겪게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9925','','[참외]를 먹는 꿈 ','음식물에관한꿈','참외를 먹으면 귀자를 낳을 징조이다. 특히, 결혼한 여<BR>자가 이 꿈을 꾸면 태어날 아기가 식복과 인덕을 타고<BR>나며, 장차 인재가 될 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9926','','[포도]를 먹는 꿈 ','음식물에관한꿈','꿈에 포도를 먹으면 이별했다가 다시 만날 징조이다.<BR>또한, 집안에 경사가 많이 생겨 화목하게 되며, 미혼여<BR>성이 이 꿈을 꾸게 되면 사랑했던 남자가 다시 찾아 오<BR>게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9927','','[포도][나무] 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','꿈에 포도나무를 보면 재물이 들어와 부자가 될 징조<BR>이다.또한, 포도열매를 먹어도 집안에 기쁜 일이 많이 <BR>생겨 온 가족이 화평하게 지내게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9928','','[수박] 꿈 ','음식물에관한꿈','수박 꿈은 길한데, 수박을 따서 들어보면 재수가 있을 <BR>징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9929','','[과일]을 먹는 꿈 ','음식물에관한꿈','꿈에 과일을 먹으면 병에 걸린 환자에게는 흉할 징조<BR>이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9930','','갑자기 [방문객]이 [방문]해서 자신이 진행하던 일을<BR>하는 꿈 ','행동에관한꿈','현실에 있어서는 일을 계속할 수 가 있게 된다. 오히려<BR>너무 바빠서 외부사람을 아무도 만날 수 없다고 하는 <BR>상태가 된다. 너무 바빠서 항상 고민하고 있는 사람이 <BR>이런 꿈을 자주 꾸게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9931','','자기자신이 어떠한 [일]로부터 [벗어나]려고 하는 꿈 ','행동에관한꿈','자기자신이 현실에서 탈피하고 싶은 어려운 문제에 봉<BR>착해 있다는 것을 암시한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9932','','자신이 [큰][일]을 일으킨 것 같은 꿈 ','행동에관한꿈','자신이 뜻하지 않았던 능력을 발휘하여 큰 일을 해내<BR>거나, 모두 놀랄 만한 사건을 일으킬 징조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9933','','꿈속에서 [기쁜] [일]이 있는데 그 [까닭]을 알 수 없는<BR>꿈 ','행동에관한꿈','꿈에서와 같이 실제로 좋은 일이 일어날 징조를 나타<BR>내는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9934','','[조상]으로부터 [과일]을 받는 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','가정에 불화가 닥쳐오게 됨을 암시하며 가족 가운데 <BR>중병으로 고생하는 사람이 생기거나 건강이 매우 악화<BR>되는 것을 암시한다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9935','','자기가 [파인애플]을 먹고 있는 꿈 ','음식물에관한꿈','소식이 없던 친구로부터 소식이 오거나 소원이 이루어<BR>진다. 특히 결혼한 여성이 이 꿈을 꾸면 좋은 일이 일<BR>어난다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9936','','[사과]를 먹고 있는 꿈 ','음식물에관한꿈','여성에게는 좋아하는 남성으로부터 사랑을 받게 된다.<BR>그러나 꿈 속에서 설 익은 사과를 먹으면 싸우는 일이 <BR>생기게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9937','','[단][과일]이나 [신]과일을 먹는 꿈 ','음식물에관한꿈','재물을 탕진하게 되거나 친한 친구와 헤어지는 일이 <BR>생기게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9938','','익지 않은 [과일]을 남에게서 받는 꿈 ','음식물에관한꿈','사회를 이해 봉사할 수 있는 일이 생기고, 자신을 아껴<BR>주는 사람이 나타나게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9939','','[과일]을 먹거나 보는 꿈 ','음식물에관한꿈','과일은 여성을 의미한다. 특히 나무에서 과일을 따서 <BR>먹는 꿈은 강한 성적 욕망을 나타내는 것으로 사랑하<BR>는 연인과 육체 관계를 맺고 싶다거나 마음에 있는 여<BR>성을 유혹하고 싶은 욕망을 의미한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9940','','[병든] [사람]이 일어나는 것을 본 꿈 ','질병에관한꿈','안 좋은 꿈이다. 꿈에서 병든 사람이 일어난다면 대흉<BR>하게 된다. 특히, 이꿈을 꾸게되면 가문이 망한다든지<BR>최악의 결과를 초래한다. 흔히 꾸기 힘든 꿈으로 빨리 <BR>퇴몽을 하여야만 한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9941','','자신이 [사랑]하는 사람과 만나는 꿈 ','만남과이별의꿈','실제 생활에서의 성적(性的)인 측면을 보여주는 꿈이<BR>다. 현재 당신은 그다지 정렬적인 사랑이 이루어지지 <BR>못하고 있다. <BR><BR>당신의 소극적인 자세로 사랑하는 사람을 못만나거나 <BR>사랑을 이루지 못하고 있다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9942','','자신이 사귀는 [애인]에게 [머리] [빗]을 [선물]로 받는 <BR>꿈 ','옷과악세사리에관한꿈','꿈속에서의 빗은 고생의 상징한다. 애인으로부터 머리<BR>빗을 선물로 받았다고 하는 것은 그 애인으로 말미암<BR>아 현실에서의 고생이 많을 것임을 예시해 주고 있는 <BR>꿈이라고 할 수 있다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9943','','[사랑]하는 사람과 [오랫동안] 만나지 못하는 꿈 ','만남과이별의꿈','대인관계가 순조롭지 못하거나 연인과 다투는 일이 있<BR>다. 모든 일이 뜻대로 되지 않으므로 성급하게 무엇을 <BR>시작하는 것은 피해야 한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9944','','[연인]과 함께 [호숫가]나 [강가]를 거니는 꿈 ','연못이나바다에관한꿈','어디론가 떠나고 싶은 잠재의식을 암시하는 꿈으로서 <BR>현재 낭만적이고 지적인 사랑을 열망하고 있다는 것을<BR>말한다. 현재 열렬한 사랑을 하고 계신 상태라면 두 사<BR>람의 사랑이 더욱 깊어질 것을 암시하기도 한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9945','','[사랑]하는 사람과 [만나는] 꿈 ','만남과이별의꿈','좋은 징조이다. 실제 생활에서의 성적(性的)인 측면을 <BR>보여주는 꿈이다. 자신의 진실한 마음을 상대에게 표<BR>현하면 진정한 사랑을 만나게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9946','','자신이 [여자]에게 [쫓기는] 꿈 ','행동에관한꿈','안좋은 꿈이다. 꿈에서 남자가 여자에게 추격당하면 <BR>자신의 부인이나 이성에게 불상사가 생기게 되는 것을<BR>암시한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9947','','[검은] [사마귀]가 생기는 꿈 ','사람의몸에관한꿈','안좋은 꿈이다. 얼굴이나 몸에 검은 사마귀가 생기는 <BR>꿈을 꾸게 되면 하는 일 마다 장애가 생기게 되어 어려<BR>움을 겪게 된다. <BR><BR>대인관계도 원만해 지지 않고 회사의 일이나 사업에 <BR>문제가 발생한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9948','','[검은] [점]이 생기는 꿈 ','사람의몸에관한꿈','안좋은 꿈이다. 얼굴에 검은 점이 생기면 흉한다. 하지<BR>만 다리에 검은 점이 생기면 다른 사람의 도움으로 꾸<BR>려가고 있는 일들이 번창하게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9949','','[음식] 먹는 곳으로 모이는 꿈 ','음식물에관한꿈','꿈에 사람들과 함께 음식 먹는 곳으로 모이면 장차 큰 <BR>부자가 될 징조이다. 특히, 사업가나 상인이 이 꿈을 꾸<BR>었다면 매출이 커지고 순이익이 많아지는 길몽이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9950','','자기자신이 [상점][주인]과 [대화]하는 꿈 ','만남과이별의꿈','이꿈은 현실에서는 어떤 협력자를 만나게 된다. 그러<BR>나 상점주인과 다투는 꿈일 경우에는 실제로는 협력자<BR>와 좋지 않은 관계가 되고, 서로 부담스러운 존재로 바<BR>뀌게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9951','','[점쟁이]에게 자신의 [점]을 보는 꿈 ','행동에관한꿈','몸 관리 특히 건강에 유의해야 한다. 질병을 얻을 징조<BR>이다. 평소에 건강했던 사람도 이꿈을 꾸게 되면 병원<BR>에 가게 되는 안좋은 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9952','','[신]이 [운세]나 [점]을 봐주는 꿈 ','신에관련된꿈','하늘의 신들도 굽어 살펴주는 대운이 찾아왔으므로 뜻<BR>한 바를 이루고 하던 일이 성공의 결실을 볼 수 있다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9953','','[사방]이 [상점] [간판]으로 둘러싸인 꿈 ','지리에관한꿈','이 꿈은 자신이 본 간판의 종류에 따라 달라질 수 있<BR>다. 옷가게 간판이 보였다면 옷을 사고 싶은 욕망을 나<BR>타내고, 음식점 간판이 보였다면 뭔가 맛있는 것을 먹<BR>고 싶다는 잠재의식을 나타내는 것이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9954','','[대][소변]을 잃어버리는 꿈 ','배설물에관한꿈','좋지 않은 징조이다. 현실 세계에서 소변과 대변은 더<BR>럽게 여기지만, 꿈속에서는 그렇지 않고 돈과 재물을 <BR>상징한다. <BR><BR>대소변을 잃어 버렸다는 것은 재산이 없어질 것을 암<BR>시한다.반면에 대소변을 주어서 담아오는 꿈을 꾸면 <BR>금전적인 행운이 찾아와 재산을 모으게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9955','','[밤][길]에 [반딧불]이 반짝이는 꿈 ','전원오곡에관한꿈','여행길에 우연히 안내자를 만나 길을 안내받는다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9956','','으스스한 [달][밤]에 [초상집] 주위를 걷는 꿈 ','죽음에관한꿈','친하지 않는 사람과 대화를 한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9957','','캄캄한 [밤]에 [여우] 울음[소리]를 듣는 꿈 ','동물에관한꿈','불길한 소식을 듣거나 천재지변을 예시한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9958','','[밤]에 [달맞이] [꽃]이 환하게 피는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','문예작춤이나 창작, 사업성취,유물발굴,합격,승진등의<BR>길조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9959','','[선산]의 [밤][나무]가 푸르게 보이는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','조상이나 부모의 큰 음덕과 물질적으로 도움을 받을.운이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9960','','[알][밤]을 먹고 [황금][똥]을 누는 꿈 ','배설물에관한꿈','유통관련업에 투자하여 성과를 올린다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9961','','[산신령]으로 부터 [알][밤] 두개를 받는 꿈 ','신에관련된꿈','태몽으로 옥동자 둘을 낳는다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9962','','[다람쥐]가 [밤][나무]에 올라가는 꿈 ','동물에관한꿈','실력자를 만나 도움을 받는다. 재물을 얻거나 승진등<BR>의 길조이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9963','','[한밤중]에 관한 꿈 ','행동에관한꿈','현재의 일이 슬럼프에 빠져 있으므로 무엇을 해도 잘 <BR>이루지 못한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9964','','[앞치마]에 [알][밤]을 담는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','태몽이며 옥동자를 낳는다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9965','','[밤중]에 [산발]을 한 [여인]이 나타나는 꿈 ','행동에관한꿈','집안에 우환이 있을 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9966','','양쪽 [호주머니]에 [밤]을 가득 담는 꿈 ','음식물에관한꿈','학생은 합격하는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9967','','[결혼식][날] [밤]에 [여자]가 [암탉]을 보는 꿈 ','동물에관한꿈','장차 남편이 불구가 될 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9968','','칠흑같이 깜깜한 [밤]에 [촛불]이 빨갛게 타오르는 꿈 ','물과불에관한꿈','희망찬 꿈과 재물, 사랑의 행운등이 있을 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9969','','[밤][나무] 밑에서 떨어지는 밤을 받는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','수주,관급,도급 등의 입찰을 하면 쉽게 낙찰된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9970','','[외갓집]에서 [하루]를 묵는 꿈 ','집과건물에관한꿈','외근과 관계된 부처에서 근무하게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9971','','[횟불]을 들고 [밤길]을 걷는 꿈 ','행동에관한꿈','어려운 일을 극복하거나 진리를 전파한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9972','','한[밤]에 자기와 관련이 있는 [시체]를 [길]에&nbsp;놓는 꿈 ','조상 귀신 /도깨비 시체 에관련된꿈','자신의 일에 성공을 거두며 명성을 얻는다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9973','','[밤][나무] 위로 올라가 밤을 따는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','입학,승진,합격,당선의 소원을 성취한다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9974','','으스럼한 [달][밤]에 [배꽃]이 핀것을 보는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','반가운 사람을 만난다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9975','','[밤][송이]가 잘 익어 벌어진 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','결혼이 빠른 시일안에 이루어 지거나 사업등이 빠르게<BR>마무리 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9976','','[호주머니]에 [구슬],[동전],[알밤] 몇개를 넣는 꿈 ','행동에관한꿈','다음날 남과 다투게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9977','','[곳간]에 [밤]이 가득찬 꿈 ','음식물에관한꿈','많은 재물로서 가문을 빛낸다. 태몽일 경우 여식을 두<BR>게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9978','','[초롱][불]을 들고 [밤][길]을 걷는 꿈 ','행동에관한꿈','현보자나 은인을 만나 일이 잘 성사된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9979','','[상대방]을 두고 다른 사람에게 [시집]가는 꿈 ','행동에관한꿈','가정에 불화가 있으며 한쪽이 죽어 사별하든가 이별수<BR>가 있다. ','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9980','','잘 생긴 [배필]을 맞이하는 꿈 ','행동에관한꿈','귀인을 만나거나 소망을 이루어 재물과 명예가 높게되<BR>는 꿈이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9981','','[아내]가 [결혼]하는 꿈 ','행동에관한꿈','머지않아 아내와 사별하게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9982','','[결혼식][장]이 [화환]으로 [장식]된 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','결사나 집회등의 일의 성공을 암시한다. 표찬을 받는<BR>다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9983','','[남]의 [결혼식][장]에서 상대를 [축하]해 주는 꿈 ','행동에관한꿈','머지 않아 신상에 좋은 일이 있고 미혼자는 배필을 만<BR>나는 운이다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9984','','자신의 [결혼식]에 [배우자]가 바뀌어 있는 꿈 ','행동에관한꿈','계약할 일이 생기며 유리한 조건이 형성된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9985','','[결혼식][장]에 [안개][꽃]이 피어있는 꿈 ','꽃과 나무,돌 등 자연물에 관련한꿈','연회석이나 파티등에 참석하여 즐거운 시간을 보낸다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9986','','[결혼][전]에 [신발] 한짝을 잃어버리는 꿈 ','옷과악세사리에관한꿈','결혼을 하더라도 이별을 하게 된다.','N');
insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9987','','[어린][아이]가 [혼례]를 올리는 꿈 ','행동에관한꿈','집안에 우환이 있고 질병이 있을 징조이다.','N');
