insert into F020(DB_num, DB_express, DB_title, DB_title_1, DB_data, DB_check) values('9989','','[마당]에서 사람들이 웅성거리고 [초상]으로 [상여]나<BR>[영구차]가 보이는 꿈 ','죽음에관한꿈','자신의 권한하에 있는 어떤 기관이나 사업장에서 일어<BR>나는 일이다.','N');
